{id="70057FCB",name="A Feast of Fellowship",cat="Race & Social",d="With the One Ring destroyed and the Enemy undone, the surviving members of the Fellowship of the Ring and their dear friends have gathered in Merethrond for a grand banquet to commemorate the wedding of King Aragorn II Elessar to Queen Arwen Undómiel.\n<rgb=#FF0000>NOTE: You must have the repeatable quest 'A Long-awaited Banquet, A Celebration Without End' underway to advance this Deed.</rgb>",faction="FrP",level=10,minlevel=6,ndx=20,o="Obj 1:\nWith the One Ring destroyed and the Enemy undone, the surviving members of the Fellowship of the Ring and their dear friends have gathered in Merethrond for a banquet to commemorate the wedding of King Aragorn II Elessar to Queen Arwen Undómiel.\n<rgb=#FF0000>NOTE: You must have the repeatable quest 'A Long-awaited Banquet, A Celebration Without End' underway to advance this Deed.</rgb>\n* Complete 'A Long-awaited Banquet -- Frodo Baggins'\n* Complete 'A Long-awaited Banquet -- Samwise Gamgee'\n* Complete 'A Long-awaited Banquet -- Meriadoc Brandybuck'\n* Complete 'A Long-awaited Banquet -- Peregrin Took'\n* Complete 'A Long-awaited Banquet -- Gimli'\n* Complete 'A Long-awaited Banquet -- Legolas'\n* Complete 'A Long-awaited Banquet -- Faramir'\n* Complete 'A Long-awaited Banquet -- Mithrandir'\n* Complete 'A Long-awaited Banquet -- King Aragorn II Elessar'",r={rc={{id="70057619",q=9,val="Midsummer Token"}},ti={{val="Banqueteer"}}},t="Event"},
