{id="7001646C",name="A Guide to the Quiet Knife",cat="Class",class="Burglar",d="You have heard it whispered that the libraries of Moria yet contain many tomes, while many other volumes were brought by the dwarves seeking to reclaim their kingdom of old. One such tome in the libraries of the Iron Garrison is said to be the legendary \\qA Guide to the Quiet Knife.\\q If you can gain enough favour with the Iron Garrison Guards, they may let you have their copy of this book.",faction="FrP",level=60,minlevel=58,ndx=25,o="Obj 1:\n* Achieve level 58\nObj 2:\n* Read the book, \"A Guide to the Quiet Knife\"",r={lp={{val=20}}},t="Class"},
{id="700640FA",name="A Guiding Star",area="Bree",cat="Class",class="Corsair",d="The first four pages of this book can be found on enemies scattered across Angmar, Eregion, and Moria. The last four pages of this book can be found on enemies scattered across Forochel, Moria, and the Misty Mountains.\nIt is purported that A Guiding Star was penned by Círdan the Shipwright, Master of the Grey Havens, but this claim has often been disputed. It seems many readers insist that it is not written in the mode of the Elves—though curiously such criticisms have not often come from Elves—but much praise has been given to the included sketches and diagrams that attempt to map the stars of Middle-earth. Regardless of its true authorship, this book contains a wealth of knowledge about the positions of stars, constellations, and how they might be used as guides for navigation upon the Sea.",faction="FrP",level=42,minlevel=39,ndx=26,o="Obj 1:\n* Collect A Guiding Star\nObj 2:\n* Talk to Mick Maidenhair in the Dwarrow-ward, in Bree-town\nObj 3:\n* A Guiding Star, Page 5\n* A Guiding Star, Page 9\n* A Guiding Star, Page 12\n* A Guiding Star, Page 18\n* A Guiding Star, Page 24\n* A Guiding Star, Page 27\n* A Guiding Star, Page 33\n* A Guiding Star, Page 37",pois={{name="Mick Maidenhair",area="Bree",loc={"31.4S, 51.5W"},zone="Bree-land"}},r={lp={{val=10}},rc={{id="700682A1",val="Star-whistle"}}},t="Class",zone="Bree-land"},
{id="70041708",name="A Hobbit's Holiday",area="Rivendell Valley",cat="Class",class="Beorning",d="The first four pages of this book can be found on enemies scattered across Angmar, Eregion, and Moria. The last four pages of this book can be found on enemies scattered across Forochel, Moria, and the Misty Mountains.\nA Hobbit's Holiday was written by Bilbo Baggins, a hobbit from the Shire who went on an unexpected and surprising adventure. You leaf through the pages with interest to read his account of meeting your ancestor Beorn, but you are unable to find it.\nMany of the pages in the middle of the book have gone missing. An entire chapter seems to be missing. Is it the chapter where he met Beorn?",faction="FrP",level=42,minlevel=39,ndx=27,o="Obj 1:\n* Collect A Hobbit's Holiday\nObj 2:\nBilbo Baggins is in Rivendell, and will be most interested that you found a copy of his book.\n* Talk to Bilbo Baggins at the Last Homely House in Rivendell.\nObj 3:\nYou should search for missing pages from A Hobbit's Holiday throughout Angmar and the Misty Mountains.\n* A Hobbit's Holiday, Page 66\n* A Hobbit's Holiday, Page 67\n* A Hobbit's Holiday, Page 68\n* A Hobbit's Holiday, Page 69\n* A Hobbit's Holiday, Page 70\n* A Hobbit's Holiday, Page 71\n* A Hobbit's Holiday, Page 72\n* A Hobbit's Holiday, Page 73",pois={{name="Bilbo Baggins",area="Rivendell Valley",dungeon="The Last Homely House",loc={"63.5N, 53.9E"},zone="The Trollshaws"}},r={lp={{val=10}}},t="Class",zone="The Trollshaws"},
