{id="70002EB8",name="A Shield-maiden's Song",area="Rivendell Valley",cat="Class",class="Guardian",d="The first four pages of this book can be found on enemies scattered across Angmar, Eregion, and Moria. The last four pages of this book can be found on enemies scattered across Forochel, Moria, and the Misty Mountains.\nA Shield-maiden's Song was written many long years ago and tells the tale of a Shield-maiden of Rohan. While the Shield-maidens of Rohan were rarely called to war, they were nevertheless as well-trained and versed in the arts of battle as their male counterparts. This book tells the tale of one such Maiden caught in unexpected battle, who in striving to defend her Lord against a great onslaught, sang out in clearest tones a stirring song of war as she fought. Such was the power of her voice that even the Orcs whom she faced saw her not as a frail woman, but as a great warrior to be feared.\nAlas, you have no idea how the story ends and several other details beside seem to be missing from this copy of the book, which has been damaged by time and neglect. Perhaps there is someone at Rivendell who would be able to make use of it.",faction="FrP",level=44,minlevel=39,ndx=48,o="Obj 1:\n* Collect A Shield-maiden's Song\nObj 2:\nThis book, though incomplete, may be of interest to someone learning the ways of the guardian. Perhaps there is someone at Rivendell who would be able to make use of it.\n* Talk to Samwise Gamgee in Rivendell\nObj 3:\nThe remaining pages of A Shield-maiden's Song may be found among the blasted terrain of Angmar or among the snowy peaks of the Misty Mountains.\n* A Shield-maiden's Song, page 1\n* A Shield-maiden's Song, page 8\n* A Shield-maiden's Song, page 11\n* A Shield-maiden's Song, page 12\n* A Shield-maiden's Song, page 15\n* A Shield-maiden's Song, page 19\n* A Shield-maiden's Song, page 25\n* A Shield-maiden's Song, page 26",pois={{name="Samwise Gamgee",area="Rivendell Valley",dungeon="Bilbo's Room",loc={"66.8N, 50.7E"},zone="The Trollshaws"}},r={lp={{val=10}}},t="Class",zone="The Trollshaws"},
{id="70037EC8",name="A Shocking Strike",cat="Class",class="Lore-master",d="Call upon the power of lightning to strike your foes.",faction="FrP",level=10,minlevel=1,ndx=49,["next"]={798},o="Obj 1:\nThis is your objective description.\n* Use Lightning Strike",r={lp={{val=5}}},t="Class"},
{id="700010C5",name="A Shot in the Dark",area="Rivendell Valley",cat="Class",class="Hunter",d="The first four pages of this book can be found on enemies scattered across Angmar, Eregion, and Moria. The last four pages of this book can be found on enemies scattered across Forochel, Moria, and the Misty Mountains.\nThis journal was written by a hunter who seems to have spent much of his time alone somewhere on the western borders of Mirkwood across the Misty Mountains, where few Men live and goblins present a frequent threat. With no allies to rely upon and always outnumbered, he discovered the value of uncertainty and fear as a weapon to keep his pursuers off balance as he strove to survive in that rugged country. Having no-one to talk to, it seems that he chose to create a record of his life and experiences.\nThis journal is badly weathered and torn -- perhaps by the self-same goblins whom the hunter claims to have frequently out-witted -- and several key passages are missing. Another hunter of renown might be able to shed some light on this unusual book. Legolas of Mirkwood is said to be in Eriador on a mission of some import.",faction="FrP",level=42,minlevel=39,ndx=50,o="Obj 1:\n* Collect A Shot in the Dark\nObj 2:\nThis journal is badly weathered and torn -- perhaps by the self-same goblins whom the hunter claims to have frequently out-witted -- and several key passages are missing. Another hunter of renown might be able to shed some light on this unusual book. Legolas of Mirkwood, who is said to be in Eriador on a mission of some import.\n* Talk to Legolas in Rivendell\nObj 3:\nIt may be that the missing pages could be found in the high crags of the Misty Mountains or in the ruins of Angmar.\n* A Shot in the Dark, page 5\n* A Shot in the Dark, page 10\n* A Shot in the Dark, page 14\n* A Shot in the Dark, page 16\n* A Shot in the Dark, page 19\n* A Shot in the Dark, page 22\n* A Shot in the Dark, page 23\n* A Shot in the Dark, page 25",pois={{name="Legolas",area="Rivendell Valley",dungeon="Guest Rooms",loc={"66.9N, 51.6E"},zone="The Trollshaws"}},r={lp={{val=10}}},t="Class",zone="The Trollshaws"},
{id="7004170A",name="A Study of the Skin-changer",area="Rivendell Valley",cat="Class",class="Beorning",d="The first four pages of this book can be found on enemies scattered across Angmar, Eregion, and Moria. The last four pages of this book can be found on enemies scattered across Forochel, Moria, and the Misty Mountains.\nThis curious manual seems to describe the nature of your family's ability to take the shape of animals. It is a description of skin-changing over the years, written long ago by someone with very little actual understanding of the ability. You wonder if there is any truth hidden within its exaggerated and mostly-untrue account.\nSeveral pages are missing, but a small, much more recent, bit of parchment tucked into the front cover contains the inscription 'Ask Bilbo.'",faction="FrP",level=44,minlevel=39,ndx=51,o="Obj 1:\n* Collect A Study of the Skin-changer\nObj 2:\nThis curious manual seems to describe the nature of your family's ability to take the shape of animals. It is a description of skin-changing over the years, written long ago by someone with very little actual understanding of the ability. You wonder if there is any truth hidden within its exaggerated and mostly-untrue account.\nSeveral pages are missing, but a small, much more recent, bit of parchment tucked into the front cover contains the inscription 'Ask Bilbo.' Is this a reference to Bilbo Baggins, currently residing in Rivendell?\n* Talk to Bilbo Baggins at the Last Homely House in Rivendell.\nObj 3:\nThe first four pages of this book can be found on enemies scattered across Angmar, Eregion, and Moria. The last four pages of this book can be found on enemies scattered across Forochel, Moria, and the Misty Mountains.\n* A Study of the Skin-changer, Page 4\n* A Study of the Skin-changer, Page 8\n* A Study of the Skin-changer, Page 15\n* A Study of the Skin-changer, Page 16\n* A Study of the Skin-changer, Page 23\n* A Study of the Skin-changer, Page 42\n* A Study of the Skin-changer, Page 11\n* A Study of the Skin-changer, Page 21",pois={{name="Bilbo Baggins",area="Rivendell Valley",dungeon="The Last Homely House",loc={"63.5N, 53.9E"},zone="The Trollshaws"}},r={lp={{val=10}}},t="Class",zone="The Trollshaws"},
