{id="70064506",name="Alchemy of Thaurisgar",area="Carn Dûm",cat="Return to Carn Dûm",d="In the depths of Thaurisgar are remnants of Aniochán the Harrower's foul and twisted experiments. Key among the many tools used to shape his creations was the Bile of Ifrinn, a foetid ichor made by mixing the deadliest of ingredients and substances. Each ingredient carrying with it harmful and undesirable effects. It was in these vile and noxious substances that Aniochán the Harrower found the results he aspired to achieve.",faction="FrP",level=1,minlevel=140,ndx=99,["next"]={1116},o="Obj 2:\nThe alchemical concoctions of Aniochán the Harrower have resulted in the most foul and twisted of experiments. Working with many ingredients and shrouding them in darkness, he was able to create fell abominations out of his test subjects. From the many experiments came a solvent that would become the catalyst of his most wretched creations, Bile of Ifrinn.\nUsing what remains of his research, find all the ingredients to make Bile of Ifrinn.\n* Find scythespew\n* Find adder's blood\n* Find wargslather\n* Find festersweat\n* Find strickenseep",pois={{name="Scythespew",area="Carn Dûm",dungeon="Thaurisgar, the Vile Apothecary",loc={"77.5N, 45.1E"},zone="Angmar"},{name="Festersweat",area="Carn Dûm",dungeon="Thaurisgar, the Vile Apothecary",loc={"76.2N, 44.9E"},zone="Angmar"},{name="Adder's Blood",area="Carn Dûm",dungeon="Thaurisgar, the Vile Apothecary",loc={"76.3N, 45.2E"},zone="Angmar"},{name="Strickenseep",area="Carn Dûm",dungeon="Thaurisgar, the Vile Apothecary",loc={"76.6N, 44.9E"},zone="Angmar"},{name="Wargslather",area="Carn Dûm",dungeon="Thaurisgar, the Vile Apothecary",loc={"76.5N, 45.1E"},zone="Angmar"}},r={rc={{id="70063D43",q=3,val="Sárskillin"}},ti={{val="the Alchemist's Assistant"}},vx={{val=1000}}},t="Lore",zone="Angmar"},
