{id="7000F09F",name="Angmarim-slayer",c={"Good places to find Angmarim for this deed are:\n* Itä-mâ (Normal Level 47-48) [14.6N, 66.8W]\n* All along the Eastern Road starting at (Normal Level 47-48) [16.2N, 63.3W]\n* The Ironspan (Normal Level 47-48) (+3 dread in this area) [17.0N, 59.3W]"},cat="Forochel",d="So it seems that the shadowy fingers of Angmar have stretched even into desolate Forochel, sewing the seeds of conflict here as in all places they touch.\nHere at least, it seems that their preparations are less ready than elsewhere, or perhaps they find little of value, for they rely mostly on their less trustworthy allies -- the Dourhands and the savage Gauredain -- rather than their well-ordered hordes of Orcs and evil Men.",faction="FrP",level=48,minlevel=30,ndx=329,["next"]={331},o="Obj 1:\n* Defeat Angmarim in Forochel",r={lp={{val=5}},ri={{val="+500 with Lossoth of Forochel"}},ti={{val="Angmar's Bane"}}},t="Slayer",zone="Forochel"},
{id="70005C11",name="Angmarim-slayer (Advanced)",cat="Angmar",d="Defeat many Angmarim in Angmar.",faction="FrP",level=41,minlevel=30,ndx=330,["next"]={3726},o="Obj 1:\n* Complete 'Angmarim-slayer'\nObj 2:\n* Defeat Angmarim in Angmar",prev={328},r={lp={{val=10}},rc={{id="7002B017",q=30,val="Mark"}},ri={{val="+700 with Council of the North"}},vx={{val=2000}}},t="Slayer",zone="Angmar"},
{id="7000F0A0",name="Angmarim-slayer (Advanced)",c={"Good places to find Angmarim for this deed are:\n* Itä-mâ [14.6N, 66.8W]\n* All along the Eastern Road starting at [16.2N, 63.3W]"},cat="Forochel",d="It seems that the Angmarim may at best be searching for something, or perhaps simply meddling in the conflicts between the Lossoth and the Gauredain. A full-strength invasion does not seem to be their purpose in Forochel -- at least, not yet.",faction="FrP",level=47,minlevel=30,ndx=331,["next"]={3743},o="Obj 1:\n* Complete 'Angmarim-slayer'\nObj 2:\n* Defeat Angmarim in Forochel",prev={329},r={lp={{val=10}},rc={{id="7002B017",q=30,val="Mark"}},ri={{val="+700 with Lossoth of Forochel"}},vx={{val=2000}}},t="Slayer",zone="Forochel"},
