{id="7002247F",name="Annuminas -- Glinghant",cat="Shadows of Angmar",d="The gardens of Glinghant were once one of the wonders of Annúminas, but have fallen into decay and corruption.",faction="FrP",level=65,minlevel=60,ndx=338,o="Obj 1:\nMuch needs to be done to free Glinghant from the corruption that has overwhelmed it.\n* Complete Impure Waters\n* Complete Keep it from the Enemy\n* Complete Darkest of Waters\n* Complete Glinghant Corrupted\n* Complete Challenge: Nengon",r={rc={{id="7002B017",q=100,val="Mark"}},ti={{val="Garden Guardian"}}},t="Slayer"},
{id="7002248B",name="Annuminas -- Haudh Valandil",cat="Shadows of Angmar",d="Haudh Valandil is the final resting place of Isildur's youngest son. Evil things now gnaw at its roots.",faction="FrP",level=65,minlevel=60,ndx=339,o="Obj 1:\nMuch needs to be done to free Haudh Valandil from the corruption that has overwhelmed it.\n* Complete New Home for the Relics of Old\n* Complete The Kergrim Stalk Haudh Valandil\n* Complete Lights in Darkness\n* Complete End Dolvaethor's Menace\n* Complete Challenge: Valandil and Dolvaethor",r={rc={{id="7002B017",q=100,val="Mark"}},ti={{val="Took the Tomb"}}},t="Slayer"},
{id="70022485",name="Annuminas -- Ost Elendil",cat="Shadows of Angmar",d="Ost Elendil was once the palace of Elendil, first King of Westernesse in Middle-earth. Now it is home to great evil.",faction="FrP",level=65,minlevel=60,ndx=340,o="Obj 1:\nMuch needs to be done to free Ost Elendil from the corruption that has overwhelmed it.\n* Complete The Door-warden of the Inner Chamber\n* Complete Evil in Ost Elendil\n* Complete Blood-stained Runes\n* Complete Balhest, Lord of Ost Elendil\n* Complete Challenge: Balhest",r={rc={{id="7002B017",q=100,val="Mark"}},ti={{val="Palace Protector"}}},t="Slayer"},
