{id="7001791F",name="Bullroarer's Boy",area="Rivendell Valley",cat="Class",class="Warden",d="The first four pages of this book can be found on enemies scattered across Angmar, Eregion, and Moria. The last four pages of this book can be found on enemies scattered across Forochel, Moria, and the Misty Mountains.\nWritten some two hundred years ago, \\qBullroarer's Boy\\q was a fanciful journal kept by Haldemar Took, one of the younger sons of Bandobras Took. After the Battle of Greenfields, Haldemar became a Warden of the Shire, and told many Tall (or rather short) Tales of adventures beyond the Bounds, many of them humorous accounts of battle against goblins and trolls and other beasts, some wholly imagined. Though much of the book is whimsy, there is truth at the core that any Warden would value. Sadly, the three known copies of the book were all stolen, suspiciously, within a week of one another nearly a century ago.",faction="FrP",level=46,minlevel=39,ndx=665,o="Obj 1:\n* Collect Bullroarer's Boy\nObj 2:\n* Talk to Aragorn in Rivendell\nObj 3:\n* Bullroarer's Boy, page 4\n* Bullroarer's Boy, page 7\n* Bullroarer's Boy, page 10\n* Bullroarer's Boy, page 12\n* Bullroarer's Boy, page 17\n* Bullroarer's Boy, page 21\n* Bullroarer's Boy, page 25\n* Bullroarer's Boy, page 33",pois={{name="Aragorn",area="Rivendell Valley",dungeon="Guest Rooms",loc={"66.9N, 51.6E"},zone="The Trollshaws"}},r={lp={{val=10}},rc={{id="70000F31",q=5,val="Distilled Athelas Essence"}}},t="Class",zone="The Trollshaws"},
