{id="70033861",name="Challenge: Webs of the Scuttledells",cat="The Road to Erebor",d="Dígelir, queen of the Great Spiders of Mirkwood, has established a nest in the heart of the Scuttledells, where she is breeding an army to answer the call of Sauron.",faction="FrP",level=85,minlevel=85,ndx=740,["next"]={1180},o="Obj 2:\nYou must burn all the cocoons and webs within Dígelir's nest before defeating Dígelir herself.\n* Complete the quest Webs of the Scuttledells -- Challenge",r={rc={{id="7002B018",q=30,val="Medallion"}},xp={{val=14400}}},t="Slayer"},
