{id="7002451B",name="Challenger of Stoneheight",cat="In Their Absence",d="The Gaunt-lord Ivar, aided by a band of sellswords, swept through the village of Stoneheight in his search for his helm. When his goals were reached, he abandoned the village to the mercy of the sellswords.",faction="FrP",level=65,minlevel=60,ndx=742,["next"]={2744,3579},o="Obj 1:\n* Defeat Búbhosh-grat, and Dale Truitt within 10 seconds of each other.",r={lp={{val=10}},rc={{id="7002B018",q=30,val="Medallion"}}},t="Event"},
