{id="700337A9",name="Champion of Iorbar's Peak",cat="The Road to Erebor",d="The stone-giant Helf has stolen the egg of a Great Eagle. He has retreated back to the safety of his mountain home upon Iorbar's Peak, where he plans to make the egg into his next meal.",faction="FrP",level=85,minlevel=20,ndx=744,["next"]={4437},o="Obj 2:\n* Complete the deed The Stone-giant's Demise\n* Complete the deed Helf's Downfall\n* Complete the deed Saviour of the Eagle Egg",prev={2345,3580,4474},r={rc={{id="7002B018",q=30,val="Medallion"}}},t="Slayer"},
