{id="7001791E",name="Chieftains of the Dúnedain",area="Rivendell Valley",cat="Class",class="Warden",d="The first four pages of this book can be found on enemies scattered across Angmar, Eregion, and Moria. The last four pages of this book can be found on enemies scattered across Forochel, Moria, and the Misty Mountains.\nChieftains of the Dúnedain was a series of annals kept by the Rangers of the North, recording the wisdom of every chief from Aranarth, the first, all the way to Arador. It has much to say of the early days of the Rangers, when they were at their most scattered after the fall of Arnor. It was lost, however, when Arador was slain by trolls in the wilds of the Ettenmoors. It is thought that he buried it before the battle that ended in his death, but none knew where. A new annal was kept beginning with his son, Arathorn II, but all the wisdom of the preceding chieftains vanished, presumably forever.",faction="FrP",level=44,minlevel=39,ndx=762,o="Obj 1:\n* Collect Chieftains of the Dúnedain\nObj 2:\n* Talk to Aragorn in Rivendell\nObj 3:\n* Chieftains of the Dúnedain, page 3\n* Chieftains of the Dúnedain, page 12\n* Chieftains of the Dúnedain, page 13\n* Chieftains of the Dúnedain, page 17\n* Chieftains of the Dúnedain, page 18\n* Chieftains of the Dúnedain, page 23\n* Chieftains of the Dúnedain, page 29\n* Chieftains of the Dúnedain, page 32",pois={{name="Aragorn",area="Rivendell Valley",dungeon="Guest Rooms",loc={"66.9N, 51.6E"},zone="The Trollshaws"}},r={lp={{val=10}}},t="Class",zone="The Trollshaws"},
{id="7001910A",name="Chieftains of the Halls of Crafting",cat="Scourge of Khazad-dûm",d="The Halls of Crafting, once inhabited by the Dwarves of Khazad-dûm in ages past, now boast the finest of Orc-smiths, who serve Mazog. Their work can only be hindered by the defeat of those who command them.",faction="FrP",level=60,minlevel=55,mobs={{name="Âmbal",area="The Flaming Deeps",dungeon="Halls of Crafting",loc={"65.9N, 56.4E","79.3N, 53.7E"},zone="Moria"},{name="Bashkuga",area="The Flaming Deeps",dungeon="Halls of Crafting",loc={"67.3N, 56.3E"},zone="Moria"},{name="Thaguzg",area="The Flaming Deeps",dungeon="Halls of Crafting",loc={"68.6N, 56.3E"},zone="Moria"}},ndx=763,["next"]={2760},o="Obj 1:\n* Defeat Âmbal in the Halls of Crafting\n* Defeat Bashkuga in the Halls of Crafting\n* Defeat Thaguzg in Halls of Crafting",r={lp={{val=5}},rc={{id="7005D8A0",val="Enhancement Runes, Incomparable"}},ri={{val="+700 with Galadhrim"}},ti={{val="Foe-bane"}}},t="Slayer"},
