{id="70054D8E",name="Cleanser of Bâr Nírnaeth, the Houses of Lamentation",area="Minas Morgul",cat="Minas Morgul",d="Deep in the darkness of Thuringwath lies Bâr Nírnaeth, the Houses of Lamentation. There, within that great fane where the Nazgûl once worshipped and made sacrifice to Sauron, one of the Dark Lord's most mysterious servants prepares Dhak Thrakrut, the Rite of Returning.",faction="FrP",level=130,minlevel=125,ndx=865,["next"]={891},o="Obj 2:\nDeep in the darkness of Thuringwath lies Bâr Nírnaeth, the Houses of Lamentation. There, within that great fane where the Nazgûl once worshipped and made sacrifice to Sauron, one of the Dark Lord's most mysterious servants prepares Dhak Thrakrut, the Rite of Returning.\n* Complete Bâr Nírnaeth, the Houses of Lamentation -- Tier 1\n* Complete Bâr Nírnaeth, the Houses of Lamentation -- Tier 2\n* Complete Bâr Nírnaeth, the Houses of Lamentation -- Tier 3\n* Complete Bâr Nírnaeth, the Houses of Lamentation: Slayer of Acolytes of Lamentation\n* Complete Bâr Nírnaeth, the Houses of Lamentation: Slayer of the Unhoused",prev={674,675,676,677,678},r={rc={{id="70053682",q=5,val="Sigil of Imlad Ithil"}},ti={{val="Beyond All Darkness"}},vx={{val=2000}},xp={{val=130000}}},t="Slayer",zone="Mordor"},
{id="7002BE45",name="Clear-cutter",cat="Rise of Isengard",d="The Huorns of Fangorn are special creatures. Sometimes you need to make sacrifices, though. See if you can withstand Undúrz with all his might unleashed.",faction="FrP",level=75,minlevel=75,ndx=866,o="Obj 1:\nTo earn this deed, you must defeat Undúrz in Fangorn's Edge on Legendary difficulty with all four Huorns dead.\nObj 2:\nTo earn this deed, you must defeat Undúrz in Fangorn's Edge on Legendary difficulty with all four Huorns dead.\n* Defeat Undúrz with all four Huorns in his area dead.",r={lp={{val=5}},rc={{id="7002B018",q=20,val="Medallion"}}},t="Lore"},
{id="7006D510",name="Cliff-diver of Ambarûl",cat="Ambarûl",d="You stood atop a waterfall, looked down at the water below, and thought diving off the cliff into the water below was a good idea. Then you did it five more times.",faction="FrP",level=150,minlevel=145,ndx=867,r={rc={{id="7006B23F",q=3,val="Shagâni Ghín"}},ti={{val="Cliff-diver"}},vx={{val=1000}},xp={{val=412000}}},t="Explorer",zone="Ambarûl"},
{id="70037F30",name="Clobbered",cat="Class",class="Champion",d="There is no time like the present to do some clobbering.",faction="FrP",level=30,minlevel=30,ndx=868,["next"]={831},o="Obj 1:\nThis is your objective description.\n* Use Clobber",r={lp={{val=5}}},t="Class"},
{id="7006BAD6",name="Clod",cat="Reputation",d="Many brazen hobbits have been well fed by your clumsy ineptitude. For this ignoble honour, you shall be known as a clod forever more.",faction="FrP",level=1,minlevel=1,ndx=869,o="Obj 1:\nYou should try much harder to avoid food stolen by the sneaky hobbit in the Hard Tack at Thorin's Hall event.\n* Complete 'Bean-spiller'",prev={474},r={ti={{val="the Clod"}}},t="Reputation"},
