{id="70064462",name="Deeds of Gwathrenost, the Witch-king's Citadel",cat="Return to Carn Dûm",d="Once the seat of the Witch-king of Angmar, the dread citadel of Gwathrenost casts a long shadow upon the city of Carn Dûm. All but abandoned after the Steward of Angmar was deposed, the remnants of the Iron Crown have crept forth from the shadows, seeking to master a lost artifact of the Witch-king and reclaim dominion of Angmar.",faction="FrP",level=1,minlevel=20,ndx=1100,["next"]={1082},o="Obj 2:\nOnce the seat of the Witch-king of Angmar, the dread citadel of Gwathrenost casts a long shadow upon the city of Carn Dûm. All but abandoned after the Steward of Angmar was deposed, the remnants of the Iron Crown have crept forth from the shadows, seeking to master a lost artifact of the Witch-king and reclaim dominion of Angmar.\n* Complete Gwathrenost, the Witch-king's Citadel -- Tier 1\n* Complete Gwathrenost, the Witch-king's Citadel -- Tier 2\n* Complete Gwathrenost, the Witch-king's Citadel -- Tier 3\n* Complete Gwathrenost, the Witch-king's Citadel -- Foe of the Iron Crown\n* Complete Gwathrenost, the Witch-king's Citadel -- Foe of the Orc-realm\n* Complete Gwathrenost, the Witch-king's Citadel -- Shadows of the Past",prev={2262,2263,2264,2265,2266,2267},r={rc={{id="70063D43",q=5,val="Sárskillin"}},ti={{val="Castellan"}},vx={{val=3000}}},t="Reputation"},
