{id="700642A2",name="Deeds of Sagroth, Lair of Vermin",area="Carn Dûm",cat="Return to Carn Dûm",d="Many dangerous creatures have called the sewers of Carn Dûm home. Some have remained rumours, nothing more. Others, however, may be of interest to the scattered remnants of the Iron Crown.",faction="FrP",level=1,minlevel=140,ndx=1110,["next"]={1082},o="Obj 2:\n* Complete Sagroth, Lair of Vermin -- Tier 1\n* Complete Sagroth, Lair of Vermin -- Tier 2\n* Complete Sagroth, Lair of Vermin -- Tier 3\n* Complete Sagroth, Lair of Vermin -- Slayer of Angmarim\n* Complete Sagroth, Lair of Vermin -- The Seekers of Sagroth",prev={3556,3557,3558,3559,3560},r={rc={{id="70063D43",q=5,val="Sárskillin"}},ti={{val="Enjoyer of Tall Tales"}},vx={{val=3000}}},t="Reputation",zone="Angmar"},
{id="70064042",name="Deeds of Sant Lhoer, the Poison Gardens",cat="Return to Carn Dûm",d="Sant Lhoer, known as the Poison Gardens of Carn Dûm, is a dank place teeming with deadly plants, trees, and flowers, the likes of which have rarely or never been seen before in Middle-earth. Beyond the foetid, beryl-green waters which flow through Sant Lhoer, rise immense glass structures, including Bâr Heledh, the Glass House. It is here that the sorceress Oganuin plies her craft, experimenting upon creatures, plants, and people alike. To what end, and for what purpose? One can only assume the darkest of designs.",faction="FrP",level=1,minlevel=140,ndx=1111,["next"]={1082},o="Obj 2:\n* Complete Sant Lhoer, the Poison Gardens -- Tier 1\n* Complete Sant Lhoer, the Poison Gardens -- Tier 2\n* Complete Sant Lhoer, the Poison Gardens -- Tier 3\n* Complete Slayer of Sant Lhoer\n* Complete Plants of the Poison Gardens",prev={3184,3566,3567,3568,3765},r={rc={{id="70063D43",q=5,val="Sárskillin"}},ti={{val="Steward of Sant Lhoer"}},vx={{val=3000}}},t="Reputation"},
{id="70061F8A",name="Deeds of Sarch Vorn",cat="Shadows of Angmar",d="Unbeknownst to the Men of Cardolan, Sarch Vorn, an ancient temple of the Edain, has long served as the resting place of a malevolent spirit of the Elder Days known only as Hithrengor, the Grey Fear. Roused by the return of the Witch-king of Angmar, the Grey Fear has awoken from its slumber to once again spread terror and death across the ravaged lands of Cardolan.",faction="FrP",level=1,minlevel=20,ndx=1112,o="Obj 2:\n* Complete Sarch Vorn, the Black Grave -- Tier 1\n* Complete Sarch Vorn, the Black Grave -- Tier 2\n* Complete Sarch Vorn, the Black Grave -- Tier 3\n* Complete Sarch Vorn, the Black Grave -- Slayer of the Barrow-wights",prev={3570,3571,3572,3573},r={rc={{id="70061B80",q=10,val="Iron Coin of Cardolan"},{id="70063B28",val="Black Grave War-steed"},{id="70063AFE",val="Steed of the Black Grave"}},ti={{val="Banisher of the Grey Fear"}}},t="Reputation",zone="Cardolan"},
