{id="70064393",name="Deeds of Thaurisgar, the Vile Apothecary",area="Carn Dûm",cat="Return to Carn Dûm",d="In the depths of Thaurisgar, countless foul and twisted experiments roam the shadows--the terrible legacy of Aniochán the Harrower. Before the fall of Carn Dûm, Aniochán worked tirelessly to outdo his rivals and win the favour of the Steward of Angmar. Chief among his tools in shaping his fell creations was a curious ichor known only as the Bile of Ifrinn. Thought to be lost after a disastrous experiment claimed Aniochán's life, now this foetid and vile substance is in danger of being let loose into the world.",faction="FrP",level=1,minlevel=140,ndx=1116,["next"]={1082},o="Obj 2:\n* Complete Thaurisgar, the Vile Apothecary -- Tier 1\n* Complete Thaurisgar, the Vile Apothecary -- Tier 2\n* Complete Thaurisgar, the Vile Apothecary -- Tier 3\n* Complete Slayer of Thaurisgar\n* Complete Alchemy of Thaurisgar",prev={3769,4031,4032,4033,99},r={rc={{id="70063D43",q=5,val="Sárskillin"}},ti={{val="Steward of Thaurisgar"}},vx={{val=3000}}},t="Reputation",zone="Angmar"},
