{id="70068CC8",name="Deeds of Umbar Baharbêl",cat="Umbar Baharbêl",d="In the aftermath of the Sea-stone Mutiny, Umbar Baharbêl has been freed from the Heirs of Castamir and their rulers in the Empire of Ordâkh. Under the governance of the Kindred of the Coins, a council of seven chosen by the citizens of Umbar Baharbêl, the City of the Corsairs struggles to be reborn as a Free City—with tidings of hope and treachery found in equal measure as its people step out from the darkness that was cast upon them long ago by the Dark Lord, Sauron.",faction="FrP",level=150,minlevel=140,ndx=1119,["next"]={4767},o="Obj 1:\nIn the aftermath of the Sea-stone Mutiny, Umbar Baharbêl has been freed from the Heirs of Castamir and their rulers in the Empire of Ordâkh. Under the governance of the Kindred of the Coins, a council of seven chosen by the citizens of Umbar Baharbêl, the City of the Corsairs struggles to be reborn as a Free City—with tidings of hope and treachery found in equal measure as its people step out from the darkness that was cast upon them long ago by the Dark Lord, Sauron.\n* Complete Quests of Umbar Baharbêl\n* Complete Explorer of Umbar Baharbêl",prev={1758,3318},r={rc={{id="70050535",q=500,val="Embers of Enchantment"},{id="70065F33",q=5,val="Umbari Tâm"}},ti={{val="of Umbar Baharbêl"}},vx={{val=4000}}},t="Reputation"},
