{id="7006A296",name="Deeds of the Arena of Conflict",cat="Corsairs of Umbar",d="You have proven yourself by scouring the Isle of Storms, braving the Streets of Râhal Bakh, enchanting the crowd in the arena of Dahâl Huliz, and surviving the Depths of the Mâkhda Khorbo. None can question your tenacity and determination, and by completing all these deeds, you have earned great favour throughout Umbar Baharbêl.",faction="FrP",level=150,minlevel=150,ndx=1126,o="Obj 1:\nComplete the deeds of the Umbar Instances.\n* Complete 'Deeds of The Streets of Râhal Bakh'\n* Complete 'Survivor of The Isles of Storm'\n* Complete 'Vanquisher of Dahâl Huliz, The Arena'\n* Complete 'Deeds of the Depths of Mâkhda Khorbo'",prev={1128,3958,4180,4818},r={lp={{val=10}},rc={{id="7006A244",val="Steed of Mâkhda Khorbo"},{id="70067CC1",q=5,val="Large gift of Ûri"},{id="70067C53",val="Cracked Umbari Tracery"}},ri={{val="+700 with Citizens of Umbar Baharbêl"}},vx={{val=3000}}},t="Reputation"},
{id="70068295",name="Deeds of the Cape of Umbar",cat="Cape of Umbar",d="Once beneath the rule of the ruthless Heirs of Castamir, the Cape of Umbar emerges from a shadowy chrysalis as a land reborn. The citizens struggle with newfound freedom, the sins of the past, and a desire to cling to the rites and customs of their culture, as they are guided by the hands of Kindred of the Coins.",faction="FrP",level=147,minlevel=137,ndx=1127,["next"]={4767},o="Obj 1:\nOnce beneath the rule of the ruthless Heirs of Castamir, the Cape of Umbar emerges from a shadowy chrysalis as a land reborn. The citizens struggle with newfound freedom, the sins of the past, and a desire to cling to the rites and customs of their culture, as they are guided by the hands of Kindred of the Coins.\n* Complete Explorer of the Cape of Umbar\n* Complete Slayer of the Cape of Umbar\n* Complete Quests of the Cape of Umbar",prev={1765,3330,3783},r={rc={{id="70065F33",q=5,val="Umbari Tâm"},{id="70050535",q=500,val="Embers of Enchantment"}},ti={{val="Cape-cruiser"}},vx={{val=4000}}},t="Reputation"},
{id="7006A26A",name="Deeds of the Depths of Mâkhda Khorbo",area="Bej Mâgha",cat="Corsairs of Umbar",d="The Mâkhda Khorbo, Temple of the All-Seeing, crumbled into ruin at the moment of Sauron's defeat but remains a place of great interest for those seeking artifacts of evil. When Azagath Sea-shadow fled from the Citadel of Winds in the company of his comrades Belondor and Nakási Wave-reaper, his purpose was not escape alone. What treasure of the Dark Lord's might he have wrested from those buried ruins? Its identity remains unknown, but your pursuit of Azagath played a role in fracturing the bonds between some of these Kindred.",faction="FrP",level=150,minlevel=150,ndx=1128,["next"]={1126},o="Obj 2:\nThe Mâkhda Khorbo, Temple of the All-Seeing, crumbled into ruin at the moment of Sauron's defeat but remains a place of great interest for those seeking artifacts of evil. When Azagath Sea-shadow fled from the Citadel of Winds in the company of his comrades Belondor and Nakási Wave-reaper, his purpose was not escape alone. What treasure of the Dark Lord's might he have wrested from those buried ruins? Its identity remains unknown, but your pursuit of Azagath played a role in fracturing the bonds between some of these Kindred.\n* Complete The Depths of Mâkhda Khorbo -- Tier 1\n* Complete The Depths of Mâkhda Khorbo -- Tier 2\n* Complete The Depths of Mâkhda Khorbo -- Tier 3\n* The Depths of Mâkhda Khorbo -- The Evil Within\n* The Depths of Mâkhda Khorbo -- The Evil Below",prev={4195,4196,4199,4200,4201},r={rc={{id="70067CC1",q=3,val="Large gift of Ûri"}},ti={{val="Survivor of Mâkhda Khorbo"}},vx={{val=1000}}},t="Lore",zone="Umbar"},
