{id="70066E7C",name="Deeds of the Shield Isles",cat="The Shield Isles",d="Zîrar Tarka, the Shield Isles, serve as Umbar's bulwark against the storms that often trouble the Great Sea, but so too do they often prove the doom of unwary sailors, as countless ships have run aground on its coasts—their wrecks caught in the grinding jaws of the Shedax Khîn.",faction="FrP",level=145,minlevel=135,ndx=1137,["next"]={4767},o="Obj 1:\nZîrar Tarka, the Shield Isles, serve as Umbar's bulwark against the storms that often trouble the Great Sea, but so too do they often prove the doom of unwary sailors, as countless ships have run aground on its coasts—their wrecks caught in the grinding jaws of the Shedax Khîn.\n* Complete Explorer of the Shield Isles\n* Complete Quests of the Shield Isles\n* Complete Slayer of the Shield Isles",prev={1775,3355,3800},r={rc={{id="70050535",q=500,val="Embers of Enchantment"},{id="70065F33",q=5,val="Umbari Tâm"}},ti={{val="Shield-breaker"}},vx={{val=4000}}},t="Reputation",zone="The Shield Isles"},
