{id="70016AB0",name="Deep-claw Slayer",c={"A good place to farm deep-claws is Katûb-zahar in The Great Delving. [7.0S, 111.0W]"},cat="Moria",d="Deep-claws and cave-claws infest the Mines of Moria in overwhelming numbers, harrying efforts to reinstate the great dwarf-realm that once was. A great service will be done for the dwarves should the presence of the vermin be lessened in the mines.",faction="FrP",level=55,minlevel=47,ndx=1150,["next"]={1151},o="Obj 1:\n* Defeat deep-claws in Moria",r={lp={{val=5}},ri={{val="+500 with Iron Garrison Guards"}},ti={{val="Beak-breaker"}}},t="Slayer",zone="Moria"},
{id="70016AB1",name="Deep-claw Slayer (Advanced)",c={"A good place to farm deep-claws is Katûb-zahar in The Great Delving. [7.0S, 111.0W]"},cat="Moria",d="To further hinder the spread of the vile deep-claws will indeed be a boon to the efforts of the dwarves in Khazad-dûm. The creatures waylay any explorers brave enough to venture into the halls, and they ever befoul the passages with their filth.",faction="FrP",level=55,minlevel=47,ndx=1151,["next"]={4712},o="Obj 1:\n* Complete 'Deep-claw Slayer'\nObj 2:\n* Defeat deep-claws in Moria",prev={1150},r={lp={{val=10}},rc={{id="7005D8A0",val="Enhancement Runes, Incomparable"}},ri={{val="+700 with Iron Garrison Miners"}},vx={{val=2000}}},t="Slayer",zone="Moria"},
