{id="7006BB56",name="Defeat each of the Nine",cat="Reputation",d="So returned the Nazgûl, and with their coming the Dark Lord’s power grew. Sauron unveiled his might through their dreadful voices, which cried words of wrath and terror. Even the boldest quailed and cowered as the Wraiths passed – or yet stood unmoving, their weapons falling from hands gone cold as they yielded to thoughts of darkness, fear, and death.",faction="FrP",level=1,minlevel=45,ndx=1158,o="Obj 2:\n* Defeat the Grim Southron\n* Defeat the Forsaken Reaver\n* Defeat the Gloom of Nurn\n* Defeat the Black Blade of Lebennin\n* Defeat the Bane of Rhûn\n* Defeat the High Sorcerer of Harad\n* Defeat the Woe of Khand\n* Defeat the Cursed Rider\n* Defeat the Witch-king",prev={1159,1160,1161,1165,1166,1167,1168,1169,1170},r={rc={{id="7006C02C",val="Veil of the Nine Frame"}},ti={{val="Scourge of the Nine"}}},t="Event"},
{id="7006B5E7",name="Defeat the Bane of Rhûn",cat="Reputation",d="Once he was a great king in lands far to the east, accustomed to rule and unwilling to bend the knee to any other. But then came a giver of gifts and a promiser of power, and upon accepting these lures, the great king changed. No longer did he rule his lands with mercy, and neither did he remain in his own kingdom. He became Rhûn's bane, and by that name came he to be known as the Bane of Rhûn, and elsewhere.",faction="FrP",level=1,minlevel=45,ndx=1159,["next"]={1158},o="Obj 2:\n* Defeat the Bane of Rhûn",r={ti={{val="Saviour of Rhûn"}}},t="Event"},
{id="7006B5E8",name="Defeat the Black Blade of Lebennin",cat="Reputation",d="In later days, the Black Blade of Lebennin was oft-seen stalking among the hills and forests of Western Gondor, striking fear into the hearts of Men with both deadly countenance and fearsome sword. For those few who did not flee, his words poured like honey into their unwilling ears and drove them to terrible acts of evil. This may have proved his worst and most effective weapon.",faction="FrP",level=1,minlevel=45,ndx=1160,["next"]={1158},o="Obj 2:\n* Defeat the Black Blade of Lebennin",r={ti={{val="the Blade-breaker"}}},t="Event"},
{id="7006B5E4",name="Defeat the Cursed Rider",cat="Reputation",d="He moved at speed across the battlefield, running down the warriors who dared stand against him, fewer as the siege went on. He was the Cursed Rider, and the sound of his approach turned even courageous blood to water. In later years he would command armies from within the walls of Dol Guldur, but during the Second Age he preferred to fight from the back of his black steed, alone.",faction="FrP",level=1,minlevel=45,ndx=1161,["next"]={1158},o="Obj 2:\n* Defeat the Cursed Rider",r={ti={{val="Curse-breaker"}}},t="Event"},
{id="70043EC0",name="Defeat the Enemy's Leader! -- Tier 1",area="Osgiliath",cat="Osgiliath",d="Defeat the leader of the Morgul Army.",faction="FrP",level=85,minlevel=50,ndx=1162,["next"]={1163},o="Obj 1:\n* Defeat The Witch-king, leader of the Morgul Army",r={rc={{id="7002C6E7",q=500,val="Commendation"}},ti={{val="Gondor's Foe"}}},t="Slayer",zone="Eastern Gondor"},
{id="70043EBB",name="Defeat the Enemy's Leader! -- Tier 2",area="Osgiliath",cat="Osgiliath",d="Defeat the leader of the Morgul Army.",faction="FrP",level=85,minlevel=50,ndx=1163,["next"]={1164},o="Obj 1:\n* Complete 'Defeat the Enemy's Leader! -- Tier 1'\nObj 2:\n* Defeat The Witch-king, leader of the Morgul Army",prev={1162},r={rc={{id="7002C6E7",q=1000,val="Commendation"}},ti={{val="Gondor's Enemy"}}},t="Slayer",zone="Eastern Gondor"},
{id="70043EBA",name="Defeat the Enemy's Leader! -- Tier 3",area="Osgiliath",cat="Osgiliath",d="Defeat the leader of the Morgul Army.",faction="FrP",level=85,minlevel=50,ndx=1164,o="Obj 1:\n* Complete 'Defeat the Enemy's Leader! -- Tier 2'\nObj 2:\n* Defeat The Witch-king, leader of the Morgul Army",prev={1163},r={rc={{id="7002C6E7",q=1500,val="Commendation"}},ti={{val="Gondor's Bane"}}},t="Slayer",zone="Eastern Gondor"},
{id="7006B5EA",name="Defeat the Forsaken Reaver",cat="Reputation",d="From the distant south he came, bringing fear and fire to every coast he spied with his glass. His was a reign of blood, and he drew it from all who lived in sight and scent of the Sea. Was that the reason Sauron gave to him the ring Khânto, which is Pain-giver? With the power of it, the Forsaken Reaver could not be stopped, and his laughter carried inland on fell winds; he was among Sauron's swiftest servants, and the cruelest.",faction="FrP",level=1,minlevel=45,ndx=1165,["next"]={1158},o="Obj 2:\n* Defeat the Forsaken Reaver",r={ti={{val="Forsaken No More"}}},t="Event"},
{id="7006B5E9",name="Defeat the Gloom of Nurn",cat="Reputation",d="None can say what ship bore him hither to Middle-earth before Númenor was lost, but once he accepted Sauron's gift he could no longer be counted among the Men of that land. He dwelt in Thaurband, a fortress in southern Mordor, not far from the inland Sea. It was from that keep that the fear of him spread, giving him a new title to replace the name he no longer needed. He became the Gloom of Núrn, though he did not stay there, and roved far and wide at Sauron's command.",faction="FrP",level=1,minlevel=45,ndx=1166,["next"]={1158},o="Obj 2:\n* Defeat the Gloom of Nurn",r={ti={{val="a Light in the Gloom"}}},t="Event"},
{id="7006B59F",name="Defeat the Grim Southron",cat="Reputation",d="Few among the living ever heard him speak, but his visage was well-known, and feared. They called him the Grim Southron, and while Men quailed at his approach during the Second Age, during the Third the legend of his malice had only grown. In later days it was he that Lhaereth the Stained followed in secret to Dol Guldur, where she discovered Sauron and helped him recover, for a price. Did the Dark Lord deal out reward or punishment for his Nazgûl's lapse? But that was much later. During the Second Age, the Grim Southron was known only to be patient, loyal, and silent.",faction="FrP",level=1,minlevel=45,ndx=1167,["next"]={1158},o="Obj 2:\n* Defeat the Grim Southron",r={ti={{val="Dawn of the South"}}},t="Event"},
{id="7006B5E6",name="Defeat the High Sorcerer of Harad",cat="Reputation",d="They called him the High Sorcerer of Harad, but for most of those who fought against Sauron it was just a name. He rarely left the dungeon fastnesses of Mordor, for he delighted in the working of foul rituals and the mastery of fell magic, and gave his thought to little else. But when the Dark Lord saw fit to send him forth, Men and Elves knew to give him a wide berth, or suffer. It was Mêbat he wore, the Mirth-eater, and wherever he went there was an end to laughter, and only the onset of grief.",faction="FrP",level=1,minlevel=45,ndx=1168,["next"]={1158},o="Obj 2:\n* Defeat the High Sorcerer of Harad",r={ti={{val="the Sorcerer's Downfall"}}},t="Event"},
{id="7006B5E1",name="Defeat the Witch-king",cat="Reputation",d="Greatest and most feared of the Nine, the Witch-king stalked the battlefield but rarely, leaving the fortresses of Mordor only at Sauron's most pressing command. In later years the Lord of the Nazgûl would raise from nothing the Land of Angmar, wielding it in furtherance of the Dark Lord's aim to destroy the northern kingdom of Arnor, but at the close of the Second Age that was still far off in the mists of Time. During the Siege of Barad-dûr, the Witch-king could be found testing the weaknesses of the armies arrayed against his master, seeking the most valuable prize of all: information.",faction="FrP",level=1,minlevel=45,ndx=1169,["next"]={1158},o="Obj 2:\n* Defeat the Witch-king",r={ti={{val="the Last Hope of the North"}}},t="Event"},
{id="7006B5E5",name="Defeat the Woe of Khand",cat="Reputation",d="He was the Woe of Khand, and with the blessing of Sauron he strode across the unconquered lands and claimed them for the Dark Lord. The ring gifted to him was called Adâsh, and many were the foes it made, many the proud warriors he brought low. He found great joy in the bringing of war, and always had done so, but with the power given to him by Sauron, the Woe of Khand became ever more deadly, more relentless, and more unforgiving.",faction="FrP",level=1,minlevel=45,ndx=1170,["next"]={1158},o="Obj 2:\n* Defeat the Woe of Khand",r={ti={{val="the Joy of Khand"}}},t="Event"},
{id="7001EFC6",name="Defeating the Dead -- Complete",cat="Skirmish Instances",d="The Barrow-downs were once a stronghold of the Rangers of Cardolan, but after the destruction of the last remnant of Cardolan, the Witch-king sent fell spirits to stir the bones of the dead and make it a place of terror.",faction="FrP",level=45,minlevel=45,ndx=1171,["next"]={3957},o="Obj 1:\n* Complete Defeating the Dead -- Small Fellowship\n* Complete Defeating the Dead -- Fellowship\n* Complete Defeating the Dead -- Raid",prev={1172,1173,1174},r={rc={{id="7002B017",q=120,val="Mark"}}},t="Event"},
