{id="7001BF16",name="Defence of The Prancing Pony",cat="Skirmish Instances",d="The Prancing Pony Inn is a cornerstone of Bree-town. All who come through the village stop there for at least a pint, if not the night.",faction="FrP",level=35,minlevel=35,ndx=1175,["next"]={3696},o="Obj 1:\nComplete all encounters in the Defence of The Prancing Pony Skirmish.\n* Defeat Southpaw\n* Defeat the Old Hunter\n* Defeat Ufglup\n* Defeat Rat-catcher\n* Defeat Mukghashan\n* Defeat Kamhont\n* Defeat Banosnákh\n* Defeat Willie Hawthorn\n* Defeat Blackfeather",r={ti={{val="Defender of The Prancing Pony"}}},t="Slayer"},
{id="70005BB2",name="Defences of the Lone-lands",cat="Lone-lands",d="The Lone-lands were once host to a string of forts and towers that guarded the roads against the incursions of Angmar and Rhudaur. Long ago, they fell into ruin with the defeat of the North Kingdom.",faction="FrP",level=17,minlevel=10,ndx=1176,["next"]={1771},o="Obj 1:\nExplore the ancient fortifications of the Lone-lands.\n* Discover Barad Iachiant\n* Discover Ost Laden\n* Discover The Lornspan\n* Discover Mithrenost\n* Discover Thandobel\n* Discover Ost Cyrn\n* Discover Naerost\n* Discover Amon Ros\n* Discover Ost Guruth",pois={{name="Ost Laden",area="Minas Eriol",loc={"34.4S, 37.5W"},zone="The Lone-lands"},{name="Naerost",area="Nain Enidh",loc={"30.7S, 33.8W"},zone="The Lone-lands"},{name="The Lornspan",area="Nain Enidh",loc={"34.6S, 35.2W","34.6S, 35.4W","34.6S, 35.5W"},zone="The Lone-lands"},{name="Mithrenost",area="Nain Enidh",loc={"33.8S, 34.3W","34.1S, 34.3W","34.7S, 34.3W"},zone="The Lone-lands"},{name="Amon Ros",area="Nain Enidh",loc={"30.8S, 31.7W"},zone="The Lone-lands"},{name="Thandobel",area="Nain Enidh",loc={"33.8S, 32.7W"},zone="The Lone-lands"},{name="Barad Iachiant",area="Minas Eriol",loc={"35.8S, 38.3W"},zone="The Lone-lands"},{name="Ost Guruth",area="Nain Enidh",loc={"31.3S, 29.5W"},zone="The Lone-lands"},{name="Ost Cyrn",area="Nain Enidh",loc={"33.6S, 30.6W","33.6S, 30.9W"},zone="The Lone-lands"}},r={lp={{val=5}},rc={{id="7002B017",q=30,val="Mark"}},ri={{val="+500 with The Eglain"}},vx={{val=2000}}},t="Explorer",zone="The Lone-lands"},
