{id="70019807",name="Defender of Lothlórien",cat="Lothlórien",d="The Galadhrim are preparing for war against the Orcs of Moria. They have sent a call out to all who will aid them.",faction="FrP",level=58,minlevel=1,ndx=1179,["next"]={4913},o="Obj 1:\n* Complete Lórien Quest Tier 1\nObj 2:\nComplete quests in Lothlórien.\n* Complete quests in Lothlórien",prev={131},r={lp={{val=10}},ri={{val="+500 with Galadhrim"}},ti={{val="Guardian of Lothlórien"}}},t="Reputation",zone="Lothlórien"},
{id="7003385E",name="Defender of Thranduil's Hall",cat="The Road to Erebor",d="Dígelir, queen of the Great Spiders of Mirkwood, has established a nest in the heart of the Scuttledells, where she is breeding an army to answer the call of Sauron.",faction="FrP",level=85,minlevel=20,ndx=1180,["next"]={4437},o="Obj 2:\nYou must defeat the draug-lord Beremud and the Great Spider Dígelir in the heart of the Scuttledells.\n* Complete the deed Webs of the Scuttledells -- Tier 1\n* Complete the deed Webs of the Scuttledells -- Tier 2\n* Complete the deed Challenge: Webs of the Scuttledells\n* Complete the quest Spiders and Flies",prev={4930,4931,740},r={rc={{id="7002B018",q=30,val="Medallion"}}},t="Lore"},
