{id="70033C7C",name="Defender of the Dale-lands",cat="The Road to Erebor",d="Easterlings prepare to lay siege to Dale and the Lonely Mountain. The bells of Dale must be rung to signal the inhabitants to retreat into Erebor.",faction="FrP",level=85,minlevel=20,ndx=1182,["next"]={4437},o="Obj 2:\nYou must defeat the Olog-hai captain TBD and the Easterling sorcerer TBD in Dale.\n* Complete the deed The Bells of Dale -- Tier 1\n* Complete the deed The Bells of Dale -- Tier 2\n* Complete the deed Challenge: The Bells of Dale\n* Complete Tormentors of Dale quest",prev={4100,4101,735},r={rc={{id="7002B018",q=30,val="Medallion"}}},t="Lore"},
{id="70033CE8",name="Defender of the Road",cat="The Road to Erebor",d="The people of Dale are attempting to flee to the safety of the Lonely Mountain. The Easterling army is not far behind...",faction="FrP",level=85,minlevel=20,ndx=1183,["next"]={4437},o="Obj 2:\nThe people of Dale are attempting to flee to the safety of the Lonely Mountain. The Easterling army is not far behind...\n* Complete 'Challenge - An Army from the East'\n* Complete 'Flight to the Lonely Mountain  - Tier 1'\n* Complete 'Flight to the Lonely Mountain - Tier 2'",prev={1854,1855,717},r={rc={{id="7002B018",q=50,val="Medallion"}}},t="Event"},
{id="70018A50",name="Defender of the Upper Levels",cat="Moria",d="The dwarves of the Upper Levels expeditions will need a great deal of help in overcoming the obstacles that await them in the Mines of Moria. Your assistance will be welcome, for there is much work to be done if Khazad-dûm is to be hospitable once more.",faction="FrP",level=55,minlevel=47,ndx=1184,["next"]={2360},o="Obj 2:\nNOT USED\n* Complete 'Adventurer in the Upper Levels'\nObj 3:\nComplete Quests in the Upper Levels Moria.\n* Complete quests in the Upper Levels",prev={78},r={lp={{val=10}},ri={{val="+700 with Iron Garrison Guards"}},vx={{val=2000}}},t="Reputation",zone="Moria"},
{id="70062EA6",name="Defender of the Mírdain",cat="Skirmish Instances",d="Caras Gelebren, the Silver Bastion, was once the capital of Tham Mírdain and the jewel of Eregion. Alas, it was brought to ruin long ago when Sauron, seeking to lay claim to the Rings of Power, gathered his vast armies and destroyed all of Eregion.",faction="FrP",level=20,minlevel=20,ndx=1185,o="Obj 1:\nCaras Gelebren, the Silver Bastion, was once the capital of Tham Mírdain and the jewel of Eregion. Alas, it was brought to ruin long ago when Sauron, seeking to lay claim to the Rings of Power, gathered his vast armies and destroyed all of Eregion.\n* Complete 'Doom of Caras Gelebren -- Raid'",r={ti={{val="Hero of the Silver Bastion"}}},t="Slayer"},
