{id="7000F0A1",name="Dourhand-slayer",c={"The only location where you can find Dourhand dwarves for this deed is:\n* The Icereave Mines [8.9N, 81.9W]"},cat="Forochel",d="Old dwarf-ruins litter the landscape of Forochel. Being the hardiest of the Free Peoples, the dwarves claim that they were the first to settle here long ago, in hopes of finding riches beneath the frozen earth -- but most of these settlements were abandoned long ago.\nHoping to strengthen their claims as legitimate heirs of the ancient Dwarf-lords, the Dourhands seek to re-build these settlements with the aid of their Angmarim allies, but this has brought their cousins the Longbeards north as well, seeking to dispute their claims, no matter the worth (or lack thereof) of the mines here.",faction="FrP",level=47,minlevel=30,ndx=1339,["next"]={1340},o="Obj 1:\n* Defeat Dourhands in Forochel",r={lp={{val=5}},ri={{val="+500 with Lossoth of Forochel"}},ti={{val="Warden of the Mines"}}},t="Slayer",zone="Forochel"},
{id="7000F0A2",name="Dourhand-slayer (Advanced)",c={"The only location where you can find Dourhand dwarves for this deed is:\n* The Icereave Mines [8.9N, 81.9W]"},cat="Forochel",d="The attempts by the Dourhands to claim a legitimate descent from the Dwarf-lords of old seems futile at this point, as their dark alliance with Angmar becomes more common knowledge among the dwarves of Middle-earth -- but if anything, this turn of events has only made them more dangerous and desperate, as they now fight for the very survival of their misguided house.",faction="FrP",level=47,minlevel=30,ndx=1340,["next"]={3743},o="Obj 1:\n* Complete 'Dourhand-slayer'\nObj 2:\n* Defeat Dourhands in Forochel",prev={1339},r={lp={{val=10}},rc={{id="7002B017",q=30,val="Mark"}},ri={{val="+700 with Lossoth of Forochel"}},vx={{val=2000}}},t="Slayer",zone="Forochel"},
