{id="70016AB2",name="Dragonet-slayer",c={"Best spot to advance this deed is in the Silvertine Lodes in and around a chamber located at [12.1S, 111.2W]."},cat="Moria",d="Dwelling in the dark places of Moria are the miniscule dragonets, a severely stunted form of Dragon-kind, hardly larger than a common bat. These evil creatures have proven to be a terrible annoyance to the dwarves struggling to reclaim their home of old.",faction="FrP",level=55,minlevel=47,ndx=1350,["next"]={1351},o="Obj 1:\n* Defeat dragonets in Moria",r={lp={{val=5}},ri={{val="+500 with Iron Garrison Guards"}},ti={{val="Drake-smasher"}}},t="Slayer",zone="Moria"},
{id="70016AB3",name="Dragonet-slayer (Advanced)",c={"Best spot to advance this deed is in the Silvertine Lodes in and around a chamber located at [12.1S, 111.2W]."},cat="Moria",d="Your efforts have done much already to purge Moria of the vile dragonets, but to eliminate yet more would be a relief beyond compare. No Dragon, no matter its size or shape, should be permitted to defile the great halls of the dwarves.",faction="FrP",level=55,minlevel=47,ndx=1351,["next"]={4712},o="Obj 1:\n* Complete 'Dragonet-slayer'\nObj 2:\n* Defeat dragonets in Moria",prev={1350},r={lp={{val=10}},rc={{id="7005D8A0",val="Enhancement Runes, Incomparable"}},ri={{val="+700 with Iron Garrison Miners"}},vx={{val=2000}}},t="Slayer",zone="Moria"},
