{id="7004BCF8",name="Dungeons of Naerband -- Tier 1",area="Talath Úrui",cat="The Plateau of Gorgoroth",d="Urudanî, the mysterious flame-wraith under the command of Borangos the Horror, has been seen many times, entering and exiting the prison fortress of Naerband. Her work with Thraknûl, Sauron's former the chief torturer, lies within the dungeons of the Direhold -- the results of their work more would surely aid the great Rogmul.",faction="FrP",level=115,minlevel=105,ndx=1363,["next"]={1255},o="Obj 2:\n* Complete the quest Dungeons of Naerband -- Tier 1",r={rc={{id="700487E5",q=4,val="Silver Signet of the Thandrim"},{id="7002B018",q=30,val="Medallion"}},xp={{val=62300}}},t="Slayer",zone="Mordor"},
