{id="70053C19",name="Enmity of the Cultists",cat="Race & Social",d="Throughout the history of Middle-earth, there have been Men who have shunned the rule of Kings and forsaken their own heritage. Far too often they fall under the sway of the Dark Lord, who plays upon their distrust of the great Kingdoms, threatens them with hidden force, or sways them with false riches and power. However, there are some Men who freely offer themselves into his service and swear unerring loyalty to the Dark Lord.",faction="FrP",level=12,minlevel=29,ndx=1516,["next"]={1517},o="Obj 1:\n* Defeat cultists sworn to the Dark Lord",r={lp={{val=5}},tr={{val="Needful Ingenuity"}}},t="Slayer"},
{id="70053C1A",name="Enmity of the Cultists II",cat="Race & Social",d="Throughout the history of Middle-earth, there have been Men who have shunned the rule of Kings and forsaken their own heritage. Far too often they fall under the sway of the Dark Lord, who plays upon their distrust of the great Kingdoms, threatens them with hidden force, or sways them with false riches and power. However, there are some Men who freely offer themselves into his service and swear unerring loyalty to the Dark Lord.",faction="FrP",level=25,minlevel=35,ndx=1517,["next"]={1518},o="Obj 1:\n* Complete 'Enmity of the Cultists'\nObj 2:\n* Defeat cultists sworn to the Dark Lord",prev={1516},r={lp={{val=10}},tr={{val="Nimble-handed"}}},t="Slayer"},
{id="70053C1B",name="Enmity of the Cultists III",cat="Race & Social",d="Throughout the history of Middle-earth, there have been Men who have shunned the rule of Kings and forsaken their own heritage. Far too often they fall under the sway of the Dark Lord, who plays upon their distrust of the great Kingdoms, threatens them with hidden force, or sways them with false riches and power. However, there are some Men who freely offer themselves into his service and swear unerring loyalty to the Dark Lord.",faction="FrP",level=40,minlevel=35,ndx=1518,o="Obj 1:\n* Complete 'Enmity of the Cultists II'\nObj 2:\n* Defeat cultists sworn to the Dark Lord",prev={1517},r={lp={{val=10}},tr={{val="Return to Thorin's Hall"}}},t="Slayer"},
{id="700062E2",name="Enmity of the Dead",cat="Race & Social",d="Since the beginning of time, fell spirits, not the least of which were the Balrogs of Morgoth, roamed the shadow-realm in service to the Enemy. Through foul sorceries, these spirits may stir the decaying bones of fallen Men, becoming terrible wights. To the race of Men, whose spirits pass beyond the world when they die, these monsters are true abominations.",faction="FrP",level=13,minlevel=13,ndx=1519,["next"]={1520},o="Obj 1:\n* Defeat wights",r={lp={{val=5}},tr={{val="Upper-cut"}}},t="Slayer"},
{id="700062E3",name="Enmity of the Dead II",cat="Race & Social",d="It is said that when the Witch-king came to Angmar, he exerted dominion over many fell spirits of Morgoth and sent them from Angmar and Rhudaur to inhabit the Barrow-downs outside of Bree... the last bastion of the Rangers of Cardolan. In the Third Age, only the wights remain to tell of those evil days.",faction="FrP",level=19,minlevel=19,ndx=1520,["next"]={1521},o="Obj 1:\n* Complete 'Enmity of the Dead'\nObj 2:\n* Defeat wights",prev={1519},r={lp={{val=10}},tr={{val="Tactics and Might Bonus"}}},t="Slayer"},
{id="700062E4",name="Enmity of the Dead III",cat="Race & Social",d="Morgoth, Sauron, the Witch-king of Angmar, the terrible Gaunt-lords... all possess the sorcerous power to infuse the remains of the dead with fell spirits in service to the Enemy. Rumour speaks of haunted vales in the realm of Angmar inhabited almost wholly by these spirits and the fell wights they produce....",faction="FrP",level=25,minlevel=25,ndx=1521,o="Obj 1:\n* Complete 'Enmity of the Dead II'\nObj 2:\n* Defeat wights",prev={1520},r={lp={{val=15}},tr={{val="Man Sword-damage Bonus"}}},t="Slayer"},
{id="70006332",name="Enmity of the Dourhands",cat="Race & Social",d="The Dourhand dwarves appear to have turned their backs on the Free Peoples of Middle-earth and rebelled against the rightful rule of Durin's Folk.",faction="FrP",level=13,minlevel=13,ndx=1522,["next"]={1524},o="Obj 1:\n* Defeat Dourhand dwarves",r={lp={{val=5}},tr={{val="Head-butt"}}},t="Slayer"},
{id="70048CE7",name="Enmity of the Dourhands",cat="Race & Social",d="Some can fall to the Shadow, but these dwarves have allied themselves with the Enemy by choice.",faction="FrP",level=35,minlevel=35,ndx=1523,["next"]={1525},o="Obj 1:\n* Defeat Dourhands",r={lp={{val=5}},tr={{val="Enmity of Darkness"}}},t="Slayer"},
{id="70006333",name="Enmity of the Dourhands II",cat="Race & Social",d="Jealous of the wealth and status of the Longbeards -- particularly since Durin's Folk reclaimed the Lonely Mountain -- the Dourhands have plotted to usurp their position as the leaders of the Dwarves of the Blue Mountains for many years now.",faction="FrP",level=19,minlevel=19,ndx=1524,["next"]={1526},o="Obj 1:\n* Complete 'Enmity of the Dourhands'\nObj 2:\n* Defeat Dourhand dwarves",prev={1522},r={lp={{val=10}},tr={{val="Guile and Might Bonus"}}},t="Slayer"},
{id="70048CE3",name="Enmity of the Dourhands II",cat="Race & Social",d="Some can fall to the Shadow, but these dwarves have allied themselves with the Enemy by choice.",faction="FrP",level=38,minlevel=38,ndx=1525,o="Obj 1:\n* Complete 'Enmity of the Dourhands'\nObj 2:\n* Defeat Dourhands",prev={1523},r={lp={{val=5}},tr={{val="Glory of the First Age"}}},t="Slayer"},
{id="70006334",name="Enmity of the Dourhands III",cat="Race & Social",d="Ever since the earliest records, history has been rife with stories of betrayal and tragedy. The rebellion of the Dourhands is just the latest chapter in this long and sorrowful litany. It is time to bring that chapter to an end....",faction="FrP",level=25,minlevel=25,ndx=1526,o="Obj 1:\n* Complete 'Enmity of the Dourhands II'\nObj 2:\n* Defeat Dourhand dwarves",prev={1524},r={lp={{val=15}},tr={{val="Dwarf Axe-damage Bonus"}}},t="Slayer"},
{id="70006313",name="Enmity of the Drakes",cat="Race & Social",d="Dragons were bred long ages ago to break the power of the Elves in the North -- and in this they succeeded with their vast power and cunning, acting as a deadly spearhead of the Enemy's armies that none could stand against. Like Elves, Dragons have never been numerous, and their savage demeanor means that few of their offspring ever reach adulthood. Their numbers have also dwindled in Middle-earth -- but recently many of the lesser drakes have been unleashed from Angmar, which is worrisome indeed, for if these lesser beasts have reappeared, can the Dragons be far behind? Regardless of the danger, these creatures must be destroyed!",faction="FrP",level=29,minlevel=29,ndx=1527,["next"]={1528},o="Obj 1:\n* Defeat drakes",r={lp={{val=5}},tr={{val="Elf One-handed Sword-damage Bonus"}}},t="Slayer"},
{id="70006314",name="Enmity of the Drakes II",cat="Race & Social",d="Even with but a fraction of their elder kin's power, a drake is a deadly enemy indeed. Even among the Firstborn, it is a mark of honour to stand against such a creature victorious. No one knows from whence the drakes arose -- what creature did the Enemy find to twist into such a fearful shape and power as Dragon-kind? Their origins are hidden, even to the Elves.",faction="FrP",level=35,minlevel=35,ndx=1528,o="Obj 1:\n* Complete 'Enmity of the Drakes'\nObj 2:\n* Defeat drakes",prev={1527},r={lp={{val=10}},tr={{val="Power of the Eldar"}}},t="Slayer"},
{id="700062BA",name="Enmity of the Goblins",cat="Race & Social",d="Of all the powers of the Enemy, the goblins are the only ones to have openly assaulted the Shire. They were defeated by Bullroarer Took many years ago -- but now the descendants of Golfimbul have again been seen near the bounds of your fair land, as well as many other places in the North. Hobbits have been called to take up arms again, and the Bounders have redoubled their training, lest they be caught unawares by these savage creatures.",faction="FrP",level=29,minlevel=29,ndx=1529,["next"]={1533},o="Obj 1:\n* Defeat goblins",r={lp={{val=5}},tr={{val="Hobbit-stealth"}}},t="Slayer"},
{id="7000630D",name="Enmity of the Goblins",cat="Race & Social",d="The goblins were created by Morgoth long ago, as captive Elves were tortured and twisted into mockeries of themselves and set upon the world as eternal enemies to their former kin. All that was good in them was turned to evil, and the Elves have striven for ages since to eradicate them from Middle-earth... to no avail.",faction="FrP",level=13,minlevel=13,ndx=1530,["next"]={1534},o="Obj 1:\n* Defeat goblins",r={lp={{val=5}},tr={{val="Silvan Shadows"}}},t="Slayer"},
{id="70006335",name="Enmity of the Goblins",cat="Race & Social",d="Goblins and dwarves have despised each other since they first set eyes upon one another. They are natural enemies both above ground and below, with the goblins' countless numbers crashing year after year against the tireless defences of the dwarves, wearing away at them like tides against rock.",faction="FrP",level=13,minlevel=13,ndx=1531,["next"]={1535},o="Obj 1:\n* Defeat goblins",r={lp={{val=5}},tr={{val="Fateful Dwarf"}}},t="Slayer"},
{id="70041A6B",name="Enmity of the Goblins",cat="Race & Social",d="Goblins have always been the enemy of Beornings ever since Beorn was driven from the Misty Mountains.",faction="FrP",level=13,minlevel=13,ndx=1532,["next"]={1536},o="Obj 1:\n* Defeat goblins",r={lp={{val=5}},tr={{val="Bake a Honey-cake"}}},t="Slayer"},
{id="700062BB",name="Enmity of the Goblins II",cat="Race & Social",d="It looks like the Shire will need a new 'Bullroarer' soon, because there is no doubt that goblins are in force upon the land once again. The Bounds of the Shire are no longer safe, and the thought of your peaceful folk facing a tide of these foul creatures unawares makes your skin crawl. There will have to be a reckoning soon enough if that is to be prevented.",faction="FrP",level=35,minlevel=35,ndx=1533,o="Obj 1:\n* Complete 'Enmity of the Goblins'\nObj 2:\n* Defeat goblins",prev={1529},r={lp={{val=10}},tr={{val="Hobbit-silence"}}},t="Slayer"},
{id="7000630E",name="Enmity of the Goblins II",cat="Race & Social",d="Goblins are a mockery of life, twisted by the Enemy to serve unquestioningly as an endless supply of foot-soldiers in his wars. Luckily, the breeding of unquestioned loyalty has left them unimaginative and unskilled, making them no match for trained Elven warriors. Still, their numbers are vast, and if only one Elf falls for every hundred of their kind, it is a great loss.",faction="FrP",level=19,minlevel=19,ndx=1534,["next"]={1537},o="Obj 1:\n* Complete 'Enmity of the Goblins'\nObj 2:\n* Defeat goblins",prev={1530},r={lp={{val=10}},tr={{val="Tactics and Conviction Bonus"}}},t="Slayer"},
{id="70006336",name="Enmity of the Goblins II",cat="Race & Social",d="The dwarves have always held the advantage over the goblins in terms of skill in battle as well as quality of weapons, armour, and fortifications. The goblins, however, have always held the advantage in numbers -- a rather vast advantage.",faction="FrP",level=29,minlevel=29,ndx=1535,["next"]={1538},o="Obj 1:\n* Complete 'Enmity of the Goblins'\nObj 2:\n* Defeat goblins",prev={1531},r={lp={{val=10}},tr={{val="Return to Thorin's Gate"}}},t="Slayer"},
{id="70041A6A",name="Enmity of the Goblins II",cat="Race & Social",d="Your might can easily match several goblins at once.",faction="FrP",level=19,minlevel=19,ndx=1536,["next"]={1539},o="Obj 1:\n* Complete 'Enmity of the Goblins'\nObj 2:\n* Defeat goblins",prev={1532},r={lp={{val=10}},tr={{val="Return to Grimbeorn's Lodge"}}},t="Slayer"},
{id="7000630F",name="Enmity of the Goblins III",cat="Race & Social",d="It is uncertain what goblins think of Elves, as they are rarely willing to speak on the matter, save from the opposite end of a sharp implement. Are they at all aware of their distant ancestry, when they once lived among the Free Peoples? Do they hate the Elves because they are told to by their Dark Lord -- or is it because they remember something from long ago and strive to destroy you out of jealous hatred for your place in the light?",faction="FrP",level=25,minlevel=25,ndx=1537,o="Obj 1:\n* Complete 'Enmity of the Goblins II'\nObj 2:\n* Defeat goblins",prev={1534},r={lp={{val=15}},tr={{val="Elf Bow-damage Bonus"}}},t="Slayer"},
{id="70006337",name="Enmity of the Goblins III",cat="Race & Social",d="Goblins are an odd study in group-thought. As individuals, they are snivelling cowards who recoil from anyone who appears remotely stronger than themselves -- in large masses, they are known to hurl themselves with unthinking savagery onto pike and axe. The common wisdom is that in large groups the goblins in front simply have no choice, as they are pushed forward by the teeming masses behind them, and so they fight like cornered animals. From what you have seen, there may be some truth to this.",faction="FrP",level=35,minlevel=35,ndx=1538,o="Obj 1:\n* Complete 'Enmity of the Goblins II'\nObj 2:\n* Defeat goblins",prev={1535},r={lp={{val=15}},tr={{val="Endurance of Stone"}}},t="Slayer"},
{id="70041A69",name="Enmity of the Goblins III",cat="Race & Social",d="Fear spreads throughout the ranks of goblins. Far and wide, they whisper in hushed tones of the wrath of the line of Beorn.",faction="FrP",level=25,minlevel=25,ndx=1539,o="Obj 1:\n* Complete 'Enmity of the Goblins II'\nObj 2:\n* Defeat goblins",prev={1536},r={lp={{val=15}},tr={{val="Beorning Club and Axe-damage Bonus"}}},t="Slayer"},
{id="700062E8",name="Enmity of the Hillmen",cat="Race & Social",d="For many years there have been tribes of Men who have shunned the rule of Kings and the life of great cities and towns. While some of these might be called allies by the Men of Gondor or Rohan, far too often they fall under the sway of the Enemy, who plays upon their distrust of the great Kingdoms, or threatens them with hidden force, or sways them with false riches and power. Thus it has been that the Kingdoms of Middle-earth have often found themselves at war with the folk of the Hills when the Enemy rises -- and this age seems no exception.",faction="FrP",level=29,minlevel=29,ndx=1540,["next"]={1541},o="Obj 1:\n* Defeat Hillmen and Dunlendings",r={lp={{val=5}},tr={{val="Balance of Man"}}},t="Slayer"},
{id="700062E9",name="Enmity of the Hillmen II",cat="Race & Social",d="It seems that old superstitions and fear of the Enemy's dark power are what drive these Hillmen to flock to the banners of the Enemy -- ancient seeds sown long ago in the hearts of Men by the Dark Lord, that he might have willing servants to hand when he prepares to arise again. It has long been both the strength and downfall of Men that their hearts are their own, and that they may set their feet upon whatever path they choose....",faction="FrP",level=35,minlevel=35,ndx=1541,o="Obj 1:\n* Complete 'Enmity of the Hillmen'\nObj 2:\n* Defeat Hillmen and Dunlendings",prev={1540},r={lp={{val=10}},tr={{val="Strength of Morale"}}},t="Slayer"},
{id="70006310",name="Enmity of the Orcs",cat="Race & Social",d="Bred by the Enemy for war over land, the Orcs are larger and tougher than their goblin cousins, but their origins remain the same. Militant and brutish, they retain some native talent for the clever working of wood and metal, though they only apply this to the construction of weapons and other machines of war.",faction="FrP",level=13,minlevel=13,ndx=1542,["next"]={1546},o="Obj 1:\n* Defeat Orcs",r={lp={{val=5}},tr={{val="Friend Of Man"}}},t="Slayer"},
{id="70041A63",name="Enmity of the Orcs",cat="Race & Social",d="Orcs are clever, skilled, and brutal in combat. They do not however, anticipate their enemy changing into a massive bear and mauling them.",faction="FrP",level=29,minlevel=29,ndx=1543,["next"]={1547},o="Obj 1:\n* Defeat Orcs",r={lp={{val=5}},tr={{val="Feral Presence"}}},t="Slayer"},
{id="70048CE9",name="Enmity of the Orcs",cat="Race & Social",d="Bred by the Enemy for war over land, the Orcs are larger and tougher than their goblin cousins, but their origins remain the same. Militant and brutish, they retain some native talent for the clever working of wood and metal, though they only apply this to the construction of weapons and other machines of war.",faction="FrP",level=13,minlevel=13,ndx=1544,["next"]={1548},o="Obj 1:\n* Defeat Orcs",r={lp={{val=5}},tr={{val="Grace of the Firstborn"}}},t="Slayer"},
{id="70053B3D",name="Enmity of the Orcs",cat="Race & Social",d="During their thralldom in Barad-dûr, the Stout-axes were held to be lesser than even the lowliest Orc. Even as the Stout-axes endured the cruelty of the Enemy's servants, the old hatreds between dwarves and Orcs were not forgotten.",faction="FrP",level=35,minlevel=35,ndx=1545,["next"]={1549},o="Obj 1:\n* Defeat Orcs",r={lp={{val=5}},tr={{val="Heart of Fire"}}},t="Slayer"},
{id="70006311",name="Enmity of the Orcs II",cat="Race & Social",d="Unlike the goblins, the Orcs have been raised with a martial outlook and form the backbone of the Enemy's armies. They are neither cowards nor weaklings -- though they cannot hope to match the martial prowess of the Elves -- but their numbers and war industry are vast when motivated by their shadowy lords.",faction="FrP",level=29,minlevel=29,ndx=1546,["next"]={1550},o="Obj 1:\n* Complete 'Enmity of the Orcs'\nObj 2:\n* Defeat Orcs",prev={1542},r={lp={{val=10}},tr={{val="Return to Rivendell"}}},t="Slayer"},
{id="70041A68",name="Enmity of the Orcs II",cat="Race & Social",d="Some Orcs are aware of Beornings' unique ability. They have yet to figure out how to stop the mauling, though.",faction="FrP",level=35,minlevel=35,ndx=1547,o="Obj 1:\n* Complete 'Enmity of the Orcs'\nObj 2:\n* Defeat Orcs",prev={1543},r={lp={{val=10}},tr={{val="Natural Diet"}}},t="Slayer"},
{id="70048CE0",name="Enmity of the Orcs II",cat="Race & Social",d="Unlike the goblins, the Orcs have been raised with a martial outlook and form the backbone of the Enemy's armies. They are neither cowards nor weaklings -- though they cannot hope to match the martial prowess of the Elves -- but their numbers and war industry are vast when motivated by their shadowy lords.",faction="FrP",level=32,minlevel=32,ndx=1548,["next"]={1551},o="Obj 1:\n* Complete 'Enmity of the Orcs'\nObj 2:\n* Defeat Orcs",prev={1544},r={lp={{val=10}},tr={{val="Travel to Caras Galadhon"}}},t="Slayer"},
{id="70053B3E",name="Enmity of the Orcs II",cat="Race & Social",d="During their thralldom in Barad-dûr, the Stout-axes were held to be lesser than even the lowliest Orc. Even as the Stout-axes endured the cruelty of the Enemy's servants, the old hatreds between dwarves and Orcs were not forgotten.",faction="FrP",level=38,minlevel=38,ndx=1549,o="Obj 1:\n* Complete 'Enmity of the Orcs'\nObj 2:\n* Defeat Orcs",prev={1545},r={lp={{val=5}},tr={{val="Stout-shield"}}},t="Slayer"},
{id="70006312",name="Enmity of the Orcs III",cat="Race & Social",d="While Orcs dislike the sun nearly as much as their lesser brethren, the goblins, they have more tolerance for it and can be forced to endure it for a time when necessity -- or the lash of their masters -- demands. Despite this, it has long been an artifice of the Enemy to conjure forth vast clouds of smoke or darkness both to protect their troops from the rays of the sun and to conceal their movements from spies and scouts.",faction="FrP",level=35,minlevel=35,ndx=1550,o="Obj 1:\n* Complete 'Enmity of the Orcs II'\nObj 2:\n* Defeat Orcs",prev={1546},r={lp={{val=15}},tr={{val="Eldar's Grace"}}},t="Slayer"},
{id="70048CE2",name="Enmity of the Orcs III",cat="Race & Social",d="While Orcs dislike the sun nearly as much as their lesser brethren, the goblins, they have more tolerance for it and can be forced to endure it for a time when necessity -- or the lash of their masters -- demands. Despite this, it has long been an artifice of the Enemy to conjure forth vast clouds of smoke or darkness both to protect their troops from the rays of the sun and to conceal their movements from spies and scouts.",faction="FrP",level=42,minlevel=42,ndx=1551,o="Obj 1:\n* Complete 'Enmity of the Orcs II'\nObj 2:\n* Defeat Orcs",prev={1548},r={lp={{val=15}},tr={{val="Blade Dancer"}}},t="Slayer"},
{id="70066AAF",name="Enmity of the Orcs and Goblins",cat="Race & Social",d="Bred by the Enemy for war over land, the Orcs are larger and tougher than their goblin cousins, but their origins remain the same, and to the River Hobbits of Misthallow, there is little distinction between them. Militant and brutish, Orcs and goblins retain some native talent for the clever working of wood and metal, though they only apply this to the construction of weapons and other machines of war.",faction="FrP",level=19,minlevel=19,ndx=1552,["next"]={1553},o="Obj 1:\n* Defeat goblins and Orcs",r={lp={{val=5}},tr={{val="Seen the World"}}},t="Slayer"},
{id="70066AAE",name="Enmity of the Orcs and Goblins II",cat="Race & Social",d="Orcs and goblins are neither cowards nor weaklings, but their oft-unfocused strength and determination is of little use against a foe they cannot find—or a foe they cannot even be certain truly exists! Legends and stories persist among them of the River Hobbits of Misthallow, but there is little time to speak of such trifles in the service of the Enemy.",faction="FrP",level=25,minlevel=25,ndx=1553,["next"]={1554},o="Obj 1:\n* Complete 'Enmity of the Orcs and Goblins'\nObj 2:\n* Defeat goblins and Orcs",prev={1552},r={lp={{val=10}},tr={{val="Way with Water"}}},t="Slayer"},
{id="70066AAD",name="Enmity of the Orcs and Goblins III",cat="Race & Social",d="While Orcs dislike the sun nearly as much as their lesser brethren, the goblins, they have more tolerance for it and can be forced to endure it for a time when necessity—or the lash of their masters—demands. Despite this, the River Hobbits of Misthallow know all too well that Orcs and goblins of the North often stalk the mists that linger upon the Wells of Langflood.",faction="FrP",level=30,minlevel=30,ndx=1554,o="Obj 1:\n* Complete 'Enmity of the Orcs and Goblins II'\nObj 2:\n* Defeat goblins and Orcs",prev={1553},r={lp={{val=15}},tr={{val="Elusive Catch"}}},t="Slayer"},
{id="700062B7",name="Enmity of the Spiders",cat="Race & Social",d="While no respectable hobbit has ever had much to do with spiders, it seems of late that new breeds of the horrid things -- far larger than any proper spider ought to be -- have been migrating here from somewhere across the mountains to the East. For reasons unknown, these unpleasant creatures appear to have developed a great dislike for hobbits, making them quite a hazard for Little Folk living out on the edges of the Shire or beyond.",faction="FrP",level=13,minlevel=13,ndx=1555,["next"]={1557},o="Obj 1:\n* Defeat spiders",r={lp={{val=5}},tr={{val="Hobbit-stature"}}},t="Slayer"},
{id="70041A64",name="Enmity of the Spiders",cat="Race & Social",d="Living near Mirkwood, you and your kin are no stranger to monstrous spiders twisted by darkness.",faction="FrP",level=13,minlevel=13,ndx=1556,["next"]={1558},o="Obj 1:\n* Defeat spiders",r={lp={{val=5}},tr={{val="Emissary"}}},t="Slayer"},
{id="700062B8",name="Enmity of the Spiders II",cat="Race & Social",d="Where have these horrors come from? What ever happened to nice little garden spiders eating flies and all that? These days your idea of a spider starts at about two feet across and goes up from there -- hardly the kind of thing you would expect to encounter in the cozy Shire, yet now they seem to be common in all the forests of Eriador. It is enough to make even the most staid and placid hobbit sit up and take notice that things are getting rather queer these days.",faction="FrP",level=29,minlevel=29,ndx=1557,["next"]={1559},o="Obj 1:\n* Complete 'Enmity of the Spiders'\nObj 2:\n* Defeat spiders",prev={1555},r={lp={{val=10}},tr={{val="Return to Michel Delving"}}},t="Slayer"},
{id="70041A65",name="Enmity of the Spiders II",cat="Race & Social",d="These creatures have taken root in the once pure woods of Middle-earth. You have made some progress in clearing them out.",faction="FrP",level=29,minlevel=29,ndx=1558,["next"]={1560},o="Obj 1:\n* Complete 'Enmity of the Spiders'\nObj 2:\n* Defeat spiders",prev={1556},r={lp={{val=10}},tr={{val="Might and Conviction Bonus"}}},t="Slayer"},
{id="700062B9",name="Enmity of the Spiders III",cat="Race & Social",d="From your youth you recall an old Elven tale of some great spider that tried to devour all the light in the world...and how though she was driven off and disappeared forever, her brood was left to swarm and multiply in dreadful, dark places. You remember how that tall-tale used to send a chill down your spine every time your dad told it -- but with all that you have seen of late, you wonder if maybe there might be some truth to it....",faction="FrP",level=35,minlevel=35,ndx=1559,o="Obj 1:\n* Complete 'Enmity of the Spiders II'\nObj 2:\n* Defeat spiders",prev={1557},r={lp={{val=15}},tr={{val="Hobbit-resilience"}}},t="Slayer"},
{id="70041A67",name="Enmity of the Spiders III",cat="Race & Social",d="In your travels, you have found that spiders plague more than just your humble home. They are a threat that needs to be answered across Middle-earth.",faction="FrP",level=35,minlevel=35,ndx=1560,o="Obj 1:\n* Complete 'Enmity of the Spiders II'\nObj 2:\n* Defeat spiders",prev={1558},r={lp={{val=15}},tr={{val="Bracing Roar"}}},t="Slayer"},
{id="70006338",name="Enmity of the Trolls",cat="Race & Social",d="Trolls are a particularly deadly threat to the dwarves. Capable of smashing the strongest fortifications and thriving in the dark underground domains where the sun poses no danger, they have often been used to spearhead major assaults against the dwarf-kingdoms.",faction="FrP",level=29,minlevel=29,ndx=1561,["next"]={1562},o="Obj 1:\n* Defeat trolls",r={lp={{val=5}},tr={{val="Dwarf-endurance"}}},t="Slayer"},
{id="70006339",name="Enmity of the Trolls II",cat="Race & Social",d="Quite the opposite of goblins, most trolls have little cunning or intelligence of any kind. They are, however, almost mindlessly brave, crushing anything in their path with abandon. Only if they are badly injured are they likely to rebel -- though the sight of a Cave-troll running amok through its goblin handlers is enough to bring a chuckle to even the most hardened of veterans.",faction="FrP",level=35,minlevel=35,ndx=1562,o="Obj 1:\n* Complete 'Enmity of the Trolls'\nObj 2:\n* Defeat trolls",prev={1561},r={lp={{val=10}},tr={{val="Shield Brawler"}}},t="Slayer"},
{id="700062E5",name="Enmity of the Wargs",cat="Race & Social",d="Wargs are often deemed a scourge of Men because their preferred prey are the herds and livestock upon which many villages across Middle-earth so depend. In this regard they are much more a scourge than the lesser breeds of wolves, for Wargs are known to wantonly slaughter livestock even after they have sated themselves, leaving entire herds to rot.",faction="FrP",level=13,minlevel=13,ndx=1563,["next"]={1564},o="Obj 1:\n* Defeat Wargs",r={lp={{val=5}},tr={{val="Man of the Fourth Age"}}},t="Slayer"},
{id="700062E6",name="Enmity of the Wargs II",cat="Race & Social",d="Wargs are sometimes used by goblins as mounts to extend the range of their attacks against villages and settlements, for goblins are loth to strike further than they can march in a single night and still return to the dark safety of their caves before morning comes.",faction="FrP",level=29,minlevel=29,ndx=1564,["next"]={1565},o="Obj 1:\n* Complete 'Enmity of the Wargs'\nObj 2:\n* Defeat Wargs",prev={1563},r={lp={{val=10}},tr={{val="Return to Bree"}}},t="Slayer"},
{id="700062E7",name="Enmity of the Wargs III",cat="Race & Social",d="It is unclear what the true relationship is between goblins and Wargs. Some say that they are allied against common enemies, while others believe that the goblins actively breed and raise the creatures for war. It seems likely that both stories are partly true -- long ago, perhaps, the goblins bred the Wargs, which in time escaped to form their own packs under the most powerful and intelligent leaders among their kind...and now these packs continue to work with the goblins out of convenience.",faction="FrP",level=35,minlevel=35,ndx=1565,o="Obj 1:\n* Complete 'Enmity of the Wargs II'\nObj 2:\n* Defeat Wargs",prev={1564},r={lp={{val=15}},tr={{val="Duty-bound"}}},t="Slayer"},
{id="700062B4",name="Enmity of the Wolves",cat="Race & Social",d="Wolves have long been a scourge of the peaceful people of the Shire. In hard winters, they may come down from the North to prey upon livestock and to threaten the hobbits themselves in vicious packs. More recently, it seems that greater numbers have moved south, and there are rumours that they are being driven this way by goblins or even more sinister forces.",faction="FrP",level=13,minlevel=13,ndx=1566,["next"]={1568},o="Obj 1:\n* Defeat wolves",r={lp={{val=5}},tr={{val="Stoop for a Stone"}}},t="Slayer"},
{id="70066A6B",name="Enmity of the Wolves",cat="Race & Social",d="Wolves have long been a scourge of the peaceful River Hobbits of Misthallow. In hard winters, they often stalk the Wells of Langflood—and the Vales of Anduin to the south—to prey upon livestock and to threaten the River Hobbits themselves in vicious packs. Nowadays, though, one must wonder, for they have strayed from the North in larger and larger packs, and they seem more than just hungry—there are rumours that many of these packs were bred by some new evil to be particularly vicious, to prey upon the unwary and the meek, and to sniff out those who would mean to hide from the eyes of the Enemy.",faction="FrP",level=13,minlevel=13,ndx=1567,["next"]={1569},o="Obj 1:\n* Defeat wolves",r={lp={{val=5}},tr={{val="River-folk"}}},t="Slayer"},
{id="700062B5",name="Enmity of the Wolves II",cat="Race & Social",d="While wolves are often hostile, most folks just consider them to be dangerous predators rather than a true danger. Nowadays, though, one has to wonder...they are wandering down from the north in large packs, and they seem more than just hungry -- there are rumours that many of these packs were bred by the goblins in the north-lands to be particularly vicious and dangerous towards Men and hobbits and to ruin the herds of livestock upon which many of the towns of Eriador depend for their food.",faction="FrP",level=19,minlevel=19,ndx=1568,["next"]={1570},o="Obj 1:\n* Complete 'Enmity of the Wolves'\nObj 2:\n* Defeat wolves",prev={1566},r={lp={{val=10}},tr={{val="Guile and Conviction Bonus"}}},t="Slayer"},
{id="70066A6D",name="Enmity of the Wolves II",cat="Race & Social",d="The tales of old speak of goblins, bats, and Wargs loyal to an ancient Orc-lord who ruled Mount Gundabad. It is said that his wickedness was so great that it drew all manner of foul creatures to the surrounding lands, not the least of which are the vicious wolves that have long troubled the River Hobbits of Misthallow. Has such a thing come to pass yet again? Do new evils stir in the North? Whatever the truth of it, it seems an ill omen that now wolves can be found across nearly all of Middle-earth.",faction="FrP",level=19,minlevel=19,ndx=1569,o="Obj 1:\n* Complete 'Enmity of the Wolves'\nObj 2:\n* Defeat wolves",prev={1567},r={lp={{val=10}},tr={{val="Hobbit-silence"}}},t="Slayer"},
{id="700062B6",name="Enmity of the Wolves III",cat="Race & Social",d="The stories say that back in old Bullroarer's time, the arrival of Golfimbul's goblins were presaged by an invasion of wolves much like the one people are seeing these days. That cannot be a good sign.",faction="FrP",level=25,minlevel=25,ndx=1570,o="Obj 1:\n* Complete 'Enmity of the Wolves II'\nObj 2:\n* Defeat wolves",prev={1568},r={lp={{val=15}},tr={{val="Hobbit Club-damage Bonus"}}},t="Slayer"},
{id="70066A70",name="Enmity of the Wood-trolls",cat="Race & Social",d="Long ago, the River Hobbits of Misthallow first encountered the wood-demons of Mirkwood and tales of these terrible creatures passed into legend. Among the Elves, they are called wood-trolls, and it is said that their gnarled limbs drip with a deadly poison—one so terrible that it can rot a forest from within.",faction="FrP",level=19,minlevel=19,ndx=1571,["next"]={1572},o="Obj 1:\n* Defeat wood-trolls",r={lp={{val=5}},tr={{val="Guile and Tactics Bonus"}}},t="Slayer"},
{id="70066A71",name="Enmity of the Wood-trolls II",cat="Race & Social",d="Many are the tales of the wood-demons of the North, who spread like a festering disease through the Greenwood of old. Rumours tell that others alike to their kind have appeared in lands far beyond the bounds of Mirkwood and the Wells of Langflood, and many among the River Hobbits of Misthallow now believe that nature itself is being corrupted by some unseen hand.",faction="FrP",level=25,minlevel=25,ndx=1572,o="Obj 1:\n* Complete 'Enmity of the Wood-trolls'\nObj 2:\n* Defeat wood-trolls",prev={1571},r={lp={{val=10}},tr={{val="River Hobbit Spear and Dagger-damage Bonus"}}},t="Slayer"},
