{id="7001CF6F",name="Epilogue: Of Elves and Dwarves",cat="Epic",d="The tale of Moria and Lothlórien is nearing a close. What does the future hold for the Iron Garrison and the Golden Host?",faction="FrP",level=65,minlevel=60,ndx=1583,o="Obj 1:\nThe Volume 2 Epilogue does not begin until you have completed Book 9: Fortress of the Nazgûl.\n* Complete 'Chapter 18: The Battle in the Tower'\nObj 2:\nThe Golden Host and the Iron Garrison have completed their mission to Mirkwood, but there is still a story to be told.\n* Complete 'Epilogue: Zigilburk Returned'\n* Complete 'Epilogue: Sigileth's Knives'\n* Complete 'Epilogue: Ningloril'\n* Complete 'Epilogue: Laeglang'\n* Complete 'Epilogue: Alfirimbes'\n* Complete 'Epilogue: Greyhammers'\n* Complete 'Epilogue: Cúcheron's Bow'\n* Complete 'Epilogue: Achardor's Fate'\n* Complete 'Epilogue: Barvessain'\n* Complete 'Epilogue: Braiglinn'\n* Complete 'Epilogue: Issuriel's Flower'\n* Complete 'Epilogue: Gorothúl of Dol Guldur'",r={lp={{val=5}},ti={{val="Hastener of Fate"}}},t="Lore"},
