{id="70019D87",name="Flet-runner Challenges",c={"This deed begins with a quest from Celechest who is located at [15.5W, 67.2W] (ground Level). Once you have completed At Home Among the Trees the deed will pop up. Here are the locations of the other NPCs you will need to go to. You can do these in any order:\n* Leginiel [15.1S, 67.7W] - Located on the flet, Telain Bangad.\n* Lagordal [15.4S, 67.9W] - Located on the flet, Telain Galadhrim.\n* Bregradel [14.7S, 66.7W] - ground level.\n* Lintwen [16.2S, 66.7W] - ground Level."},cat="Lothlórien",d="A number of flet-runners throughout Caras Galadhon have challenged you to join their ranks by demonstrating your awareness of the city's layout and the quickness of your feet.",faction="FrP",level=58,minlevel=1,ndx=1852,o="Obj 1:\n* Complete 'At Home Among the Trees'\n* Complete 'Flet-runner Challenge: Leginiel'\n* Complete 'Flet-runner Challenge: Lagordal'\n* Complete 'Flet-runner Challenge: Bregradel'\n* Complete 'Flet-runner Challenge: Lintwen'",r={lp={{val=5}},rc={{id="7002B017",q=30,val="Mark"}},ri={{val="+700 with Galadhrim"}},ti={{val="Flet-runner"}}},t="Reputation",zone="Lothlórien"},
