{id="70009711",name="Gauradan-slayer",c={"Gauradan can be found at the following location North-west in Evendim:\n* The Gloaming Falls\n* Dol Haedir"},cat="Evendim",d="Folk tales have long spoken of werewolves stalking the night -- but now that you have met the Gauredain, you suspect you know more of the truth of these tales. If they are Men, then they are only barely so. They are greater than most Men in stature, yet hunched over and using only primitive tools and speech and often dressing in the skins of wolves.",faction="FrP",level=36,minlevel=30,ndx=2126,["next"]={2128},o="Obj 1:\n* Defeat Gauredain in Evendim",r={lp={{val=5}},ri={{val="+500 with The Wardens of Annúminas"}},ti={{val="Slayer of the Gauredain"}}},t="Slayer",zone="Evendim"},
{id="7000F0A3",name="Gauradan-slayer",c={"A good place to find Gauredain for this deed is:\n* Barad Gaurhoth [12.0N, 82.8W]"},cat="Forochel",d="At last you have come upon the homeland of the Gauredain -- and in seeing it, it becomes clear how they came to be such powerful brutes, shaped by the vicious elements and hardships of Forochel, it is hard to imagine them otherwise -- and yet the Lossoth still maintain the trappings of civilization under the same hardships. Have the Gauredain chosen their path in this fashion, or is their brutal path some long-ago contrivance of the Enemy?",faction="FrP",level=46,minlevel=30,ndx=2127,["next"]={2129},o="Obj 1:\n* Defeat Gauredain in Forochel",r={lp={{val=5}},ri={{val="+500 with Lossoth of Forochel"}},ti={{val="Repulser of Savages"}}},t="Slayer",zone="Forochel"},
{id="70009712",name="Gauradan-slayer (Advanced)",c={"Gauradan can be found at the following location North-west in Evendim:\n* The Gloaming Falls\n* Dol Haedir"},cat="Evendim",d="If the Gauredain were known to the ancient Kings of Arnor, few tales survive to this day that speak of them. More likely it seems that these savage Men wandered down into Evendim from the far north from Forochel.",faction="FrP",level=36,minlevel=30,ndx=2128,["next"]={3741},o="Obj 1:\n* Complete 'Gauradan-slayer'\nObj 2:\n* Defeat Gauredain in Evendim",prev={2126},r={lp={{val=10}},rc={{id="7002B017",q=30,val="Mark"}},ri={{val="+700 with The Wardens of Annúminas"}},vx={{val=2000}}},t="Slayer",zone="Evendim"},
{id="7000F0A4",name="Gauradan-slayer (Advanced)",c={"A good place to find Gauredain for this deed is:\n* Barad Gaurhoth [12.0N, 82.8W]\n* Hylje-leiri [18.2N, 81.3W]"},cat="Forochel",d="It seems odd indeed that two people such as the Gauredain and the Lossoth should do battle to claim such a forbidding and difficult land as Forochel, and yet they strive endlessly over it. It seems that home is the place you know, and wherever that might be, Men, dwarves, hobbits, Elves, Orcs -- and whatever else -- will fight to defend it.",faction="FrP",level=46,minlevel=30,ndx=2129,["next"]={3743},o="Obj 1:\n* Complete 'Gauradan-slayer'\nObj 2:\n* Defeat Gauredain in Forochel",prev={2127},r={lp={{val=10}},rc={{id="7002B017",q=30,val="Mark"}},ri={{val="+700 with Lossoth of Forochel"}},vx={{val=2000}}},t="Slayer",zone="Forochel"},
{id="70041709",name="Genealogy of the Beornings",area="Rivendell Valley",cat="Class",class="Beorning",d="The first four pages of this book can be found on enemies scattered across Angmar, Eregion, and Moria. The last four pages of this book can be found on enemies scattered across Forochel, Moria, and the Misty Mountains.\nThis book contains a number of genealogical diagrams professing to document the various lines and branches of your family, but some of the pages are missing.\nYou do not know who prepared this book, but perhaps Bilbo Baggins, currently staying in Rivendell, knows something about it. He has an interest in such things and knew your relative Beorn.",faction="FrP",level=46,minlevel=39,ndx=2130,o="Obj 1:\n* Collect Genealogy of the Beorning\nObj 2:\nYou have found a book that purports to trace the genealogy of your family. Perhaps Bilbo Baggins, currently staying in Rivendell, will know something about it.\n* Talk to Bilbo Baggins at the Last Homely House in Rivendell.\nObj 3:\nCollect the missing pages of 'Genealogy of the Beornings' and add them to the book.\n* Genealogy of the Beornings, Page 17\n* Genealogy of the Beornings, Page 18\n* Genealogy of the Beornings, Page 19\n* Genealogy of the Beornings, Page 20\n* Genealogy of the Beornings, Page 21\n* Genealogy of the Beornings, Page 22\n* Genealogy of the Beornings, Page 23\n* Genealogy of the Beornings, Page 24",pois={{name="Bilbo Baggins",area="Rivendell Valley",dungeon="The Last Homely House",loc={"63.5N, 53.9E"},zone="The Trollshaws"}},r={lp={{val=10}}},t="Class",zone="The Trollshaws"},
{id="70041C1F",name="Get Your Bearings",cat="Class",class="Beorning",d="Your dual nature is no stranger to you, but transforming in the heat of battle is a bit more complicated.",faction="FrP",level=1,minlevel=1,ndx=2131,["next"]={778},o="Obj 1:\nThis is your objective description.\n* Enter Bear Form",r={lp={{val=5}}},t="Class"},
