{id="70009713",name="Giant-slayer",c={"The Giants are all holed up in Amon Moth, North-west in Evendim."},cat="Evendim",d="A tribe of Stone-giants appears to have taken up residence in the western hills above Evendim. While not so great in stature as their legendary cousins in the Misty Mountains, they are nevertheless powerful opponents when aroused and more than a match for any lone soldier.",faction="FrP",level=39,minlevel=30,ndx=2144,["next"]={2148},o="Obj 1:\n* Defeat giants in Evendim",r={lp={{val=5}},ri={{val="+500 with The Wardens of Annúminas"}},ti={{val="Enemy of the Giants"}}},t="Slayer",zone="Evendim"},
