{id="70009714",name="Giant-slayer (Advanced)",c={"The Giants are all holed up in Amon Moth, North-west in Evendim."},cat="Evendim",d="No-one seems to know where the allegiance of the giants lies -- indeed, it seems likely that they serve none but themselves given their capricious nature. Nevertheless, should these lands fall to the Enemy, the giants would doubtless be pressed into his service as terrible soldiers.",faction="FrP",level=39,minlevel=20,ndx=2148,["next"]={3741},o="Obj 1:\n* Complete 'Giant-slayer'\nObj 2:\n* Defeat giants in Evendim",prev={2144},r={lp={{val=10}},rc={{id="7002B017",q=30,val="Mark"}},ri={{val="+700 with The Wardens of Annúminas"}},vx={{val=2000}}},t="Slayer",zone="Evendim"},
