{id="70016AB5",name="Globsnaga-slayer (Advanced)",c={"The following places are great to find Globsnaga Orcs:\n* North-west from The Chamber of Dark Waters at [16.9S, 111.9W] in The Water-works.\n* Dalgum-ru at [14.2S, 101.6W], south-west corner of The Foundations of Stone."},cat="Moria",d="You have defeated a great number of the Globsnaga, the fungus-infested Orcs of Moria, and still you remain standing, having resisted the disease that wreaths these foes. They must be destroyed to the last, for the plague they bear is a perilous invention of the Enemy.",faction="FrP",level=55,minlevel=47,ndx=2162,["next"]={4712},o="Obj 1:\n* Complete 'Globsnaga-slayer'\nObj 2:\n* Defeat Globsnaga in Moria",prev={2161},r={lp={{val=10}},rc={{id="7005D8A0",val="Enhancement Runes, Incomparable"}},ri={{val="+700 with Iron Garrison Miners"}},vx={{val=2000}}},t="Slayer",zone="Moria"},
{id="7001C120",name="Glory in the Sword-hall of Dol Guldur",area="Dol Guldur",cat="Tower of Dol Guldur",d="The minions of the Enemy train in the Sword-hall of Dol Guldur, improving their skills for the inevitable invasion of Lothlórien. They must learn just how lacking they are....",faction="FrP",level=65,minlevel=60,ndx=2163,o="Obj 2:\n* Complete Enter the Arena\n* Complete Battle Royale",prev={1577,4093},r={lp={{val=10}},rc={{id="7002B018",q=20,val="Medallion"}},ti={{val="Victorious of the Sword-halls"}}},t="Lore",zone="Mirkwood"},
