{id="70009715",name="Goblin-slayer",c={"Goblins can be found in the following places:\n* Tum Fuin\n* Tham Andalath"},cat="Evendim",d="The scourge of the goblins appears to be everywhere these days, even on the borders of the Shire itself. Rumour has it that in Evendim a new breed of the foul creatures can be found in the odd-looking Boggarts -- cowardly snivelling things that hunt in packs to bring down their prey.",faction="FrP",level=28,minlevel=20,ndx=2174,["next"]={2181},o="Obj 1:\n* Defeat goblins in Evendim",r={lp={{val=5}},ri={{val="+500 with The Wardens of Annúminas"}},ti={{val="Goblin-foe"}}},t="Slayer",zone="Evendim"},
{id="70016AB6",name="Goblin-slayer",cat="Moria",d="Goblins have made their home in Khazad-dûm like a swarm of ants, ever burrowing under the mountains and seeking the riches of the dwarves. To curb their growth would be a heroic deed, both in Moria and elsewhere in Middle-earth, for they are a dangerous nuisance wherever they reside.",faction="FrP",level=51,minlevel=47,ndx=2175,["next"]={2182},o="Obj 1:\n* Defeat goblins in Moria",r={lp={{val=5}},ri={{val="+500 with Iron Garrison Guards"}},ti={{val="Goblin-bane"}}},t="Slayer",zone="Moria"},
