{id="70009716",name="Goblin-slayer (Advanced)",c={"Goblins can be found in the following places:\n* Tum Fuin\n* Tham Andalath"},cat="Evendim",d="It seems that the goblins in southern Evendim have not yet come in great numbers, perhaps they are only here to harry the folk of the Shire and distract the Rangers from more important goals elsewhere? Nonetheless, the goblins use deep tunnels to move about beneath the sight of the keenest-eyed scout, so they can come forth suddenly in great numbers to wreak havoc upon the unprepared.",faction="FrP",level=28,minlevel=20,ndx=2181,["next"]={3741},o="Obj 1:\n* Complete 'Goblin-slayer'\nObj 2:\n* Defeat goblins in Evendim",prev={2174},r={lp={{val=10}},rc={{id="7002B017",q=30,val="Mark"}},ri={{val="+700 with The Wardens of Annúminas"}},vx={{val=2000}}},t="Slayer",zone="Evendim"},
