{id="7000C6A0",name="Goblin-town",cat="Misty Mountains",d="Few know the full extent of the depths of Goblin-town, and those who have experienced them most likely died therin as slaves to cruel goblin-overseers. The goblins themselves may not know all the ways, for the deepest passages extend far into the heart of the Misty Mountains where dark and unseen terrors lie, and the goblins will not brave these passages unless driven or enraged.",faction="FrP",level=45,minlevel=30,ndx=2196,["next"]={1772},o="Obj 1:\nEXPLORE STUFF\n* Discover War Steadings\n* Discover Thundergrot\n* Discover Slave Pens\n* Discover Gollum's Cave\n* Discover The Great Goblin's Den\n* Discover The Deep-fires\n* Discover Eglanúr",pois={{name="Slave Pens",area="Northern High Pass",dungeon="Goblin-town",loc={"64.9S, 54.8E"},zone="The Misty Mountains"},{name="Eglanúr",loc={"67.6S, 55.4E","67.8S, 55.4E"},zone="Bree-land"},{name="The Great Goblin's Den",area="Northern High Pass",dungeon="The Great Goblin's Den",loc={"62.9S, 54.2E"},zone="The Misty Mountains"},{name="Thundergrot",area="Northern High Pass",dungeon="Goblin-town Depths",loc={"66.4S, 54.9E"},zone="The Misty Mountains"},{name="The Deep-fires",loc={"70.3S, 56.2E"},zone="Bree-land"},{name="War Steadings",area="Northern High Pass",dungeon="Den of the Northern Army",loc={"63.5S, 54.7E","63.9S, 54.1E","63.9S, 54.7E","64.2S, 54.7E","64.4S, 54.4E"},zone="The Misty Mountains"},{name="Gollum's Cave",area="Northern High Pass",dungeon="Gollum's Cave",loc={"63.5S, 55.6E"},zone="The Misty Mountains"}},r={lp={{val=10}},rc={{id="7002B017",q=30,val="Mark"}},ri={{val="+500 with Elves of Rivendell"}},vx={{val=2000}}},t="Explorer",zone="The Misty Mountains"},
{id="7001791B",name="Golu o Maeth",area="Rivendell Valley",cat="Class",class="Rune-keeper",d="The first four pages of this book can be found on enemies scattered across Angmar, Eregion, and Moria. The last four pages of this book can be found on enemies scattered across Forochel, Moria, and the Misty Mountains.\nGolu o Maeth was composed, it is said, by a great scholar of ancient Doriath. It is one of the oldest translations of the fundamentals of Rune-craft, an examination of the Tengwar in particular and their relationship to the powers of combat. This lore was thought lost after the destruction of Beleriand, though rumours persisted that at least one copy was brought east of the Ered Luin before then. Age has not been kind to this volume, however, and many of its pages have crumbled to dust. Even so, Elrond of Rivendell would certainly regard it as a relic beyond compare.",faction="FrP",level=44,minlevel=39,ndx=2197,o="Obj 1:\n* Collect Golu o Maeth\nObj 2:\n* Talk to Elrond Half-elven at the Last Homely House in Rivendell\nObj 3:\n* Golu o Maeth, page 7\n* Golu o Maeth, page 8\n* Golu o Maeth, page 12\n* Golu o Maeth, page 18\n* Golu o Maeth, page 19\n* Golu o Maeth, page 22\n* Golu o Maeth, page 24\n* Golu o Maeth, page 31",pois={{name="Elrond",area="Rivendell Valley",dungeon="The Last Homely House",loc={"62.8N, 54.1E"},zone="The Trollshaws"}},r={lp={{val=10}}},t="Class",zone="The Trollshaws"},
