{id="7000B2CB",name="Grave-digger",c={"* 30.17S, 54.71W - This is the entrance to the Barrow Downs.\n* 35.15S, 55.14W - Haudh Iarchith","You must be lvl 27 to start this deed"},cat="Bree-land",d="The scent of grave-soil lingers ever present in the air of the Barrow-downs, offering constant reminder of how many lay buried within its twisting corridors -- though it seems now that few of them lay resting as they were meant to....",faction="FrP",level=20,minlevel=10,ndx=2212,["next"]={2213},o="Obj 1:\n* Defeat Barrow-wardens in the Barrow-downs",r={lp={{val=5}},ri={{val="+700 with Men of Bree"}},ti={{val="Grave-digger"}}},t="Slayer",zone="Bree-land"},
