{id="70022A96",name="Great Barrow -- The Gate to Sambrog",cat="Shadows of Angmar",d="Access to the depths of the Great Barrow and the gaunt-man Sambrog is gated by a key. One half lies within the maze, the other with Thadúr.",faction="FrP",level=1,minlevel=1,mobs={{name="Thadúr the Ravager",area="Southern Barrow-downs",dungeon="The Great Barrow",loc={"59.3N, 144.9W"},zone="Bree-land"},{name="Gaerthel",area="Southern Barrow-downs",dungeon="The Great Barrow",loc={"59.4N, 145.4W"},zone="Bree-land"}},ndx=2218,o="Obj 1:\n* Defeat Thadúr the Ravager and claim half of the key\n* Defeat Gaerdring and Gaerthel and claim half of the key.",r={rc={{id="700076BF",val="Skull Key"}}},t="Slayer"},
