{id="7000F0A5",name="Grim-slayer",c={"There are several places where you can find Grim's in Forochel\n* East of Kibilzahar at [20.0N, 81.9W]\n* South-east of Kibilzahar at [16.0N, 81.7W]\n* In a cave at [13.1N, 79.3W] (where you also can find Nicca)\n* East of Sûri-kylä  [18.5N, 67.4W]\nBut the problem is, there a just a couple of them at those places, so the most effective way is to go to Jä-reitti at [8.0N, 66.4W], kill 4 or 5 Grim there, travel a bit south in Jä-kuru to [8.0N, 66.4W], kill 5 or 6 Grims there and go back (hence and repeat)."},cat="Forochel",d="The Gauredain believe that the grims are the wandering souls of those among their people who were cast out for their cowardice, damned to eternally wander the frozen snow-fields after they froze to death in the ice. Those few among the wise who know of these creatures, however, suspect that they are more likely fell spirits left wandering the northern wastes long after the fall of their ancient Dark Lord.",faction="FrP",level=45,minlevel=30,ndx=2228,["next"]={2229},o="Obj 1:\n* Defeat grims in Forochel",r={lp={{val=5}},ri={{val="+500 with Lossoth of Forochel"}},ti={{val="the Ice-render"}}},t="Slayer",zone="Forochel"},
{id="7000F0A6",name="Grim-slayer (Advanced)",c={"There are several places where you can find Grim's in Forochel\n* East of Kibilzahar at [20.0N, 81.9W]\n* South-east of Kibilzahar at [16.0N, 81.7W]\n* In a cave at [13.1N, 79.3W] (where you also can find Nicca)\n* East of Sûri-kylä  [18.5N, 67.4W]\nBut the problem is, there a just a couple of them at those places, so the most effective way is to go to Jä-reitti at [8.0N, 66.4W], kill 4 or 5 Grim there, travel a bit south in Jä-kuru to [8.0N, 66.4W], kill 5 or 6 Grims there and go back (hence and repeat)."},cat="Forochel",d="If there is the slightest trace of a once-living spirit within the grim, it would seem that it is not enough to show any sign of compassion or mercy. At the slightest sign of warmth or life they strike, seemingly intent on snuffing it out in a howling assault of hail and hatred.",faction="FrP",level=45,minlevel=30,ndx=2229,["next"]={3743},o="Obj 1:\n* Complete 'Grim-slayer'\nObj 2:\n* Defeat grims in Forochel",prev={2228},r={lp={{val=10}},rc={{id="7002B017",q=30,val="Mark"}},ri={{val="+700 with Lossoth of Forochel"}},vx={{val=2000}}},t="Slayer",zone="Forochel"},
