{id="70016AB8",name="Grodbog-slayer",c={"The following places are great to find gredbyg for this deed:\n* The Chittering Hole at [14.0S, 105.0W], south-west in The Redhorn Lodes.\n* The Palace of Náin at [6.6S, 113.6W], north from The Great Delving."},cat="Moria",d="Great insects, the gredbyg, have been drawn to the vast dark of Moria like moths to a flame. They lurk in the gloom, ready at any time to ambush travellers unlucky enough to be caught at unawares upon the ever-turning paths.",faction="FrP",level=55,minlevel=47,ndx=2233,["next"]={2234},o="Obj 1:\n* Defeat gredbyg in Moria",r={lp={{val=5}},ri={{val="+500 with Iron Garrison Guards"}},ti={{val="Bug Crusher"}}},t="Slayer",zone="Moria"},
{id="70016AB9",name="Grodbog-slayer (Advanced)",c={"The following places are great to find gredbyg for this deed:\n* The Chittering Hole at [14.0S, 105.0W], south-west in The Redhorn Lodes.\n* The Palace of Náin at [6.6S, 113.6W], north from The Great Delving."},cat="Moria",d="Now that some cleansing has been done against the vile insects of Moria, the effort must be ever maintained. Gredbyg do not ever truly leave a place, but their numbers should be quelled, lest the caves are overrun once more. To prevail against the gredbyg of Moria will be a tireless task.",faction="FrP",level=55,minlevel=47,ndx=2234,["next"]={4712},o="Obj 1:\n* Complete 'Grodbog-slayer'\nObj 2:\n* Defeat gredbyg in Moria",prev={2233},r={lp={{val=10}},rc={{id="7005D8A0",val="Enhancement Runes, Incomparable"}},ri={{val="+700 with Iron Garrison Miners"}},vx={{val=2000}}},t="Slayer",zone="Moria"},
