{id="70064347",name="Gwathrenost, the Witch-king's Citadel - Leading the Charge",cat="Return to Carn Dûm",d="Once the seat of the Witch-king of Angmar, the dread citadel of Gwathrenost casts a long shadow upon the city of Carn Dûm. All but abandoned after the Steward of Angmar was deposed, the remnants of the Iron Crown have crept forth from the shadows, seeking to master a lost artifact of the Witch-king and reclaim dominion of Angmar.",faction="FrP",level=140,minlevel=135,ndx=2258,o="Obj 1:\nOnce the seat of the Witch-king of Angmar, the dread citadel of Gwathrenost casts a long shadow upon the city of Carn Dûm. All but abandoned after the Steward of Angmar was deposed, the remnants of the Iron Crown have crept forth from the shadows, seeking to master a lost artifact of the Witch-king and reclaim dominion of Angmar.\n* Be among the first to fully complete 'Gwathrenost, the Witch-king's Citadel' on Tier 3.",prev={2267},r={ti={{val="Led the Charge at Gwathrenost"}}},t="Slayer"},
