{id="70022920",name="Helegrod -- Dragon Wing",cat="Shadows of Angmar",d="Helegrod was once an outpost of the great dwarf-realm of the Misty Mountains known to most as Moria. This wing now serves as the tomb of the dragon Thorog.",faction="FrP",level=1,minlevel=50,ndx=2340,o="Obj 1:\nWho knows what treasures remain in the hoard of the great beast Thorog.\n* Complete Thorog Defeated",r={rc={{id="7002B017",q=100,val="Mark"}},ti={{val="De-animator of Thorog"}}},t="Slayer"},
{id="70022579",name="Helegrod -- Drake Wing",cat="Shadows of Angmar",d="Helegrod was once an outpost of the great dwarf-realm of the Misty Mountains known to most as Moria. This wing is now home to a brood of drakes descended from the great dragon Thorog.",faction="FrP",level=1,minlevel=50,ndx=2341,o="Obj 1:\nGrisgart, a Man of Angmar serving at Helegrod, acts as the master of the drakes, bending them to the will of the Iron Crown.\n* Complete Challenge: Grisgart\n* Complete Drake-wrangler\n* Complete Keep Them from Hatching\n* Complete Fangs for Nothing",r={rc={{id="7002B017",q=100,val="Mark"}},ti={{val="Drake Dropper"}}},t="Slayer"},
{id="700228B6",name="Helegrod -- Giant Wing",cat="Shadows of Angmar",d="Helegrod was once an outpost of the great dwarf-realm of the Misty Mountains known to most as Moria. Giants under the influence of Skorgrím Dourhand and the Angmarim now call this wing of the dwarf-hold home.",faction="FrP",level=1,minlevel=50,ndx=2342,o="Obj 1:\nThe mighty Storvâgûn leads his people in the fastness of Helegrod, holding the fortress against the Free Peoples.\n* Complete Giants in the Service of Angmar\n* Complete Giant-slayer\n* Complete Beasts of Snow\n* Complete Challenge: Storvâgûn",r={rc={{id="7002B017",q=100,val="Mark"}},ti={{val="Diminisher of Giants"}}},t="Slayer"},
{id="700228C7",name="Helegrod -- Spider Wing",cat="Shadows of Angmar",d="Helegrod was once an outpost of the great dwarf-realm of the Misty Mountains known to most as Moria. Great spiders now infest many portions of the ancient dwarf-hold.",faction="FrP",level=1,minlevel=50,ndx=2343,o="Obj 1:\nThe evil spider-queen Zaudru is one of the strongest of the spawn of Shelob, spawn of Ungoliant.\n* Complete An Evil Place, Crawling with Spiders\n* Complete Zaudru's Brood\n* Complete Spider Squasher\n* Complete Challenge: Zaudru",r={rc={{id="7002B017",q=100,val="Mark"}},ti={{val="Spider Spooker"}}},t="Slayer"},
{id="700217B0",name="Helegrod -- The Gate to Thorog",area="Helegrod",cat="Shadows of Angmar",d="Access to the courtyard and Thorog is controlled by three guardians. They must all be vanquished before the master of Helegrod may be approached.",faction="FrP",level=1,minlevel=1,mobs={{name="Storvâgûn",area="Helegrod",loc={"18.4S, 1.4E"},zone="The Misty Mountains"},{name="Zaudru",area="Helegrod",dungeon="Torech Mordeloth",loc={"16S, 1.6E"},zone="The Misty Mountains"}},ndx=2344,o="Obj 1:\n* Defeat Storvâgûn and claim the Giant Wing\n* Defeat Zaudru and claim the Spider Wing\n* Defeat Grisgart and claim the Drake Wing",r={ti={{val="Challenger of Thorog"}}},t="Slayer",zone="The Misty Mountains"},
