{id="7002BE84",name="Isengard: The Pits of Isengard",area="Isengard",cat="Rise of Isengard",d="Deep in the Pits of Isengard, Saruman is breeding evil armies. End his experiments, end the armies, and strike a blow against the White Hand.",faction="FrP",level=75,minlevel=65,ndx=2529,["next"]={4073},o="Obj 2:\n* Complete the Pits of Isengard, Abomination Wing (Tier I)\n* Complete the Pits of Isengard, Fire Wing (Tier I)\n* Complete the Pits of Isengard (Tier II)\n* Complete the Pits of Isengard (Challenge)",r={lp={{val=10}},rc={{id="7002B018",q=30,val="Medallion"}}},t="Lore",zone="Dunland"},
