{id="70009717",name="Kergrim-slayer",c={"Kergrims can be found throughout the Men Erain [17.6S, 66.6W] area."},cat="Evendim",d="The Kergrim are yet another mystery of the lands of Evendim. The Rangers seem to believe that they are a distant cousin of the snow-beasts that range throughout the Misty Mountains, but none can say why they would be here -- or what power has twisted them into these hideous shapes. The implication is that the hand of the Enemy is at work here, somehow, but there is no clear evidence of his power here, otherwise.",faction="FrP",level=38,minlevel=30,ndx=2544,["next"]={2545},o="Obj 1:\n* Defeat Kergrim in Evendim",r={lp={{val=5}},ri={{val="+500 with The Wardens of Annúminas"}},ti={{val="Bane of the Kergrim"}}},t="Slayer",zone="Evendim"},
{id="70009718",name="Kergrim-slayer (Advanced)",c={"Kergrims can be found throughout the Men Erain [17.6S, 66.6W] area."},cat="Evendim",d="Many of the foul Kergrim appear to have infested the valley in which the tombs of the ancient Dúnedain kings can be found. No doubt the Rangers of the North are enraged by the potential desecration of their ancestors' tombs by these beasts, but they can spare few men to root them out.",faction="FrP",level=38,minlevel=30,ndx=2545,["next"]={3741},o="Obj 1:\n* Complete 'Kergrim-slayer'\nObj 2:\n* Defeat Kergrim in Evendim",prev={2544},r={lp={{val=10}},rc={{id="7002B017",q=30,val="Mark"}},ri={{val="+700 with The Wardens of Annúminas"}},vx={{val=2000}}},t="Slayer",zone="Evendim"},
