{id="70000200",name="Knee-breaker's Manual",area="Rivendell Valley",cat="Class",class="Burglar",d="The first four pages of this book can be found on enemies scattered across Angmar, Eregion, and Moria. The last four pages of this book can be found on enemies scattered across Forochel, Moria, and the Misty Mountains.\nKnee-breaker's Manual is an odd tome -- it appears to be written in a rather careful and precise script, but the passages themselves describe a particularly coarse and savage individual. Whoever he was, the exploits described in this book certainly lean to the unsavoury side of the burglar's profession. Nevertheless, there are a number of intriguing points that the author of the book presents.\nFrustratingly, several key pages are missing. It is said that the famous burglar Bilbo Baggins has undertaken a study of the profession since his retirement -- perhaps he could tell you something about this 'Knee-breaker' or the missing sections of his manual?",faction="FrP",level=44,minlevel=39,ndx=2617,o="Obj 1:\n* Collect Knee-breaker's Manual\nObj 2:\nKnee-breaker's Manual is an odd tome -- it appears to be written in a rather careful and precise script, but the passages themselves describe a particularly corse and savage individual. Whomever he was, the exploits described in this book certainly lean to the unsavory side of the Burglar's profession. Nevertheless, there are a number of intriguing points that the author of the book presents, but frustratingly several key pages are missing.\nIt's said that the famous Burglar Bilbo Baggins has undertaken a study of the profession since his retirement - perhaps he could tell you something about this 'Knee-breaker' or the missing sections of his manual?\n* Talk to Bilbo Baggins at the Last Homely House in Rivendell.\nObj 3:\nKnee-breaker was known to associate with the Hill-men of Angmar and possibly even with the orcish tribes in the Misty Mountains.\n* Knee-breaker's Manual, page 1\n* Knee-breaker's Manual, page 3\n* Knee-breaker's Manual, page 4\n* Knee-breaker's Manual, page 8\n* Knee-breaker's Manual, page 10\n* Knee-breaker's Manual, page 15\n* Knee-breaker's Manual, page 16\n* Knee-breaker's Manual, page 19",pois={{name="Bilbo Baggins",area="Rivendell Valley",dungeon="The Last Homely House",loc={"63.5N, 53.9E"},zone="The Trollshaws"}},r={lp={{val=10}}},t="Class",zone="The Trollshaws"},
