{id="7005CC0F",name="Knowledge of Kicks",area="Bree",cat="Class",class="Brawler",d="The first four pages of this book can be found on enemies scattered across Angmar, Eregion, and Moria. The last four pages of this book can be found on enemies scattered across Forochel, Moria, and the Misty Mountains.\nKnowledge of Kicks was written by Brom Hawksbeard, a brawler from Bree-land.\nSeveral pages are missing.",faction="FrP",level=44,minlevel=39,ndx=2620,o="Obj 1:\n* Collect Knowledge of Kicks\nObj 2:\nThis curious manual describes a huge variety of kicks... you had no idea just how many there were.\nHowever, several pages are missing.\n* Ask Brom why his treatise is missing so many pages\nObj 3:\nThe first four pages of this book can be found on enemies scattered across Angmar, Eregion, and Moria. The last four pages of this book can be found on enemies scattered across Forochel, Moria, and the Misty Mountains.\n* Knowledge of Kicks, Page 7\n* Knowledge of Kicks, Page 10\n* Knowledge of Kicks, Page 12\n* Knowledge of Kicks, Page 18\n* Knowledge of Kicks, Page 19\n* Knowledge of Kicks, Page 25\n* Knowledge of Kicks, Page 35\n* Knowledge of Kicks, Page 37",pois={{name="Brom Hawksbeard",area="Bree",dungeon="Bree-town Jail",loc={"50.1S, 53.8E"},zone="Bree-land"}},r={lp={{val=10}},rc={{id="70000662",q=5,val="Hard Cider"}}},t="Class",zone="Bree-land"},
