{id="7002CA01",name="Limlight Gorge Explorer",cat="Great River",d="The Limlight Gorge has always been a wild and sparsely inhabited area, but since a band of trolls came down from the Misty Mountains, what few inhabitants there were have fled its rocky slopes. Massive creatures now inhabit the Gorge, making travel through the area perilous, and it is said that even the trees themselves sometimes move about, perhaps thanks to some strange magic from the neighbouring forest of Fangorn....",faction="FrP",level=75,minlevel=68,ndx=2772,["next"]={1769,2737},o="Obj 1:\nExplore the Limlight Gorge in Great River.\n* Discover the Limlight Gate-house\n* Discover Limlight Falls\n* Discover the Ent-grove\n* Discover the Fallen Watch-tower\n* Discover the Pothole\n* Discover the Prospector's Shack\n* Discover the Old Sawmill",pois={{name="The Pothole",area="Limlight Gorge",loc={"27.2S, 71.2W"},zone="Great River"},{name="Limlight Gate-house",area="Limlight Gorge",loc={"25.4S, 66.9W"},zone="Great River"},{name="Old Sawmill",area="Limlight Gorge",loc={"28.9S, 69.7W"},zone="Great River"},{name="Limlight Glade",area="Limlight Gorge",loc={"29.4S, 72W"},zone="Great River"},{name="The Fallen Tower",area="Limlight Gorge",loc={"28.1S, 68.6W"},zone="Great River"},{name="Limlight Falls",area="Limlight Gorge",loc={"28.4S, 72.3W"},zone="Great River"},{name="Prospector's Shack",area="Limlight Gorge",loc={"27S, 69.8W"},zone="Great River"}},r={lp={{val=5}},rc={{id="7002B017",q=30,val="Mark"}},ri={{val="+500 with Heroes of Limlight Gorge"}},ti={{val="Explorer of the Limlight Gorge"}},vx={{val=2000}}},t="Explorer",zone="Great River"},
{id="7000970F",name="Limrafn-slayer",c={"Limrafn can be found throughout the Barandalf and Men Erain areas. Limrafn only come out at night."},cat="Evendim",d="The Limrafn are a lesser, weaker form of fell spirit. What draws them to Evendim in such numbers, not even the Elves can say.",faction="FrP",level=31,minlevel=20,ndx=2773,["next"]={2774},o="Obj 1:\n* Defeat Limrafn in Evendim",r={lp={{val=5}},ri={{val="+500 with The Wardens of Annúminas"}},ti={{val="Keeper of Mysteries"}}},t="Slayer",zone="Evendim"},
{id="70009710",name="Limrafn-slayer (Advanced)",c={"Limrafn can be found throughout the Barandalf and Men Erain areas. Limrafn only come out at night."},cat="Evendim",d="You have seen many of these strange lights in Evendim lately -- they seem almost to be multiplying with the presence of Men and other forces. Is it possible that these strange entities are being awakened or attracted by the skirmishes being fought in this land, which was once nearly desolate and empty?",faction="FrP",level=31,minlevel=20,ndx=2774,["next"]={3741},o="Obj 1:\n* Complete 'Limrafn-slayer'\nObj 2:\n* Defeat Limrafn in Evendim",prev={2773},r={lp={{val=10}},rc={{id="7002B017",q=30,val="Mark"}},ri={{val="+700 with The Wardens of Annúminas"}},vx={{val=2000}}},t="Slayer",zone="Evendim"},
