{id="700001DA",name="Lore of the Blade",area="Rivendell Valley",cat="Class",class="Lore-master",d="The first four pages of this book can be found on enemies scattered across Angmar, Eregion, and Moria. The last four pages of this book can be found on enemies scattered across Forochel, Moria, and the Misty Mountains.\nLore of the Blade seems to be a rather unusual tome for a Lore-master to express interest in. Rather than delving deeply into the hidden mysteries of mountains, or discussing at length the habits of wave and wind, it reads more like a rousing tale of adventure written to entertain hobbit-children. The pages of Lore of the Blade claim to follow the adventures of a brave young Lore-master who when confronted with deadly dangers is just as apt to fight her way through with flashing sword-play as to confound her opponents with the lore of the elements or the wisdom of long forgotten sages. Oddly, as you find yourself drawn into the stirring tale you begin to see the more subtle nuances of the story unfold through the eyes of its character, who displays an uncanny insight into the nature of the foes she faces, and an understanding of when the strength of arms applied at the correct moment may indeed be the least destructive course.\nUnfortunately, some prior reader has handled this copy rather poorly and some of the pages are torn beyond repair. The author also proves to be a bit difficult to pin down, as he has chosen to identify himself solely by the runic letter 'G' inscribed on the binding.",faction="FrP",level=44,minlevel=39,ndx=2786,o="Obj 1:\n* Collect Lore of the Blade\nObj 2:\n* Talk to Gandalf in Rivendell\nObj 3:\n* Lore of the Blade, page 5\n* Lore of the Blade, page 11\n* Lore of the Blade, page 18\n* Lore of the Blade, page 26\n* Lore of the Blade, page 35\n* Lore of the Blade, page 45\n* Lore of the Blade, page 56\n* Lore of the Blade, page 68",pois={{name="Gandalf",area="Rivendell Valley",dungeon="Bilbo's Room",loc={"66.7N, 50.8E"},zone="The Trollshaws"}},r={lp={{val=10}}},t="Class",zone="The Trollshaws"},
