{id="7004EA6E",name="Lost Lore of the Dwarf-holds: Thikil-gundu",cat="The Grey Mountains",d="Built by the dwarves and stolen by dragons, Thikil-gundu, the Steel Keep, has borne witness to a tragic and terrible history.",faction="FrP",level=115,minlevel=115,ndx=2796,["next"]={3427},o="Obj 1:\n* Discover and compile the lost lore of Thikil-gundu",r={rc={{id="70050D18",val="Lost Lore: Karazgar"},{id="7005067D",val="Copy of Lost Lore: Thikil-gundu"},{id="7004E31F",q=5,val="Mark of the Longbeards"}}},t="Lore"},
{id="700256BB",name="Lost Temple: Clean Sweep",area="Nan Tornaeth",cat="In Their Absence",d="Beneath the lost Rhudaur temple in the Trollshaws, the Gaunt-lord Ferndúr creates a deadly plague to decimate the people of the north.\nYou must destroy all the infected corpses in his chamber before destroying the Gaunt-lord himself to ensure that his plague is completely eliminated.",faction="FrP",level=65,minlevel=60,ndx=2797,["next"]={2744,746},o="Obj 1:\nDiscover the entrance to the Lost Temple\n* Complete 'Discovery: Lost Temple'\nObj 2:\nTo earn this deed, you must destroy all the corpses in Ferndúr's chamber before defeating the Gaunt-lord himself.\n* Destroy all the corpses in Ferndúr's chamber, then defeat Ferndúr",prev={1297},r={lp={{val=15}},rc={{id="7002B018",q=30,val="Medallion"}},ti={{val="Solace for the Dead"}}},t="Slayer",zone="The Trollshaws"},
{id="7002558A",name="Lost Temple: Ferndúr's Defeat",cat="In Their Absence",d="Beneath the lost Rhudaran temple in the Trollshaws, the Gaunt-lord Ferndúr creates a deadly plague to decimate the people of the north.\nYou must defeat him before it can be unleashed.",faction="FrP",level=65,minlevel=60,mobs={{name="Ferndúr the Virulent",area="Nan Tornaeth",dungeon="Lost Temple",loc={"14N, 51.7E"},zone="The Trollshaws"}},ndx=2798,["next"]={746},o="Obj 1:\nDiscover the entrance to the Lost Temple\n* Complete 'Discovery: Lost Temple'\nObj 2:\nTo earn this deed, you must defeat Ferndúr the Virulent.\n* Defeat Ferndúr the Virulent",prev={1297},r={lp={{val=15}},ti={{val="Bane of the Plague Lord"}}},t="Slayer"},
{id="700256AA",name="Lost Temple: One Ill Turn....",cat="In Their Absence",d="The grounds of the Lost Temple are being desecrated by mercenaries working for Ferndúr the Virulent.\nThe illness the mercenaries have contracted will soon be the end of them, but it would be best if you defeat them and ensure a quick and painless end to their suffering before they spread this dangerous illness beyond the temple's bounds.",faction="FrP",level=65,minlevel=60,ndx=2799,["next"]={746},o="Obj 1:\nDiscover the entrance to the Lost Temple\n* Complete 'Discovery: Lost Temple'\nObj 2:\nTo earn this deed you must defeat many of the sellswords who are attempting to loot the Lost Temple.\n* Defeat brigands in the Lost Temple",prev={1297},r={lp={{val=15}},ti={{val="Soother of Misery"}}},t="Slayer"},
{id="700256BD",name="Lost Temple: Synchronized Slaughter",cat="In Their Absence",d="The entrance to the crypts beneath the Lost Temple is guarded by a pair of powerful Angmarim. Brother and sister, Angaidh and Sidhág complement each other in battle, wielding both spell and blade with dark power.\nTo earn this deed, both siblings must fall within ten seconds of each other.",faction="FrP",level=65,minlevel=60,ndx=2800,["next"]={746},o="Obj 1:\nDiscover the entrance to the Lost Temple\n* Complete 'Discovery: Lost Temple'\nObj 2:\nTo earn this deed, you must defeat Angaidh and Sidhág within 10 seconds of each other.\n* Defeat Angaidh and Sidhág within ten seconds of each other",prev={1297},r={lp={{val=15}},rc={{id="7002B018",q=20,val="Medallion"}},ti={{val="Swift Executioner"}}},t="Slayer",zone="The Trollshaws"},
{id="700256BC",name="Lost Temple: The Sick and the Dead",cat="In Their Absence",d="The sellswords foolish enough to follow Ferndúr into the depths of the Lost Temple have succumbed to disease or have been slaughtered by the Gaunt-lord himself. Now spirits of plague have possessed their corpses and stalk the crypts, preparing to unleash pestilence and death upon the North.\nYou must destroy as many of them as you can before they escape to spread Ferndúr's deadly plague.",faction="FrP",level=65,minlevel=60,ndx=2801,["next"]={746},o="Obj 1:\nDiscover the entrance to the Lost Temple\n* Complete 'Discovery: Lost Temple'\nObj 2:\nTo earn this deed, you must defeat many of the wights who stalk the crypts beneath the Lost Temple.\n* Defeat wights within the crypts of the Lost Temple",prev={1297},r={lp={{val=15}},ti={{val="Purge of the Infestation"}}},t="Slayer"},
