{id="7005CC08",name="Martial Movement",area="Bree",cat="Class",class="Brawler",d="The first four pages of this book can be found on enemies scattered across Angmar, Eregion, and Moria. The last four pages of this book can be found on enemies scattered across Forochel, Moria, and the Misty Mountains.\nMartial Movement was written by Brom Hawksbeard, a brawler from Bree-land.",faction="FrP",level=46,minlevel=39,ndx=2838,o="Obj 1:\n* Collect Martial Movement\nObj 2:\nYou already know how to move; you have been doing it all your life. Brom had better be able to justify your purchase, or you will show him just how well you can move, to his peril!\n* Demand an explanation from Brom\nObj 3:\nCollect the missing pages of 'Martial Movement' and add them to the book.\n* Martial Movement, Page 27\n* Martial Movement, Page 33\n* Martial Movement, Page 34\n* Martial Movement, Page 35\n* Martial Movement, Page 36\n* Martial Movement, Page 52\n* Martial Movement, Page 56\n* Martial Movement, Page 58",pois={{name="Brom Hawksbeard",area="Bree",dungeon="Bree-town Jail",loc={"50.1S, 53.8E"},zone="Bree-land"}},r={lp={{val=10}},rc={{id="700036FE",q=5,val="Green Dragon's Breath Ale"}}},t="Class",zone="Bree-land"},
