{id="7000B2CD",name="Master of Beasts",c={"* 20.52S, 103.23W - Entrance to Sarnúr"},cat="Ered Luin",d="Many wild beasts stalk the ruins of Sarnúr, but these creatures have been enslaved or twisted to the will of Angmar through the cunning devices of the goblins, who breed and cruelly torment them. Many now act as spies and guards for the Dourhands and must be destroyed, lest they be unleashed into the lands of Ered Luin to wreak mischief and havoc upon its peoples.",faction="FrP",level=46,minlevel=40,ndx=2845,["next"]={2847},o="Obj 1:\n* Defeat beasts in Sarnúr",r={lp={{val=5}},ri={{val="+700 with Thorin's Hall"}},ti={{val="Master of Beasts"}}},t="Slayer",zone="Ered Luin"},
