{id="70016ABA",name="Morroval-slayer",c={"The best place to find merrevail in Moria is the eastern region off Durin's Way."},cat="Moria",d="The merrevail of Angmar are wretched creatures, corrupted beyond recall. They rejoice only in gloom and misery and seek always to destroy all that is light. Even the oppressing dark of Moria is not enough to quench their thirst for blackness and despair.",faction="FrP",level=55,minlevel=47,ndx=2922,["next"]={2923},o="Obj 1:\n* Defeat merrevail in Moria",r={lp={{val=5}},ri={{val="+500 with Iron Garrison Guards"}},ti={{val="Wing-breaker"}}},t="Slayer",zone="Moria"},
{id="70016ABB",name="Morroval-slayer (Advanced)",c={"The best place to find merrevail in Moria is the eastern region off Durin's Way."},cat="Moria",d="The wretched bat-creatures are much put upon to withstand valour such as yours, for you have defeated many merrevail thus far. The tunnels have been lit by the hewing of such dark and fell beings.",faction="FrP",level=55,minlevel=47,ndx=2923,["next"]={4712},o="Obj 1:\n* Complete 'Morroval-slayer'\nObj 2:\n* Defeat merrevail in Moria",prev={2922},r={lp={{val=10}},rc={{id="7005D8A0",val="Enhancement Runes, Incomparable"}},ri={{val="+700 with Iron Garrison Miners"}},vx={{val=4000}}},t="Slayer",zone="Moria"},
