{id="7006D70D",name="Nâkhugir's Bane",area="Fields of Duragâr",cat="The Legacy of Morgoth",d="We have discovered a dangerous cult of usan-kûni worshippers hiding in our own back-yard. They call themselves Anâkhi, and have made their home inside Ashunûg, a salt mine in northern Ambarûl that has long been abandoned. We are only recently freed of Sauron, the All-seeing, and must not allow this new cult to take hold. The Anâkhi scorpion worshippers must be driven from our lands.",faction="FrP",level=150,minlevel=150,ndx=2981,o="Obj 2:\n* Complete 'Ashunûg, the Fane of the Accursed -- Tier 1'\n* Complete 'Ashunûg, the Fane of the Accursed -- Tier 2'\n* Complete 'Ashunûg, the Fane of the Accursed -- Tier 3'\n* Complete 'Ashunûg, the Fane of the Accursed -- Anâkhi'",prev={358,359,360,361},r={rc={{id="7006B23F",q=5,val="Shagâni Ghín"}},ti={{val="Nâkhugir's Bane"}},vx={{val=1000}},xp={{val=344000}}},t="Slayer",zone="Ambarûl"},
