{id="700166D7",name="Orc-slayer",cat="Moria",d="Vast Moria has been long abandoned by the dwarves, but for years uncounted the Orcs have infested its darkened tunnels. They have looted the ancient city of its riches and constructed their own great warrens in and beneath the works of the dwarves.",faction="FrP",level=55,minlevel=47,ndx=3052,["next"]={3059},o="Obj 1:\n* Defeat Orcs in Moria",r={lp={{val=5}},ri={{val="+500 with Iron Garrison Guards"}},ti={{val="Orc-foe"}}},t="Slayer",zone="Moria"},
{id="70019799",name="Orc-slayer",c={"There are a couple of Orc-camps in Lothlórien:\n* Uruk-gashan [12.7S, 77.5W], southeast from Mekhem-bizru.\n* Drû-garmoth [14.1S, 78.0W], southwest from Uruk-gashan.\n* Fanuidhol, west from Cerin Amroth.\nDuring the repeatable quests for The Defence of Lórien, you will encounter lot's of Orcs, so it's not necessary to farm them at the above locations."},cat="Lothlórien",d="The Orcs of Moria have poured out of the Misty Mountains into the Dimrill Dale and Fanuidhol. It will take a brave heart to drive them back.",faction="FrP",level=58,minlevel=1,ndx=3053,["next"]={3060},o="Obj 1:\n* Defeat Orcs in the Dimrill Dale and Fanuidhol",r={lp={{val=5}},ri={{val="+500 with Galadhrim"}},ti={{val="Champion of Lothlórien"}}},t="Slayer",zone="Lothlórien"},
