{id="70026602",name="Ost Dunhoth: Champion of the Fortress of the Western Host",area="Lich Bluffs",cat="In Their Absence",d="Defeating and cleansing the evils that have corrupted the halls of Ost Dunhoth will require a truly heroic effort. The ancient fortress was once a bastion of the Free Peoples, will you see to it that it will it be again one day?",faction="FrP",level=65,minlevel=65,ndx=3130,["next"]={2478},o="Obj 1:\nEnter Ost Dunhoth\nObj 2:\nDefeating and cleansing the evils that have corrupted the halls of Ost Dunhoth will require a truly heroic effort. The ancient fortress was once a bastion of the Free Peoples, will you see to it that it will it be again one day?\n* Complete The Fall of Gortheron Deed -- Tier 1\n* Complete The Fall of Gortheron Deed -- Tier 2\n* Complete the Leader of the Pack Deed\n* Complete the Face Your Fears Deed\n* Complete the Toes in the Water Deed\n* Complete the Sticky Sap Deed\n* Complete the Corrupted Champions Deed\n* Complete The Power of Gortheron Deed",prev={3131,3132,3135,3140,3141,3142,3143,3144},r={rc={{id="700268D0",val="Memorial of the Gaunt-lords"},{id="7002B018",q=50,val="Medallion"}}},t="Lore",zone="Enedwaith"},
{id="700265FE",name="Ost Dunhoth: Corrupted Champions",area="Lich Bluffs",cat="In Their Absence",d="Those most loyal to Ivar have been granted exceptional protections. A true hero will tackle this adversity, not avoid it.\n<rgb=#FF0000>This deed can only be completed on Tier 2 difficulty.</rgb>",faction="FrP",level=65,minlevel=65,ndx=3131,["next"]={2744,3130},o="Obj 1:\nEnter Ost Dunhoth.\nObj 2:\nThose most loyal to Ivar have been granted exceptional protections. A true hero will tackle this adversity, not avoid it.\n* Defeat Ivar's Champions without removing any corruptions",r={rc={{id="7002B018",q=20,val="Medallion"}}},t="Lore",zone="Enedwaith"},
{id="700265FD",name="Ost Dunhoth: Face Your Fears",area="Lich Bluffs",cat="In Their Absence",d="True heroes of Middle-earth never turn their backs, regardless of the terrors they are faced with.\n<rgb=#FF0000>This deed can only be completed on Tier 2 difficulty.</rgb>",faction="FrP",level=65,minlevel=65,ndx=3132,["next"]={2744,3130},o="Obj 1:\nEnter Ost Dunhoth.\nObj 2:\nTrue heroes of Middle-earth never turn their backs, regardless of the terrors they are faced with.\n* Overcome the manifestations of fears without anyone turning their backs",r={rc={{id="7002B018",q=20,val="Medallion"}}},t="Lore",zone="Enedwaith"},
{id="700265F5",name="Ost Dunhoth: Ivar and Gortheron -- Tier 1",area="Lich Bluffs",cat="In Their Absence",d="The final wing of Ost Dunhoth is home to Ivar and Gortheron. Can you defeat them and stop the Gaunt-lords?",faction="FrP",level=65,minlevel=65,ndx=3133,["next"]={3141},o="Obj 1:\nEnter Ost Dunhoth.\nObj 2:\nThe final wing of Ost Dunhoth is home to Ivar and Gortheron. Can you defeat them and stop the Gaunt-lords?\n* Defeat Ivar\n* Defeat Gortheron",r={rc={{id="7002B018",q=20,val="Medallion"}}},t="Lore",zone="Enedwaith"},
