{id="70024EBD",name="Raining Snowballs",c={"* This deed is available during the Yuletide Festival 2010 at Winter-home in Frostbluff.\n* This is triggered when you first complete a Battle of the Snowballs (Easy) or Battle of the Snowballs (Hard).\n* AFK players in the field or at least close enough for a snowball to be thrown at them is fair game!\n* Caution: If you're the target of many others in a short time, you will get knocked down at the 6th snowball! Here are the effects of each snowball:\nWinter's Chill (Tier 1): -5% Run Speed, +5% All Skill Inductions, 30s\n*  Winter's Chill (Tier 2): -10% Run Speed, +10% All Skill Inductions, 20s\n*  Winter's Chill (Tier 3): -15% Run Speed, +15% All Skill Inductions, 15s\n*  Winter's Chill (Tier 4): -20% Run Speed, +20% All Skill Inductions, 10s\n*  Winter's Chill (Tier 5): -25% Run Speed, +25% All Skill Inductions, 5s\n*  Knocked Down: Knocked to the ground and cannot move or act, 3s"},cat="Race & Social",d="Win the snowball-fight many times.",faction="FrP",level=1,minlevel=1,ndx=3388,o="Obj 1:\nWin the snowball-fight many times.\n* Win the snowball-fight (easy)\n* Win the snowball-fight (hard)",r={ti={{val="Snow-beast"}}},t="Event"},
