{id="7004EA70",name="Reclaimer of Thikil-gundu",cat="The Grey Mountains",d="Before the coming of Hrímil Frost-heart and her spawn, Vethúg Wintermind, the Steel Keep was home to both the Longbeards and Zhélruka over the course of many long years. In the wake of Vethúg's defeat at Erebor, Nori set forth with a small company to reclaim the lost hoards of Thikil-gundu. However, great wealth is not all that remains hidden in its frozen halls, and the Dwarves of the North shall soon have to contend with the true master of Thikil-gundu if what was lost might still be reclaimed.",faction="FrP",level=120,minlevel=115,ndx=3427,o="Obj 1:\nBefore the coming of Hrímil Frost-heart and her spawn, Vethúg Wintermind, the Steel Keep was home to both the Longbeards and Zhélruka over the course of many long years. In the wake of Vethúg's defeat at Erebor, Nori set forth with a small company to reclaim the lost hoards of Thikil-gundu. However, great wealth is not all that remains hidden in its frozen halls, and the Dwarves of the North shall soon have to contend with the true master of Thikil-gundu if what was lost might still be reclaimed.\n* Complete 'Delver of Thikil-gundu'\n* Complete 'Lost Lore of the Dwarf-holds: Thikil-gundu'\n* Complete 'Thikil-gundu, the Steel Keep -- Tier 1'\n* Complete 'Thikil-gundu, the Steel Keep -- Tier 2'\n* Complete 'Thikil-gundu, the Steel Keep -- Tier 3'",prev={1196,2796,4554,4555,4556},r={rc={{id="7004E31F",q=10,val="Mark of the Longbeards"}},ti={{val="Master / Mistress of Steel"}}},t="Lore"},
