{id="70005BC5",name="Restoring the Quick Post",cat="Shire",d="Restore the good name of the Quick Post service.",faction="FrP",level=12,minlevel=1,ndx=3500,["next"]={1138},o="Obj 1:\nThe Quick Post service is responsible for more than a dozen mail routes throughout the Shire. If its good name is to be restored, you will need to help deliver mail at each of its routes.\n* Service Little Delving to Michel Delving Route\n* Service Michel Delving to Waymeet Route\n* Service Waymeet to Needlehole Route\n* Service Needlehole to Michel Delving Route\n* Service Michel Delving to Tuckborough Route\n* Service Tuckborough to Hobbiton Route\n* Service Hobbiton to Overhill Route\n* Service Overhill to Bywater Route\n* Service Frogmorton to Woodhall Route\n* Service Woodhall to Stock Route\n* Service Stock to Budgeford Route\n* Service Budgeford to Scary Route\n* Service Scary to Brockenborings Route\nObj 2:\nPostmaster Proudfoot is in Michel Delving, near the Town Hole.\nThanks to your efforts, the Quick Post has regained its reputation for speedy delivery of the mail. Postmaster Proudfoot will be delighted to hear of all you have done.\n* Speak with Postmaster Proudfoot",pois={{name="Postmaster Proudfoot",area="The Delving Fields",loc={"33.4S, 74.9W"},zone="The Shire"}},r={lp={{val=5}},rc={{id="7002B017",q=30,val="Mark"}},ri={{val="+700 with The Mathom Society"}},vx={{val=2000}}},t="Reputation",zone="The Shire"},
