{id="7002CA09",name="Rushgore Explorer",cat="Great River",d="The marshes of the Rushgore have long been uninhabited... or so the border-guard of Rohan believed. Besides wild beasts, villains of a two-legged variety have recently come....",faction="FrP",level=75,minlevel=68,ndx=3553,["next"]={1769},o="Obj 1:\nDiscover the camps and sites of the Rushgore.\n* Discover Aculf's Camp\n* Discover Atburg\n* Discover Wyrmdenn\n* Discover the Creeping Mud\n* Discover Tik Botokh\n* Discover the Clutch-ground",pois={{name="Aculf's Camp",area="The Rushgore",loc={"29.1S, 55.2W"},zone="Great River"},{name="Atburg",area="The Rushgore",loc={"30.8S, 53.7W","30.8S, 53.8W","30.8S, 53.9W"},zone="Great River"},{name="The Clutch-ground",area="The Rushgore",loc={"29.4S, 52.7W"},zone="Great River"},{name="Wyrmdenn",area="The Rushgore",loc={"27.9S, 54.6W"},zone="Great River"},{name="The Creeping Mud",area="The Rushgore",loc={"28.2S, 51.8W"},zone="Great River"},{name="Tik Botokh",area="The Rushgore",loc={"29.9S, 53.1W"},zone="Great River"}},r={lp={{val=5}},rc={{id="7002B017",q=30,val="Mark"}},ri={{val="+500 with The Riders of Stangard"}},ti={{val="Explorer of the Rushgore"}},vx={{val=2000}}},t="Explorer",zone="Great River"},
{id="7000F0A7",name="Sabre-tooth Slayer",c={"Sabre-tooth can be found in most areas on Forochel, scattered across the landscape. The best place to find them is:\n* Leijona-kotin\n* the path up Pynti-leiri"},cat="Forochel",d="These savage cats are predators of a particularly vicious and undiscerning nature. The Lossoth make sure to respect their territory during the hunt, lest they become a meal for these deadly creatures. Likewise what livestock they raise is under constant threat by these voracious beasts.",faction="FrP",level=45,minlevel=30,ndx=3554,["next"]={3555},o="Obj 1:\n* Defeat sabre-tooths in Forochel",r={lp={{val=5}},ri={{val="+500 with Lossoth of Forochel"}},ti={{val="Fang-breaker"}}},t="Slayer",zone="Forochel"},
{id="7000F0A8",name="Sabre-tooth Slayer (Advanced)",c={"Sabre-tooth can be found in most areas on Forochel, scattered across the landscape. The best place to find them is:\n* Leijona-kotin\n* the path up Pynti-leiri"},cat="Forochel",d="The sabre-tooth cats are a deadly and frequent hazard of the forests of Forochel. Only the bravest hunters amongst the Lossoth will dare to hunt in the vicinity of a Sabertooth den, and even they occasionally fail to return.",faction="FrP",level=45,minlevel=30,ndx=3555,["next"]={3743},o="Obj 1:\n* Complete 'Sabre-tooth Slayer'\nObj 2:\n* Defeat sabre-tooth in Forochel",prev={3554},r={lp={{val=10}},rc={{id="7002B017",q=30,val="Mark"}},ri={{val="+700 with Lossoth of Forochel"}},vx={{val=2000}}},t="Slayer",zone="Forochel"},
{id="700642A1",name="Sagroth, Lair of Vermin -- Slayer of Angmarim",area="Carn Dûm",cat="Return to Carn Dûm",d="Many dangerous creatures have called the sewers of Carn Dûm home. Some have remained rumours, nothing more. Others, however, may be of interest to the scattered remnants of the Iron Crown.",faction="FrP",level=1,minlevel=140,ndx=3556,["next"]={1110},o="Obj 2:\nMany dangerous creatures have called the sewers of Carn Dûm home. Some have remained rumours, nothing more. Others, however, may be of interest to the scattered remnants of the Iron Crown.\n* Defeat Angmarim at Sagroth, Lair of Vermin",r={rc={{id="70063D43",q=3,val="Sárskillin"}},ti={{val="Vanquisher of Sagroth"}},vx={{val=1000}}},t="Slayer",zone="Angmar"},
{id="70064BA2",name="Sagroth, Lair of Vermin -- The Seekers of Sagroth",area="Carn Dûm",cat="Return to Carn Dûm",d="Gárvadach insists there is a prize to be had in the sewers beneath Carn Dûm, but not all who serve him share in this belief, or his apparent willingness to traverse such a foetid place.",faction="FrP",level=1,minlevel=140,ndx=3557,["next"]={1110},o="Obj 2:\nGárvadach insists there is a prize to be had in the sewers beneath Carn Dûm, but not all who serve him share in this belief, or his apparent willingness to traverse such a foetid place.\nYou should find signs left behind by Gárvadach's men.\n* Discover some spongy effluvia\n* Find some footprints\n* Find a particular sticky puddle\n* Find a particular corpse\n* Find a slimy sword",pois={{name="Sticky Puddle",area="Carn Dûm",dungeon="Sagroth",loc={"77.3N, 48.7E"},zone="Angmar"},{name="Spongy Effluvia",area="Carn Dûm",dungeon="Sagroth",loc={"76.6N, 48.9E"},zone="Angmar"},{name="Soldier's Corpse",area="Carn Dûm",dungeon="Sagroth",loc={"77.5N, 48.2E"},zone="Angmar"},{name="Footprints",area="Carn Dûm",dungeon="Sagroth",loc={"76.6N, 48.6E"},zone="Angmar"},{name="Slimy Sword",area="Carn Dûm",dungeon="Sagroth",loc={"76.4N, 49.1E"},zone="Angmar"}},r={rc={{id="70063D43",q=3,val="Sárskillin"}},ti={{val="Yarn Collector"}},vx={{val=1000}}},t="Lore",zone="Angmar"},
