{id="70009719",name="Salamander-slayer",c={"The island Tyl Ruinen west of Tinnudir, is the best place to find salamanders."},cat="Evendim",d="The Salamanders of Evendim have always been a rare sight. This odd offshoot of the family of dragons has a strong affinity for fire, which it wields with abandon against any enemy that disturbs it.",faction="FrP",level=31,minlevel=20,ndx=3562,["next"]={3563},o="Obj 1:\n* Defeat Salamanders in Evendim",r={lp={{val=5}},ri={{val="+500 with The Wardens of Annúminas"}},ti={{val="Quencher of Flames"}}},t="Slayer",zone="Evendim"},
{id="7000971A",name="Salamander-slayer (Advanced)",c={"The island Tyl Ruinen west of Tinnudir, is the best place to find salamanders."},cat="Evendim",d="Oddly, Salamanders are frequently found near bodies of water such as rivers or lakes -- though they may also be found in wet marshes or sandy deserts. Scholars believe this may be because of the creature's tendency to burn away all nearby vegetation, thus rendering an area uninhabitable unless bodies of water or otherwise fire-proof terrain serves to constrain the fires they so frequently set.",faction="FrP",level=31,minlevel=20,ndx=3563,["next"]={3741},o="Obj 1:\n* Complete 'Salamander-slayer'\nObj 2:\n* Defeat Salamanders in Evendim",prev={3562},r={lp={{val=10}},rc={{id="7002B017",q=30,val="Mark"}},ri={{val="+700 with The Wardens of Annúminas"}},vx={{val=2000}}},t="Slayer",zone="Evendim"},
