{id="70064044",name="Sant Lhoer, the Poison Gardens -- Tier 1",cat="Return to Carn Dûm",d="Sant Lhoer, known as the Poison Gardens of Carn Dûm, is a dank place teeming with deadly plants, trees, and flowers, the likes of which have rarely or never been seen before in Middle-earth. Beyond the foetid, beryl-green waters which flow through Sant Lhoer, rise immense glass structures, including Bâr Heledh, the Glass House. It is here that the sorceress Oganuin plies her craft, experimenting upon creatures, plants, and people alike. To what end, and for what purpose? One can only assume the darkest of designs.",faction="FrP",level=1,minlevel=140,ndx=3566,["next"]={1111},o="Obj 2:\n* Complete Sant Lhoer, the Poison Gardens -- Tier 1",r={rc={{id="70063D43",q=3,val="Sárskillin"}},ti={{val="Bâr Heledh's Bane"}},vx={{val=1000}}},t="Slayer"},
