{id="70061F8B",name="Sarch Vorn, the Black Grave -- Slayer of the Barrow-wights",cat="Shadows of Angmar",d="Unbeknownst to the Men of Cardolan, Sarch Vorn, an ancient temple of the Edain, has long served as the resting place of a malevolent spirit of the Elder Days known only as Hithrengor, the Grey Fear. Roused by the return of the Witch-king of Angmar, the Grey Fear has awoken from its slumber to once again spread terror and death across the ravaged lands of Cardolan.",faction="FrP",level=1,minlevel=20,ndx=3570,["next"]={1112},o="Obj 2:\nUnbeknownst to the Men of Cardolan, Sarch Vorn, an ancient temple of the Edain, has long served as the resting place of a malevolent spirit of the Elder Days known only as Hithrengor, the Grey Fear. Roused by the return of the Witch-king of Angmar, the Grey Fear has awoken from its slumber to once again spread terror and death across the ravaged lands of Cardolan.\n* Defeat Barrow-wights at Sarch Vorn, the Black Grave",r={rc={{id="70061B80",q=5,val="Iron Coin of Cardolan"}},ti={{val="Keeper of the Dead"}},vx={{val=2000}}},t="Slayer",zone="Cardolan"},
