{id="7002BDF7",name="Save the Trees",cat="Rise of Isengard",d="The Huorns of Fangorn are special creatures. They hold no hate in their heart and must be saved. Save them from the Orcs and their axes!",faction="FrP",level=75,minlevel=75,ndx=3575,o="Obj 1:\nTo earn this deed, you must save all eight Huorns in the Fangorn's Edge instance without letting any die.\nObj 2:\nTo earn this deed, you must save all eight Huorns in the Fangorn's Edge instance without letting any die.\n* Save all eight Huorns in one run",r={lp={{val=5}},rc={{id="7002B018",q=20,val="Medallion"}}},t="Lore"},
{id="7001E964",name="Saviour of Eriador",cat="Shadows of Angmar",d="The Dúnedain have asked many things of you. Complete all of these tasks, and you will be rewarded greatly.",faction="FrP",level=60,minlevel=50,ndx=3576,o="Obj 1:\n* Complete all of the Carn Dûm Deeds\n* Complete all of the Urugarth Deeds\n* Complete all of the Barad Gúlaran Deeds\n* Complete An Ancient Threat\n* Complete Thorog Defeated",prev={1257,1341,4624},r={lp={{val=10}},rc={{id="7001E977",val="Dúnedain Great-steed"}},ti={{val="Saviour of Eriador"}}},t="Lore"},
{id="7001E965",name="Saviour of Khazad-dûm",cat="Mines of Moria",d="The Iron Garrison seeks to reclaim the Black Pit of Moria as their own, but many believe their expedition into the ancient halls may be doomed. Do all you can to help them, and you will be named the Saviour of Khazad-dûm.",faction="FrP",level=60,minlevel=55,ndx=3577,o="Obj 1:\n* Complete The Watcher of Moria\n* Complete The Grand Stair\n* Complete Mastery Over Fear\n* Complete Persevering Against the Blight\n* Complete Marshal of the Burning Depths",prev={2837,2874,3175,4248,4532},r={lp={{val=10}},rc={{id="7001E978",val="Nimble Black Goat"}},ti={{val="Saviour of Moria"}}},t="Lore"},
{id="7001E963",name="Saviour of Lothlórien",cat="Scourge of Khazad-dûm",d="The Galadhrim seek to reclaim the balance of nature from those that threaten them in Moria. Do all that the Galadhrim ask and you shall be named the Saviour of Lothlórien",faction="FrP",level=58,minlevel=1,ndx=3578,o="Obj 1:\n* Complete Liberator of the Halls of Crafting\n* Complete Reaver of Dâr Narbugud\n* Complete Light of Lumul-nar\n* Complete Scourge of Nalâ-dûm",prev={2760,2769,3421,3596},r={lp={{val=10}},rc={{id="7001E976",val="Wild Mountain-goat"}},ti={{val="Saviour of Lothlórien"}}},t="Lore"},
{id="7002451A",name="Saviour of Stoneheight",cat="In Their Absence",d="The Gaunt-lord Ivar, aided by a band of sellswords, swept through the village of Stoneheight in his search for his helm. When his goals were reached, he abandoned the village to the mercy of the sellswords.",faction="FrP",level=65,minlevel=65,ndx=3579,["next"]={2478},o="Obj 1:\n* Complete the Oppressors of Stoneheight Deed\n* Complete the Challenger of Stoneheight Deed\n* Complete the Stoneheight Deed",prev={1303,3033,742},r={lp={{val=10}},rc={{id="7002B018",q=20,val="Medallion"}}},t="Slayer"},
{id="70033791",name="Saviour of the Eagle Egg",cat="The Road to Erebor",d="The stone-giant Helf has stolen the egg of a Great Eagle. The egg must be protected from Helf's devious ambitions and returned, undamaged, to the Great Eagles.",faction="FrP",level=85,minlevel=20,ndx=3580,["next"]={744},o="Obj 2:\nYou must protect the egg from Helf's devious ambitions and return it, undamaged, to the possession of the Eagles.\n* Complete the quest: Iorbar's Peak -- Challenge",r={rc={{id="7002B018",q=30,val="Medallion"}}},t="Slayer"},
{id="7002CDBC",name="Saviour of the Roots of Fangorn",cat="Great River",d="Those who would call themselves the Saviour of the Roots of Fangorn must overcome all of the challenges they face within.",faction="FrP",level=75,minlevel=72,ndx=3581,o="Obj 1:\nDNT - you wont see this\n* Complete 'Discovery: Roots of Fangorn'\nObj 2:\nComplete all the Deeds within the Lost Temple.\n* Complete 'Slaves of the Spider Queen'\n* Complete 'Roots of Fangorn: Defeat Gurthul'\n* Complete 'Challenge: Roots of Fangorn -- Green Thumb'",prev={1300,3516,3517},r={lp={{val=15}},rc={{id="7005D8A0",val="Enhancement Runes, Incomparable"}},ri={{val="+1200 with Heroes of Limlight Gorge"}},ti={{val="Waldengard"}}},t="Reputation",zone="Great River"},
