{id="70064047",name="Slayer of Sant Lhoer",cat="Return to Carn Dûm",d="Within Sant Lhoer, the Poison Gardens of Carn Dûm, are creatures and plants like none other in Middle-earth. Twisted by waters turned foetid by the terrible Helchgam, and further corrupted by dark sorceries, these unholy creations threaten to spill forth from the boundaries of Angmar.",faction="FrP",level=1,minlevel=140,ndx=3765,["next"]={1111},o="Obj 2:\nThe terrible creatures who lurk within Sant Lhoer and Bâr Heledh must not be allowed to freely walk outside of the venomous gardens and glass houses of Carn Dûm. You should defeat as many of these foes as possible.\n* Defeat enemies in Sant Lhoer, the Poison Gardens",r={rc={{id="70063D43",q=3,val="Sárskillin"}},ti={{val="Harvester of Sant Lhoer"}},vx={{val=1000}}},t="Slayer"},
