{id="7006438E",name="Slayer of Thaurisgar",area="Carn Dûm",cat="Return to Carn Dûm",d="In the depths of Thaurisgar, countless foul and twisted experiments roam the shadows--the terrible legacy of Aniochán the Harrower. Before the fall of Carn Dûm, Aniochán worked tirelessly to outdo his rivals and win the favour of the Steward of Angmar. Chief among his tools in shaping his fell creations was a curious ichor known only as the Bile of Ifrinn. Thought to be lost after a disastrous experiment claimed Aniochán's life, now this foetid and vile substance is in danger of being let loose into the world.",faction="FrP",level=1,minlevel=140,ndx=3769,["next"]={1116},o="Obj 2:\nThe foul and twisted experiments have afflicted the creatures that roam within Thaurisgar. These vile creatures must not be allowed to run wild. You should defeat as many as you can before that happens.\n* Defeat enemies in the Thaurisgar, the Vile Apothecary",r={rc={{id="70063D43",q=3,val="Sárskillin"}},ti={{val="Vile Bile Purifier"}},vx={{val=1000}}},t="Slayer",zone="Angmar"},
