{id="7004C028",name="Sovereign of Seregost",cat="The Plateau of Gorgoroth",d="Deep within Seregost, Lhaereth the Stained keeps her plague cauldrons. They contain a new, more virulent Great Plague, which she intends to release upon the realms of the Free Peoples. As you and the Rangers Faeron and Rhadrog are the few innoculated to the plague, you must enter the Court of Seregost as a small strike team and attempt to disrupt Lhaereth's plans.",faction="FrP",level=115,minlevel=105,ndx=3831,o="Obj 2:\n* Complete the deed The Court of Seregost -- Tier 1\n* Complete the deed The Court of Seregost -- Tier 2\n* Complete the deed Challenge: Khílnat, the Silent Shade\n* Complete the deed The Court of Seregost: Lost Lore\n* Complete the deed The Court of Seregost: Morroval-slayer\n* Complete the deed The Court of Seregost: Orc-slayer\n* Complete the deed The Court of Seregost: Black Númenórean-slayer",prev={4170,4171,4172,4173,4174,4175,724},r={rc={{id="700487E5",q=5,val="Silver Signet of the Thandrim"},{id="7002B018",q=50,val="Medallion"}},ti={{val="Scourge of Seregost"}},xp={{val=62300}}},t="Slayer",zone="Bree-land"},
