{id="700256D3",name="Thadúr's Plans Foiled",cat="In Their Absence",d="Within the abandoned Northcotton Farm, Thadúr has created a powerful poison known as Darkthorn. Thadúr plans to unleash his poison on the unsuspecting hobbit-folk. You must foil his plans and defeat him before the poison can be unleashed.",faction="FrP",level=65,minlevel=65,mobs={{name="Thadúr the Ravager",area="Northcotton Farm",loc={"37.4N, 73.4W","37.4N, 73.5W","37.8N, 74.3W"},zone="The Shire"},{name="Úmheryn",loc={"22.5S, 13.4W"},zone="Bree-land"},{name="Legbarthil",area="Northcotton Farm",loc={"38.3N, 73.3W"},zone="The Shire"}},ndx=4028,["next"]={747},o="Obj 1:\nTo earn this deed, you must defeat Legbarthil the Spider, Úmheryn the vile cauldron, and Thadúr the Ravager.\nObj 2:\nTo earn this deed, you must defeat Legbarthil the Spider, Úmheryn the vile cauldron, and Thadúr the Ravager.\n* Defeat Legbarthil\n* Destroy Úmheryn\n* Defeat Thadúr",r={lp={{val=15}},rc={{id="7002B018",q=20,val="Medallion"}}},t="Slayer"},
