{id="70064395",name="Thaurisgar Alchemy",cat="Return to Carn Dûm",d="In the depths of Thaurisgar, are remnants of Aniochán the Harrower's foul and twisted experiments. Key among the many tools used to shape his creations was the Bile of Ifrinn. A foetid ichor made by mixing the deadliest of ingredients and substances. Each ingredient carrying with it harmful and undesirable effects. It was in these vile and noxious substances that Aniochán the Harrower found the vile results he aspired to achieve.",faction="FrP",level=1,minlevel=140,ndx=4030,o="Obj 2:\nThe alchemical concoctions of Aniochán the Harrower has resulted in the most foul and twisted of experiments. Working with many ingredients and shrouding them in darkness, he was able to create fell abominations out of his test subjects. From the many experiments came a solvent that would become the catalyst of his most wretched creations, Bile of Ifrinn.\nUsing what remains of his research, find all the ingredients to make Bile of Ifrinn\nFind vile ingredients\n* Use Scythespew\n* Use Adder's Blood\n* Use Wargslather\n* Use Festersweat\n* Use Strickenseep",pois={{name="Scythespew",area="Carn Dûm",dungeon="Thaurisgar, the Vile Apothecary",loc={"77.5N, 45.1E"},zone="Angmar"},{name="Festersweat",area="Carn Dûm",dungeon="Thaurisgar, the Vile Apothecary",loc={"76.2N, 44.9E"},zone="Angmar"},{name="Wargslather",area="Carn Dûm",dungeon="Thaurisgar, the Vile Apothecary",loc={"76.5N, 45.1E"},zone="Angmar"},{name="Adder's Blood",area="Carn Dûm",dungeon="Thaurisgar, the Vile Apothecary",loc={"76.3N, 45.2E"},zone="Angmar"},{name="Strickenseep",area="Carn Dûm",dungeon="Thaurisgar, the Vile Apothecary",loc={"76.6N, 44.9E"},zone="Angmar"}},r={rc={{id="70063D43",q=3,val="Sárskillin"}},ti={{val="the Alchemist's Assistant"}},vx={{val=1000}}},t="Lore"},
{id="70064392",name="Thaurisgar, the Vile Apothecary -- Tier 1",area="Carn Dûm",cat="Return to Carn Dûm",d="In the depths of Thaurisgar, countless foul and twisted experiments roam the shadows--the terrible legacy of Aniochán the Harrower. Before the fall of Carn Dûm, Aniochán worked tirelessly to outdo his rivals and win the favour of the Steward of Angmar. Chief among his tools in shaping his fell creations was a curious ichor known only as the Bile of Ifrinn. Thought to be lost after a disastrous experiment claimed Aniochán's life, now this foetid and vile substance is in danger of being let loose into the world.",faction="FrP",level=1,minlevel=140,ndx=4031,["next"]={1116},o="Obj 2:\n* Complete Thaurisgar, the Vile Apothecary -- Tier 1",r={rc={{id="70063D43",q=3,val="Sárskillin"}},ti={{val="the Cleanser"}},vx={{val=1000}}},t="Slayer",zone="Angmar"},
{id="7006438F",name="Thaurisgar, the Vile Apothecary -- Tier 2",area="Carn Dûm",cat="Return to Carn Dûm",d="In the depths of Thaurisgar, countless foul and twisted experiments roam the shadows--the terrible legacy of Aniochán the Harrower. Before the fall of Carn Dûm, Aniochán worked tirelessly to outdo his rivals and win the favour of the Steward of Angmar. Chief among his tools in shaping his fell creations was a curious ichor known only as the Bile of Ifrinn. Thought to be lost after a disastrous experiment claimed Aniochán's life, now this foetid and vile substance is in danger of being let loose into the world.",faction="FrP",level=1,minlevel=140,ndx=4032,["next"]={1116},o="Obj 2:\n* Complete Thaurisgar, the Vile Apothecary -- Tier 2",r={rc={{id="70063D43",q=3,val="Sárskillin"}},ti={{val="Phial-breaker"}},vx={{val=2000}}},t="Slayer",zone="Angmar"},
