{id="7006438D",name="Thaurisgar, the Vile Apothecary -- Tier 3 -- Leading the Charge",cat="Return to Carn Dûm",d="In the depths of Thaurisgar, countless foul and twisted experiments roam the shadows--the terrible legacy of Aniochán the Harrower. Before the fall of Carn Dûm, Aniochán worked tirelessly to outdo his rivals and win the favour of the Steward of Angmar. Chief among his tools in shaping his fell creations was a curious ichor known only as the Bile of Ifrinn. Thought to be lost after a disastrous experiment claimed Aniochán's life, now this foetid and vile substance is in danger of being let loose into the world.",faction="FrP",level=1,minlevel=140,ndx=4034,o="Obj 1:\n* Complete Thaurisgar, the Vile Apothecary -- Tier 3",r={ti={{val="Led the Charge at Thaurisgar"}}},t="Slayer"},
