{id="7002BEC1",name="The Armies of Isengard",area="Nan Curunír",cat="Rise of Isengard",d="Working with information given you by Andras, the Starkmoor merchant, you have been granted the opportunity to put a thorn in the plans of the Wizard Saruman. Isengard has been all but emptied against the Rohirrim at the Ford of Isen, proferring you the chance to sow chaos among the armies of Isengard.",faction="FrP",level=1,minlevel=75,ndx=4073,o="Obj 2:\n* Complete 'Thorn in the Hand'\n* Complete 'Isengard: The Foundry'\n* Complete 'Isengard: Fangorn's Edge'\n* Complete 'Isengard: The Pits of Isengard'\n* Complete 'Isengard: Dargnákh Unleashed'\n* Complete 'Tower of Orthanc: Destroyer of Rings'",prev={2526,2527,2528,2529,4632},r={rc={{id="7002BE2B",val="Steed of Many Colours"},{id="70050A7A",val="Steed from the White Wizard's Tower"}}},t="Lore",zone="Dunland"},
