{id="700640B7",name="The Art of the Duel",area="Bree",cat="Class",class="Corsair",d="The first four pages of this book can be found on enemies scattered across Angmar, Eregion, and Moria. The last four pages of this book can be found on enemies scattered across Forochel, Moria, and the Misty Mountains.\nThe Art of the Duel was penned by a scholar of Dol Amroth and begins with a prologue in which the author, Pethebir, reveals that he served Prince Imrahil's father as a loyal swan-knight in his youth. It makes careful note of many skills and techniques employed not only by the warriors of Dol Amroth and the other fiefs of Gondor, but also those of the Corsairs of Umbar, with whom they often came into conflict. In addition, it tells the tale of a great captain named Thorongil, who was a skilled warrior, practiced duellist, and trusted counsellor to the former Steward of Gondor, Ecthelion II.",faction="FrP",level=46,minlevel=39,ndx=4077,o="Obj 1:\n* Collect The Art of the Duel\nObj 2:\n* Talk to Mick Maidenhair in the Dwarrow-ward, in Bree-town\nObj 3:\n* The Art of the Duel, Page 25\n* The Art of the Duel, Page 29\n* The Art of the Duel, Page 34\n* The Art of the Duel, Page 39\n* The Art of the Duel, Page 42\n* The Art of the Duel, Page 45\n* The Art of the Duel, Page 51\n* The Art of the Duel, Page 53",pois={{name="Mick Maidenhair",area="Bree",loc={"31.4S, 51.5W"},zone="Bree-land"}},r={lp={{val=10}},rc={{id="70067D9B",val="Duellist's Defender"}}},t="Class",zone="Bree-land"},
{id="7005CC14",name="The Art of the Perfect Punch",area="Bree",cat="Class",class="Brawler",d="The first four pages of this book can be found on enemies scattered across Angmar, Eregion, and Moria. The last four pages of this book can be found on enemies scattered across Forochel, Moria, and the Misty Mountains.\nThe Art of the Perfect Punch was written by Brom Hawksbeard, a brawler from Bree-land.\nMany of the pages in the middle of the book have gone missing.",faction="FrP",level=42,minlevel=39,ndx=4078,o="Obj 1:\n* Collect The Art of the Perfect Punch\nObj 2:\nPerhaps Brom Hawksbeard can explain why this book you purchased is incomplete.\n* Express your dissatisfaction to Brom Hawksbeard in Bree Jail\nObj 3:\nYou should search for missing pages from The Art of the Perfect Punch throughout Angmar and the Misty Mountains.\n* The Art of the Perfect Punch, Page 6\n* The Art of the Perfect Punch, Page 7\n* The Art of the Perfect Punch, Page 15\n* The Art of the Perfect Punch, Page 19\n* The Art of the Perfect Punch, Page 22\n* The Art of the Perfect Punch, Page 23\n* The Art of the Perfect Punch, Page 24\n* The Art of the Perfect Punch, Page 49",pois={{name="Brom Hawksbeard",area="Bree",dungeon="Bree-town Jail",loc={"50.1S, 53.8E"},zone="Bree-land"}},r={lp={{val=10}},rc={{id="7000065F",q=5,val="Frothy Pint of Ale"}}},t="Class",zone="Bree-land"},
{id="70002D81",name="The Artisan Blade",area="Rivendell Valley",cat="Class",class="Champion",d="The first four pages of this book can be found on enemies scattered across Angmar, Eregion, and Moria. The last four pages of this book can be found on enemies scattered across Forochel, Moria, and the Misty Mountains.\nGiven the title, you half expected that this book would have been written by an Elf -- and indeed the script is Sindarin -- but it seems that the author is a champion of some ancient Númenórean lineage from a time before the founding of Arnor. The text is so ancient that some of the pages threaten to crumble in your hands as you carefully peruse it. While the dialect is ancient and difficult to read, the author's approach to swordsmanship is rather unusual, placing a great deal of emphasis on grueling repetition and concentration around what appear to be the most basic motions of the form. It suggests a focus on absolute control and power, which then leads to the discovery of finesse and artistry.\nIf only several key passages and pages were not missing, it could be an invaluable training guide -- perhaps Gimli the Dwarf could tell you more?",faction="FrP",level=46,minlevel=39,ndx=4079,o="Obj 1:\n* Collect The Artisan Blade\nObj 2:\n* Talk to Gimli in Rivendell\nObj 3:\n* The Artisan Blade, page 2\n* The Artisan Blade, page 4\n* The Artisan Blade, page 6\n* The Artisan Blade, page 9\n* The Artisan Blade, page 14\n* The Artisan Blade, page 15\n* The Artisan Blade, page 17\n* The Artisan Blade, page 26",pois={{name="Gimli",area="Rivendell Valley",dungeon="Guest Rooms",loc={"66.8N, 51.6E"},zone="The Trollshaws"}},r={lp={{val=10}}},t="Class",zone="The Trollshaws"},
{id="7003E22B",name="The Bard",cat="Race & Social",d="You have earned the title of the Bard by performing all three roles in the Yule Festival play, having suffered defeat and glory in being the Laughing-stock and Star of the Show, and having furthered the arts by critiquing the performances of others.",faction="FrP",level=1,minlevel=1,ndx=4080,o="Obj 1:\nYou have earned the title of the Bard by performing all three roles in the Yule Festival play, having suffered defeat and glory in being the Laughing-stock and Star of the Show, and having furthered the arts by critiquing the performances of others.\n* Perform the Villian's role in the Yule Festival play\n* Perform the Protagonist's role in the Yule Festival play\n* Perform the Extra's role in the Yule Festival play\n* Earn the title Laughing-stock\n* Earn the title Star of the Show\n* Complete Frostbluff Flower-petals -- Tier 3\n* Complete Frostbluff Rotten Fruit -- Tier 3",prev={1797,2105,2108,2682,3212,3886,4841},r={lp={{val=5}},ti={{val="the Bard"}}},t="Event"},
{id="70005BB6",name="The Barrow-downs",cat="Bree-land",d="The Barrow-downs are south-west of Bree-town. For many generations the Dúnedain of Cardolan buried their dead within the Downs, until the Great Plague destroyed the last vestiges of Cardolan, and spirits from Angmar claimed the barrows. Now only the most brave -- or most foolhardy -- dare venture therein.",faction="FrP",level=15,minlevel=10,ndx=4081,["next"]={1721},o="Obj 1:\nExplore the Barrow Downs.\n* Discover Northern Barrows\n* Discover The Dead Spire\n* Discover The Dead Man's Perch\n* Discover The Great Barrow\n* Discover Ost Gorthad",pois={{name="Northern Barrows",area="Northern Barrow-downs",loc={"30.3S, 55.9W","30.3S, 56W"},zone="Bree-land"},{name="The Dead Spire",area="Northern Barrow-downs",loc={"32S, 55.1W"},zone="Bree-land"},{name="The Great Barrow",area="Southern Barrow-downs",loc={"33.8S, 55.8W"},zone="Bree-land"},{name="Ost Gorthad",area="Southern Barrow-downs",loc={"35.5S, 53.8W","35.9S, 53.8W"},zone="Bree-land"},{name="The Dead Man's Perch",area="Southern Bree-fields",loc={"32.1S, 53.8W","32.2S, 53.6W"},zone="Bree-land"}},r={lp={{val=5}},rc={{id="7002B017",q=30,val="Mark"}},ri={{val="+500 with Men of Bree"}},vx={{val=2000}}},t="Explorer",zone="Bree-land"},
