{id="70002EB7",name="The Best Defence",area="Rivendell Valley",cat="Class",class="Guardian",d="The first four pages of this book can be found on enemies scattered across Angmar, Eregion, and Moria. The last four pages of this book can be found on enemies scattered across Forochel, Moria, and the Misty Mountains.\nThis book was written as a primer in the Guardian's art some time in the middle of the Third Age, during the difficult period after the fall of Khazad-dûm. At that time, Durin's Folk were scattered and greatly reduced in number, and the Guardian's role took on a much greater importance as the threat of goblins and Orcs to dwarf-settlements beneath the roots of the world became more and more common. The dwarves often settled for building powerful strongholds designed to make the approach to their cities, impervious to assault, manning them with skilled and powerful guardians to ensure that none would pass unchallenged.\nWhile the book itself is common enough, the owner of this copy seems to have scribbled copious notes within the margins of the pages -- notes containing an experience and insight to the art that even at a glance exceeds that of the original author. Unfortunately, the copy is worn and tattered, and a number of pages are missing. Perhaps someone well-versed in the art could provide you with some insight as to the identity of the mysterious scribbler and where his remaining notes could be found?",faction="FrP",level=42,minlevel=39,ndx=4102,o="Obj 1:\n* Collect The Best Defence\nObj 2:\nWhile the book itself is common enough, the owner of this copy seems to have scribbled copious note within the margins of the pages - notes containing an experience and insight to the art that even at a glance exceeds that of the original author. Unfortunately the copy is worn and battered, and a number of pages are missing. Perhaps someone well versed in the art could provide you with some insight as to the identity of the mysterious scribbler and where his remaining notes could be found?\n* Talk to Samwise Gamgee in Rivendell\nObj 3:\nThe dwarves who carried with them the copy of The Best Defence which you found were scattered as they journeyed northward. It may be that some of the pages fell amidst the high crags of the Misty Mountains or perhaps were taken into Angmar by the Witch-king's minions.\n* The Best Defence, page 2\n* The Best Defence, page 3\n* The Best Defence, page 5\n* The Best Defence, page 9\n* The Best Defence, page 12\n* The Best Defence, page 16\n* The Best Defence, page 17\n* The Best Defence, page 19",pois={{name="Samwise Gamgee",area="Rivendell Valley",dungeon="Bilbo's Room",loc={"66.8N, 50.7E"},zone="The Trollshaws"}},r={lp={{val=10}}},t="Class",zone="The Trollshaws"},
