{id="70016472",name="The Boiling Rage",cat="Class",class="Champion",d="You have heard it whispered that the libraries of Moria yet contain many tomes, while many other volumes were brought by the dwarves seeking to reclaim Moria. One such tome in the libraries of the Iron Garrison is said to be the legendary \\qThe Boiling Rage.\\q If you can gain enough favour with the Iron Garrison Guards, they may let you have their copy of this book.",faction="FrP",level=60,minlevel=58,ndx=4108,o="Obj 1:\n* Achieve level 58\nObj 2:\n* Read the book, \"The Boiling Rage\"",r={lp={{val=20}}},t="Class"},
{id="700001DD",name="The Book of Beasts",area="Rivendell Valley",cat="Class",class="Lore-master",d="The first four pages of this book can be found on enemies scattered across Angmar, Eregion, and Moria. The last four pages of this book can be found on enemies scattered across Forochel, Moria, and the Misty Mountains.\nIt is unclear who wrote this book as no author's name is given, but the clarity and wisdom with which it is written only adds further to the mystery of its apparently modest writer. The Book of Beasts speaks at great length of the bonds which may be formed between creatures of the wilds and those among the Free Peoples of Middle-earth who are willing to understand their own true natures. It further claims that the Wise might even learn the tongues of the wild creatures of the world and may coax them to greater feats of bravery and strength than would otherwise be possible for a beast lacking in its own will to strive and accomplish.\nWhomever transcribed this particular copy, alas, does not appear to have been entirely in his right mind. Most of the text is clear, but some few of the pages are written in a hopeless scrawl with no meaning in any language of Elves or Men that you can discern. Indeed, it seems as if the scribe must have been taken with fits of madness during these passages. Perhaps Elrond of Rivendell might be able to tell you more about the mysterious author and help you untangle the riddle of the meaningless passages.",faction="FrP",level=42,minlevel=39,ndx=4109,o="Obj 1:\n* Collect The Book of Beasts\nObj 2:\n* Talk to Elrond at the Last Homely House in Rivendell\nObj 3:\n* The Book of Beasts, page 3\n* The Book of Beasts, page 6\n* The Book of Beasts, page 8\n* The Book of Beasts, page 14\n* The Book of Beasts, page 25\n* The Book of Beasts, page 26\n* The Book of Beasts, page 33\n* The Book of Beasts, page 37",pois={{name="Elrond",area="Rivendell Valley",dungeon="The Last Homely House",loc={"62.8N, 54.1E"},zone="The Trollshaws"}},r={lp={{val=10}}},t="Class",zone="The Trollshaws"},
{id="700001FF",name="The Book of Knives",area="Rivendell Valley",cat="Class",class="Burglar",d="The first four pages of this book can be found on enemies scattered across Angmar, Eregion, and Moria. The last four pages of this book can be found on enemies scattered across Forochel, Moria, and the Misty Mountains.\nThe Book of Knives was written by a burglar of great renown -- she is even said to have retrieved the choicest gem of a hoard from beneath the grasping claw of a sleeping dragon -- but her true name remains unknown and many doubt the veracity of her most outlandish exploits. Nevertheless, she was acknowledged as one of the finest knife-fighters in Middle-earth during her time.\nSadly, The Book of Knives is incomplete; little can be gleaned from its cryptic writings. The famous burglar Bilbo Baggins is known for his love of riddles and mysteries -- perhaps he might be able to shed some light on this text.",faction="FrP",level=42,minlevel=39,ndx=4110,o="Obj 1:\n* Collect The Book of Knives\nObj 2:\n* Talk to Bilbo Baggins at the Last Homely House in Rivendell.\nObj 3:\nAt least two copies of this book are believed to have been lost - one somewhere within Angmar and the other in the Misty Mountains.\n* The Book of Knives, page 3\n* The Book of Knives, page 5\n* The Book of Knives, page 12\n* The Book of Knives, page 17\n* The Book of Knives, page 18\n* The Book of Knives, page 23\n* The Book of Knives, page 26\n* The Book of Knives, page 31",pois={{name="Bilbo Baggins",area="Rivendell Valley",dungeon="The Last Homely House",loc={"63.5N, 53.9E"},zone="The Trollshaws"}},r={lp={{val=10}}},t="Class",zone="The Trollshaws"},
{id="7001647B",name="The Book of Nature",cat="Class",class="Lore-master",d="You have heard it whispered that the libraries of Moria yet contain many tomes, while many other volumes were brought by the dwarves seeking to reclaim their ancient realm. One such tome in the libraries of the Iron Garrison is said to be the legendary \\qThe Book of Nature.\\q If you can gain enough favour with the Iron Garrison Guards, they may let you have their copy of this book.",faction="FrP",level=60,minlevel=58,ndx=4111,o="Obj 1:\n* Achieve level 58\nObj 2:\n* Read the book, \"The Book of Nature\"",r={lp={{val=20}}},t="Class"},
{id="700012D6",name="The Book of Oaths",area="Rivendell Valley",cat="Class",class="Captain",d="The first four pages of this book can be found on enemies scattered across Angmar, Eregion, and Moria. The last four pages of this book can be found on enemies scattered across Forochel, Moria, and the Misty Mountains.\nThe Book of Oaths discusses the central role of Honour in true leadership and the sanctity of a King's Oath -- or a Captain's. Much of the power to guide men truly derives from the simple bond of Truth itself, and for those who lead, an Oath is a bond of commitment that cannot be broken without inviting a fate most dire. Indeed, a captain who would betray his own word risks more than his life, for it is well-known that an Oath fatefully taken binds far more than the flesh.\nThis book is said to be the utmost authority in such matters, but the copy you have found seems badly damaged and many important passages are missing. Perhaps Boromir of Gondor, who currently rides here in the north, may know something about this book.",faction="FrP",level=46,minlevel=39,ndx=4112,o="Obj 1:\n* Collect The Book of Oaths\nObj 2:\n* Talk to Boromir in Rivendell\nObj 3:\n* The Book of Oaths, page 6\n* The Book of Oaths, page 8\n* The Book of Oaths, page 9\n* The Book of Oaths, page 14\n* The Book of Oaths, page 17\n* The Book of Oaths, page 19\n* The Book of Oaths, page 23\n* The Book of Oaths, page 28",pois={{name="Boromir",area="Rivendell Valley",dungeon="Guest Rooms",loc={"66.9N, 51.6E"},zone="The Trollshaws"}},r={lp={{val=10}}},t="Class",zone="The Trollshaws"},
{id="7005CCE1",name="The Brawler's Dance",cat="Class",class="Brawler",d="Being light on your feet means better positioning for both attack and defence.",faction="FrP",level=20,minlevel=20,ndx=4113,["next"]={815},o="Obj 1:\nThis is your objective description.\n* Use Quick Feint.",r={lp={{val=5}}},t="Class"},
{id="7002487D",name="The Busy Bee",cat="Reputation",d="By completing a great number of tasks, you are earning a reputation as someone with a 'can do' attitude and tolerant spirit.",faction="FrP",level=1,minlevel=1,ndx=4114,["next"]={4212},o="Obj 1:\n* Complete 'The Go-getter'\nObj 2:\n* Complete tasks throughout Middle-earth",prev={4247},r={lp={{val=5}},rc={{id="700251D5",val="Cloak of the Busy Bee"},{id="70024935",val="Upgrade Task Limit (+1)"}},ti={{val="The Busy Bee"}}},t="Reputation"},
{id="700012D4",name="The Candle's Flame",area="Rivendell Valley",cat="Class",class="Captain",d="The first four pages of this book can be found on enemies scattered across Angmar, Eregion, and Moria. The last four pages of this book can be found on enemies scattered across Forochel, Moria, and the Misty Mountains.\nThe Candle's Flame is a stirring piece written by one of the great Captains of Gondor during the War of the Last Alliance. It speaks of the very personal connexion that a worthy captain forms with his followers, and the power that bond can have when a fallen warrior lies upon the threshold of Death's door. Few copies of this book exist today, most having been lost in the long years since or secreted away in the hidden libraries of the Lords of Gondor.\nThis copy of The Candle's Flame is missing many important pages. Rumour tells that Boromir, a Captain of Gondor, has come north. Perhaps he can help you comprehend the broken knowledge of this book.",faction="FrP",level=42,minlevel=39,ndx=4115,o="Obj 1:\n* Collect The Candle's Flame\nObj 2:\nThis copy of The Candle's Flame is missing many important pages. Rumour tells that Boromir, a Captain of Gondor, has come north. Perhaps he can help you comprehend the broken knowledge of this book.\n* Talk to Boromir in Rivendell\nObj 3:\nThe missing pages of The Candle's Flame might be found in the Misty Mountains or Angmar.\n* The Candle's Flame, page 4\n* The Candle's Flame, page 7\n* The Candle's Flame, page 13\n* The Candle's Flame, page 16\n* The Candle's Flame, page 25\n* The Candle's Flame, page 26\n* The Candle's Flame, page 31\n* The Candle's Flame, page 35",pois={{name="Boromir",area="Rivendell Valley",dungeon="Guest Rooms",loc={"66.9N, 51.6E"},zone="The Trollshaws"}},r={lp={{val=10}}},t="Class",zone="The Trollshaws"},
