{id="70010214",name="The City of Orcs",cat="Shadows of Angmar",d="This district of Carn Dûm, now called Urugarth, fell to ill-repair due to the foul waters pouring from the sewers of the seat of Angmar. Urugarth was given to the Orcs of Angmar and set as a staging point from which its terrible army could march.",faction="FrP",level=48,minlevel=40,ndx=4118,["next"]={1257},o="Obj 1:\nThis district of Carn Dûm, now called Urugarth, fell to ill-repair due to the foul waters pouring from the sewers of the seat of Angmar. Urugarth was given to the Orcs of Angmar and set as a staging point from which its terrible army could march.\n* Discover Dushkal's Lair\n* Discover Lhugrien's Roost\n* Discover Lagmas' Court\n* Discover Fell-water Falls\n* Discover Urugarth Kennels\n* Discover Asht-Shâpol",pois={{name="Dushkal's Lair",area="Urugarth",loc={"9.3N, 32.1W","9.3N, 32.2W","9.4N, 32.1W","9N, 32.1W"},zone="Angmar"},{name="Fell-water Falls",area="Urugarth",loc={"10.6N, 31.1W"},zone="Angmar"},{name="Urugarth Kennels",area="Urugarth",loc={"10.4N, 31.9W"},zone="Angmar"},{name="Lagmas' Court",area="Urugarth",loc={"9.5N, 30.2W","9.6N, 30.4W","9.7N, 30.4W","9.9N, 30.2W"},zone="Angmar"},{name="Lhugrien's Roost",area="Urugarth",loc={"8.5N, 30.1W","8.8N, 30.1W"},zone="Angmar"},{name="Asht-Shâpol",area="Urugarth",loc={"9.7N, 30W"},zone="Angmar"}},r={lp={{val=5}},ri={{val="+700 with Council of the North"}},vx={{val=2000}}},t="Explorer",zone="Angmar"},
