{id="70025722",name="The Cleansing of Darkthorn",cat="In Their Absence",d="Darkthorn is a horrible poison brewed by Thadúr the Ravager within the Northcotton Farm. By allowing Úmheryn, the vile cauldron, to boil over while destroying it, you will destroy any trace of this horrific poison.\n<rgb=#FF0000>This deed can only be completed on Tier 2 difficulty.</rgb>",faction="FrP",level=65,minlevel=65,ndx=4120,["next"]={2744,747},o="Obj 2:\n* Avoid quenching the fire beneath Úmheryn while destroying the cauldron",r={lp={{val=10}},rc={{id="7002B018",q=20,val="Medallion"}}},t="Lore"},
