{id="7004C02D",name="The Court of Seregost -- Tier 1",cat="The Plateau of Gorgoroth",d="Deep within Seregost, Lhaereth the Stained keeps her plague cauldrons. They contain a new, more virulent Great Plague, which she intends to release upon the realms of the Free Peoples. As you and the Rangers Faeron and Rhadrog are the few innoculated to the plague, you must enter the Court of Seregost as a small strike team and attempt to disrupt Lhaereth's plans.",faction="FrP",level=115,minlevel=105,ndx=4170,["next"]={3831},o="Obj 2:\n* Complete The Court of Seregost -- Tier 1",r={rc={{id="7002B018",q=30,val="Medallion"},{id="700487E5",q=4,val="Silver Signet of the Thandrim"}},xp={{val=62300}}},t="Slayer",zone="Bree-land"},
