{id="7006A1C9",name="The Depths of Mâkhda Khorbo -- Azagath's Escape",area="Bej Mâgha",cat="Cape of Umbar",d="The Mâkhda Khorbo, Temple of the All-Seeing, crumbled into ruin at the moment of Sauron's defeat, but remains a place of great interest for those seeking artifacts of evil. When Azagath Sea-shadow fled from the Citadel of Winds in the company of his comrades Belondor and Nakási Wave-reaper, his purpose was not escape alone. What treasure of the Dark Lord's might he have wrested from those buried ruins? Its identity remains unknown, but your pursuit of Azagath played a role in fracturing the bonds between some of these Kindred.",faction="FrP",level=150,minlevel=150,ndx=4192,o="Obj 2:\nThe Mâkhda Khorbo, Temple of the All-Seeing, crumbled into ruin at the moment of Sauron's defeat, but remains a place of great interest for those seeking artifacts of evil. When Azagath Sea-shadow fled from the Citadel of Winds in the company of his comrades Belondor and Nakási Wave-reaper, his purpose was not escape alone. What treasure of the Dark Lord's might he have wrested from those buried ruins? Its identity remains unknown, but your pursuit of Azagath played a role in fracturing the bonds between some of these Kindred.\nStop Azagath Sea-shadow, Nakási Wave-reaper, and Belondor in the Mâkhda Khorbo\n* Complete 'The Depths of Mâkhda Khorbo -- Tier 1'\n* Complete 'The Depths of Mâkhda Khorbo -- Tier 2'\n* Complete 'The Depths of Mâkhda Khorbo -- Tier 3'\n* Complete 'The Depths of Mâkhda Khorbo -- Tier 4'\n* Complete 'The Depths of Mâkhda Khorbo -- Tier 5'",r={rc={{id="70065F33",q=3,val="Umbari Tâm"}},vx={{val=500}}},t="Lore",zone="Umbar"},
