{id="70010337",name="The Enemy's Stronghold",cat="Shadows of Angmar",d="Once the seat of power from which the Witch-king's army marched upon the kingdom of Arnor, Carn Dûm now exists as the primary bastion of the Steadfast of Angmar.",faction="FrP",level=50,minlevel=45,ndx=4215,["next"]={1341},o="Obj 1:\nOnce the seat of power from which the Witch-king's army marched upon the kingdom of Arnor, Carn Dûm now exists as the primary bastion of the Steadfast of Angmar.\n* Discover Slave-pens\n* Discover Barashal's Domain\n* Discover Fell-water Source\n* Discover Duvárdain Quarter\n* Discover Castle of Carn Dûm\n* Discover Seat of the Witch-king\n* Discover Witch-king's Watch",pois={{name="Duvárdain Quarter",area="Carn Dûm",loc={"11.6N, 34.2W","11.6N, 34.3W","11.6N, 34.6W","11.6N, 34W","11.9N, 34.6W","12.2N, 34.6W"},zone="Angmar"},{name="Seat of the Witch-king",area="Carn Dûm",dungeon="Castle of the Witch-king",loc={"14.7N, 35.6W"},zone="Angmar"},{name="Slave-pens",area="Carn Dûm",loc={"11.9N, 34.5W","12.2N, 34.3W"},zone="Angmar"},{name="Fell-water Source",area="Carn Dûm",loc={"12.6N, 33.9W"},zone="Angmar"},{name="Witch-king's Watch",area="Carn Dûm",loc={"14N, 33.5W"},zone="Angmar"},{name="Castle of Carn Dûm",area="Carn Dûm",loc={"14N, 33.5W"},zone="Angmar"},{name="Barashal's Domain",area="Carn Dûm",loc={"13.8N, 32.6W"},zone="Angmar"}},r={lp={{val=5}},ri={{val="+700 with Council of the North"}},vx={{val=2000}}},t="Explorer",zone="Angmar"},
{id="70000201",name="The Expert's Guide to Dirty Fighting",area="Rivendell Valley",cat="Class",class="Burglar",d="The first four pages of this book can be found on enemies scattered across Angmar, Eregion, and Moria. The last four pages of this book can be found on enemies scattered across Forochel, Moria, and the Misty Mountains.\nThe Expert's Guide to Dirty Fighting was written about a rather notorious hobbit-burglar mid Third Age, when the Shire was not so secure as it is today. Having found himself drafted into the Shire-muster during a particularly difficult season and pitted against Golfimbul's goblins in a number of pitched battles, he learned to fight in a most ungentlehobbitly fashion that served him well against foes considerably larger and stronger than himself.\nAlas, it has been many years since its writing, and all copies of this interesting text were thought lost, until now. Perhaps the famous hobbit-burglar Bilbo Baggins will have some further insights or thoughts on the book.",faction="FrP",level=46,minlevel=39,ndx=4216,o="Obj 1:\n* Collect The Expert's Guide to Dirty Fighting\nObj 2:\nYou've heard of this book. It was written quite a long time ago and details the exploits of an accomplished Hobbit Burglar, alas this copy seems badly weathered and damaged, rendering a number of the pages indecipherable.\nStill, if you want to know more about a Hobbit Burglar, it'd make sense to ask another, wouldn't it? No one would know more about such matters than the esteemed Bilbo Baggins, if you could find a chance to speak with him and show him this text.\n* Talk to Bilbo Baggins at the Last Homely House in Rivendell.\nObj 3:\nCollect the missing pages of The Expert's Guide to Dirty Fighting and add them to the book.\n* The Expert's Guide to Dirty Fighting, page 4\n* The Expert's Guide to Dirty Fighting, page 5\n* The Expert's Guide to Dirty Fighting, page 7\n* The Expert's Guide to Dirty Fighting, page 12\n* The Expert's Guide to Dirty Fighting, page 15\n* The Expert's Guide to Dirty Fighting, page 19\n* The Expert's Guide to Dirty Fighting, page 24\n* The Expert's Guide to Dirty Fighting, page 28",pois={{name="Bilbo Baggins",area="Rivendell Valley",dungeon="The Last Homely House",loc={"63.5N, 53.9E"},zone="The Trollshaws"}},r={lp={{val=10}}},t="Class",zone="The Trollshaws"},
