{id="70005BB4",name="The Farms of the Shire",cat="Shire",d="Farming represents the heart of the Shire, and farmsteads can be found throughout -- the largest of which surround the town of Michel Delving.",faction="FrP",level=4,minlevel=1,ndx=4231,["next"]={1776},o="Obj 1:\nExplore the Farms of the Shire.\n* Discover Dora Brownlock's Farm\n* Discover Bamfurlong\n* Discover Old Odo's Leaf-farm\n* Discover South Fields\n* Discover Appledores\n* Discover Puddifoot's Fields",pois={{name="Puddifoot's Fields",area="Bridgefields",loc={"31S, 63.8W","31S, 64.2W"},zone="The Shire"},{name="Old Odo's Leaf-farm",area="Green Hill Country",loc={"33.8S, 67.8W","33.8S, 68W"},zone="The Shire"},{name="Dora Brownlock's Farm",area="The Delving Fields",loc={"31.2S, 72.7W"},zone="The Shire"},{name="Appledores",area="The Hill",loc={"29.4S, 72W","29.6S, 72W"},zone="The Shire"},{name="South Fields",area="The Delving Fields",loc={"34.1S, 74.2W","34.2S, 74.3W","34.3S, 74.4W","34.4S, 74.5W","34.4S, 74.6W","34.5S, 75W","34.6S, 75.2W"},zone="The Shire"},{name="Bamfurlong",area="The Marish",loc={"34.3S, 64.4W"},zone="Festival Grounds"}},r={lp={{val=5}},rc={{id="7002B017",q=30,val="Mark"}},ri={{val="+500 with The Mathom Society"}},vx={{val=2000}}},t="Explorer",zone="The Shire"},
{id="70002EB9",name="The Final Word",area="Rivendell Valley",cat="Class",class="Guardian",d="The first four pages of this book can be found on enemies scattered across Angmar, Eregion, and Moria. The last four pages of this book can be found on enemies scattered across Forochel, Moria, and the Misty Mountains.\nThis book is of Elvish origin, having been written so long ago that few of the Elves today were alive at the time of its writing. You cannot even guess at how old it actually is, as it seems to show few signs of age or decay. You cannot recognize the type of parchment it was written upon, nor what kind of ink could withstand the passage of so much time without fading. The main indication of its age and origin is the writing style which is in an extremely old form using ancient letters called Tengwar, which were created by the Noldor many ages ago. The main focus of the book is difficult to translate, but seems to centre around an ancient oath of battle that Elf-guardians might make in the midst of a desperate melee, in essence binding themselves and their enemies in a pact of battle and death that neither the oath-taker nor their sworn-enemies dared break.\nIt is clear from the text that these oaths carried power beyond that of any simple cry to infuriate or trick one's enemies -- but the secret of the technique seems lost as several key pages have been carefully cut from the book, presumably by someone hoping to safe-guard its secrets in an age long past. Perhaps someone in Rivendell will be able to help decipher the book.",faction="FrP",level=46,minlevel=39,ndx=4232,o="Obj 1:\n* Collect The Final Word\nObj 2:\nDIRECTION TO NPC\n* Talk to Samwise Gamgee in Rivendell\nObj 3:\n* The Final Word, page 6\n* The Final Word, page 7\n* The Final Word, page 13\n* The Final Word, page 14\n* The Final Word, page 19\n* The Final Word, page 21\n* The Final Word, page 24\n* The Final Word, page 27",pois={{name="Samwise Gamgee",area="Rivendell Valley",dungeon="Bilbo's Room",loc={"66.8N, 50.7E"},zone="The Trollshaws"}},r={lp={{val=10}}},t="Class",zone="The Trollshaws"},
