{id="7000C69F",name="The Forbidding Heights",cat="Misty Mountains",d="While most folks sensibly stay home and tend to fields and shops, some hardy adventurers are drawn to the most inhospitable and difficult places in Middle-earth. Few such places pose so great a challenge as the stretch of the Misty Mountains surrounding the region of the High Pass, which is fraught with hazards -- both natural and otherwise -- to test the most rugged individuals.",faction="FrP",level=45,minlevel=30,ndx=4238,["next"]={1772},o="Obj 1:\nEXPLORE STUFF\n* Discover Cirith Daur\n* Discover The Black Crack\n* Discover Dómstoll\n* Discover Erforgh Cleft\n* Discover Writhenbores\n* Discover Starkhath\n* Discover Hrimbarg\n* Discover Akûltot",pois={{name="Hrimbarg",area="Northern High Pass",loc={"24.3S, 6.9E","24.6S, 6.9E"},zone="The Misty Mountains"},{name="Writhenbores",area="Southern High Pass",loc={"26.4S, 8.8E","26.4S, 9.5E","26.5S, 8.1E","26.5S, 9E","26.8S, 9.2E","27.1S, 8.8E","27S, 8.2E"},zone="The Misty Mountains"},{name="Dómstoll",area="Northern High Pass",loc={"21.9S, 8.6E"},zone="The Misty Mountains"},{name="Starkhath",area="Northern High Pass",loc={"20.9S, 8E"},zone="The Misty Mountains"},{name="Akûltot",area="Northern High Pass",loc={"21.3S, 4.5E","21.5S, 4.5E","21.6S, 4.4E"},zone="The Misty Mountains"},{name="Cirith Daur",area="Northern High Pass",loc={"23.1S, 3.2E","23.3S, 3.4E","23.3S, 3.7E"},zone="The Misty Mountains"},{name="The Black Crack",area="Northern High Pass",loc={"20.3S, 5.3E"},zone="The Misty Mountains"},{name="Erforgh Cleft",area="Southern High Pass",loc={"29.5S, 9.4E","29.6S, 8.8E","29.6S, 9E"},zone="The Misty Mountains"}},r={lp={{val=5}},rc={{id="7002B017",q=30,val="Mark"}},ri={{val="+500 with Elves of Rivendell"}},vx={{val=2000}}},t="Explorer",zone="The Misty Mountains"},
