{id="7005A65C",name="The Further Adventures of Bilbo Baggins",cat="Trollshaws",d="Noted author and adventurer Bilbo Baggins intended to spend the rest of his days in the peace and quiet of Rivendell, home to Lord Elrond and haven of the Elves, but sometimes adventures come calling....",faction="FrP",level=1,minlevel=20,ndx=4241,o="Obj 1:\nCeleblír has asked you to help him find Bilbo Baggins, who has disappeared from Imladris without a word to anyone! What adventure has the old hobbit embarked upon now?\n* Complete Chapter 1\n* Complete Chapter 2\n* Complete Chapter 3\n* Complete Chapter 4\n* Complete Chapter 5\n* Complete Chapter 6\n* Complete Chapter 7\n* Complete Chapter 8\n* Complete Chapter 9\n* Complete Chapter 10",r={rc={{id="7005A6D1",q=30,val="Token of Further Adventure"}},ti={{val="Back Again"}},vx={{val=3000}}},t="Lore",zone="The Trollshaws"},
{id="70061F5B",name="The Further Adventures of Elladan and Elrohir",cat="Trollshaws",d="As unrest begins to spread into Eriador, Lord Elrond entrusts his sons, Elladan and Elrohir, with a secret errand that will take them to Lothlórien. The twins are no strangers to adventure, but even the most seasoned of travellers cannot completely avoid trouble.",faction="FrP",level=1,minlevel=20,ndx=4242,o="Obj 1:\nLord Elrond has asked you to join Elladan and Elrohir on their journey to Lothlórien.\n* Complete Chapter 1\n* Complete Chapter 2\n* Complete Chapter 3\n* Complete Chapter 4\n* Complete Chapter 5",r={rc={{id="7005A6D1",q=30,val="Token of Further Adventure"}},ti={{val="Brothers' Keeper"}},vx={{val=3000}}},t="Lore",zone="The Trollshaws"},
{id="700010C7",name="The Furthest Charge",area="Rivendell Valley",cat="Class",class="Hunter",d="The first four pages of this book can be found on enemies scattered across Angmar, Eregion, and Moria. The last four pages of this book can be found on enemies scattered across Forochel, Moria, and the Misty Mountains.\nThe Furthest Charge was written by a Captain of Gondor who fought in a misguided battle shortly before the War of the Last Alliance. In this battle, the forces of the young kingdom of Gondor found themselves pitted against a company of Elven hunters out of Lórien, both sides having been tricked into battle by a device of the Enemy, who was determined to cripple the alliance that would eventually result in his overthrow. In this book, the Captain describes a valiant but doomed charge of the Men of Gondor against the Elves, within which they suffered a terrible onslaught of arrows raining down from the sky in such fashion as to cause brave men to cower and falter in their advance, trapped unmoving beneath an endless hail of biting wood and metal.\nThe Furthest Charge is considered to be a defining work on the power of the hunter's art in the grand battles that have defined the face of Middle-earth today. Unfortunately, this copy is badly damaged by time and wear. Perhaps Legolas of Mirkwood, purported to be in Eriador, could shed some light upon the text.",faction="FrP",level=46,minlevel=39,ndx=4243,o="Obj 1:\n* Collect The Furthest Charge\nObj 2:\n* Talk to Legolas in Rivendell\nObj 3:\nCollect the pages of The Furthest Charge from the goblins of the Misty Mountains, and the nomads hiding in the Trollshaws.\n* The Furthest Charge, page 7\n* The Furthest Charge, page 9\n* The Furthest Charge, page 10\n* The Furthest Charge, page 14\n* The Furthest Charge, page 17\n* The Furthest Charge, page 18\n* The Furthest Charge, page 21\n* The Furthest Charge, page 24",pois={{name="Legolas",area="Rivendell Valley",dungeon="Guest Rooms",loc={"66.9N, 51.6E"},zone="The Trollshaws"}},r={lp={{val=10}}},t="Class",zone="The Trollshaws"},
