{id="700605F2",name="The Hiddenhoard of Abnankâra - Leading the Charge",cat="The Mountain-hold",d="Beyond the falls of Amgaruslun in the Clovengap lies the Hiddenhoard of Abnankâra. Once an ancient treasury wrought in secret by Mótsog and the Greymauls during their rebellion against the Longbeards in the Elder Days, it has become the lair of Hrímil Frost-heart, a dreaded cold-dragon of Morgoth. Within this frozen retreat, Hrímil tends her wounds and slumbers, dreaming of vengeance upon Prince Durin and the dwarves of the Gabil'akkâ.",faction="FrP",level=140,minlevel=135,ndx=4259,o="Obj 1:\nBeyond the falls of Amgaruslun in the Clovengap lies the Hiddenhoard of Abnankâra. Once an ancient treasury wrought in secret by Mótsog and the Greymauls during their rebellion against the Longbeards in the Elder Days, it has become the lair of Hrímil Frost-heart, a dreaded cold-dragon of Morgoth. Within this frozen retreat, Hrímil tends her wounds and slumbers, dreaming of vengeance upon Prince Durin and the dwarves of the Gabil'akkâ.\n* Be among the first to fully complete 'The Hiddenhoard of Abnankâra' on Tier 3.",prev={4266},r={ti={{val="Led the Charge at Abnankâra"}}},t="Slayer"},
