{id="70016478",name="The Jolly Hunter",cat="Class",class="Hunter",d="You have heard it whispered that the libraries of Moria yet contain many tomes, while many other volumes were brought by the dwarves seeking to reclaim their ancient realm. One such tome in their libraries is said to be the legendary \\qThe Jolly Hunter.\\q If you can gain enough favour with the Iron Garrison Guards, they may let you have their copy of this book.",faction="FrP",level=60,minlevel=58,ndx=4288,o="Obj 1:\n* Achieve level 58\nObj 2:\n* Read the book, \"The Jolly Hunter\"",r={lp={{val=20}}},t="Class"},
{id="700268D5",name="The Journal of Captain Rabghul",cat="Shadows of Angmar",d="Beneath The Forsaken Inn stretches an expanse of natural caverns. It seems that people lived here at one time. One such person, the apparent leader of the group, left behind a journal. Who were these people, and what were they doing here? Collect all the pages and discover for yourself.\nNote: Not all journal pages can be found in Tier 1 difficulty.",faction="FrP",level=20,minlevel=15,ndx=4289,["next"]={1704},o="Obj 1:\nCaptain Rabghul has not made it easy to locate the pages of his journal. He has left some of them in hidden areas where only a well-balanced party may venture.\n* Locate page 1\n* Locate page 2\n* Locate page 3\n* Locate page 4\n* Locate page 5",r={lp={{val=5}},rc={{id="7002B018",q=20,val="Medallion"}},ri={{val="+1200 with The Eglain"}}},t="Lore"},
{id="70002D80",name="The Joy of Battle",area="Rivendell Valley",cat="Class",class="Champion",d="The first four pages of this book can be found on enemies scattered across Angmar, Eregion, and Moria. The last four pages of this book can be found on enemies scattered across Forochel, Moria, and the Misty Mountains.\nThe Joy of Battle is an aptly named text, written by a great dwarf-champion during the height of Durin's reign in Khazad-dûm. It is no simple treatise on the art of battle, as so many texts are. Rather, it is a philosophical tract that describes the author's outlook upon warfare and battle, and how he came eventually to seek it out as a meditative and even transcendant experience that he was unable to experience in any other setting save the midst of clashing blades and the cries of battle. It is not a text for the faint-hearted or the meek, but it seems oddly lofty and its tone does not reflect the maddened bloodlust that one might have expected given the title.\nAlas, the long years have been rough on your copy, and there are a number of pages torn or missing from it. Gimli the Dwarf might have some insight into the missing knowledge of The Joy of Battle, since it was written by one of his forebears in the depths of time.",faction="FrP",level=44,minlevel=39,ndx=4290,o="Obj 1:\n* Collect The Joy of Battle\nObj 2:\nGimli the Dwarf might have some insight into the missing knowledge of The Joy of Battle, since it was written by one of his forebears in the depths of time.\n* Talk to Gimli in Rivendell\nObj 3:\nThe missing pages of The Joy of Battle may be found on those who wander the darkest regions of Angmar or the blistering cold of the Misty Mountains.\n* The Joy of Battle, page 11\n* The Joy of Battle, page 14\n* The Joy of Battle, page 18\n* The Joy of Battle, page 24\n* The Joy of Battle, page 25\n* The Joy of Battle, page 28\n* The Joy of Battle, page 32\n* The Joy of Battle, page 36",pois={{name="Gimli",area="Rivendell Valley",dungeon="Guest Rooms",loc={"66.8N, 51.6E"},zone="The Trollshaws"}},r={lp={{val=10}}},t="Class",zone="The Trollshaws"},
