{id="7006146D",name="The Quick Post of Yondershire",cat="Shire",d="With routes extending into the Yondershire, the Quick Post must maintain its good reputation.",faction="FrP",level=20,minlevel=15,ndx=4408,o="Obj 1:\nThe Quick Post service is responsible for more than a dozen mail routes throughout the Shire. If its good name is to be maintained, you will need to help deliver mail at each of its routes and ensure that the routes between Hithershire and Yondershire remain in service.\n* Aid Postman Grubb and complete 'A Route Over Yonder'\n* Service Nobottle to Long Cleeve Route\n* Service Nobottle to Tighfield Route\n* Service Gamwich to Tighfield Route\n* Service Long Cleeve to Nobottle Route\n* Service Tighfield to Gamwich Route\n* Service Tighfield to Nobottle Route\nObj 2:\nPostmaster Proudfoot is in Michel Delving, near the Town Hole.\nThanks to your efforts, a conspiracy to subvert the Quick Post was thwarted and it has maintained its reputation for speedy delivery of the mail both in Hithershire and Yondershire. Postmaster Proudfoot will be delighted to hear of all you have done.\n* Talk to Postmaster Proudfoot in Michel Delving",pois={{name="Postmaster Proudfoot",area="The Delving Fields",loc={"33.4S, 74.9W"},zone="The Shire"}},r={lp={{val=5}},ri={{val="+900 with The Yonder-watch"}},ti={{val="Officer of the Post"}},vx={{val=3000}}},t="Reputation",zone="The Shire"},
