{id="700640ED",name="The Shanty-singer's Compendium",area="Bree",cat="Class",class="Corsair",d="The first four pages of this book can be found on enemies scattered across Angmar, Eregion, and Moria. The last four pages of this book can be found on enemies scattered across Forochel, Moria, and the Misty Mountains.\nThe Shanty-singer's Compendium appears to have been penned by several different and very opinionated authors over a number of years—or perhaps centuries. This particular copy is heavily annotated, with a previous reader's thoughts scribbled into its margins. Several passages have been struck through entirely, and you notice that several shanties have been rearranged, replacing mentions of Umbar with Bree-town. Even so, it provides a thorough history of sea-shanties and contains a collection of songs sung by sailors and Mariners of Gondor and Umbar.",faction="FrP",level=44,minlevel=39,ndx=4453,o="Obj 1:\n* Collect The Shanty-singer's Compendium\nObj 2:\n* Talk to Mick Maidenhair in the Dwarrow-ward, in Bree-town\nObj 3:\n* The Shanty-singer's Compendium, Page 8\n* The Shanty-singer's Compendium, Page 14\n* The Shanty-singer's Compendium, Page 21\n* The Shanty-singer's Compendium, Page 28\n* The Shanty-singer's Compendium, Page 32\n* The Shanty-singer's Compendium, Page 35\n* The Shanty-singer's Compendium, Page 41\n* The Shanty-singer's Compendium, Page 44",pois={{name="Mick Maidenhair",area="Bree",loc={"31.4S, 51.5W"},zone="Bree-land"}},r={lp={{val=10}},rc={{id="70067DD9",val="Ring of the Wind"}}},t="Class",zone="Bree-land"},
{id="70020BFC",name="The Shrewd Gardener",cat="Race & Social",d="The Festival Garden of Duillond is rife with pesky pests, and some very practical help is needed to rid the garden of its problems.",faction="FrP",level=10,minlevel=6,mobs={{name="Pesky Shrew",area="Falathlorn",dungeon="The Festival Garden",loc={"107.5S, 53.1E","107.5S, 53.2E","107.5S, 53E","107.6S, 53.1E","107.6S, 53.2E","107.6S, 53E"},zone="Ered Luin"}},ndx=4454,["next"]={4492},o="Obj 1:\nThe Festival Garden of Duillond is rife with pesky pests.\nYou should defeat as many shrews as you can to help the Elves cleanse their garden of chaos so that the young plants may have a chance to grow.\n* Defeat shrews in the Festival Garden at Duillond",r={ti={{val="the Shrewd"}}},t="Event"},
{id="7002051B",name="The Siege of Mirkwood",cat="Southern Mirkwood",d="Lord Celeborn and Lady Galadriel have devised a daring plan: to cross the river Anduin and attack the fortress of Dol Guldur in the depths of Mirkwood.",faction="FrP",level=5,minlevel=5,ndx=4455,o="Obj 1:\nIt is time to execute Lord Celeborn's daring plan: an attack upon the fortress of Dol Guldur, in the depths of Southern Mirkwood.\n* Begin the Siege of Mirkwood",r={ti={{val="Called by the Golden Host"}}},t="Lore"},
