{id="70016AAF",name="The Silvertine Lodes",c={"Memem-munz might be a bit hard to find. Head south from Deep Descent and take the first road to the left, to the goblin camp. Don't enter the camp though, go to the right just before it, heading south to where Flík is found. Jump down here, in between some grodbog queens. Follow the wooden platforms to the middle of the great opening."},cat="Moria",d="Explore the Silvertine Lodes of Moria.",faction="FrP",level=55,minlevel=47,ndx=4459,["next"]={1742},o="Obj 1:\nNOT USED\n* Discover The Deep Descent\n* Discover Gamil Filik\n* Discover Menem-berej\n* Discover The Old Silvertine City",pois={{name="Menem-berej",area="Silvertine Lodes",loc={"11S, 112.7W"},zone="Moria"},{name="The Old Silvertine City",area="Silvertine Lodes",loc={"11.8S, 111.2W","11.8S, 111.9W","12.5S, 111.5W"},zone="Moria"},{name="The Deep Descent",area="Silvertine Lodes",loc={"9.8S, 112.5W"},zone="Moria"},{name="Gamil Filik",area="Silvertine Lodes",loc={"10.1S, 111.8W","10.2S, 111.5W","10.4S, 111.2W","10.4S, 111.6W","10.9S, 111.1W","11.3S, 111.5W"},zone="Moria"}},r={lp={{val=10}},rc={{id="7002B017",q=30,val="Mark"}},ri={{val="+500 with Iron Garrison Miners"}},vx={{val=2000}}},t="Explorer",zone="Moria"},
