{id="70020BF7",name="The Taming of the Shrews",cat="Race & Social",d="The Festival Garden of Duillond is rife with pesky pests, and some very practical help is needed to rid the garden of its problems.",faction="FrP",level=10,minlevel=6,mobs={{name="Pesky Shrew",area="Falathlorn",dungeon="The Festival Garden",loc={"107.5S, 53.1E","107.5S, 53.2E","107.5S, 53E","107.6S, 53.1E","107.6S, 53.2E","107.6S, 53E"},zone="Ered Luin"}},ndx=4492,o="Obj 1:\n* Complete 'The Shrewd Gardener'\nObj 2:\nThe Festival Garden of Duillond is rife with pesky pests.\nYou should defeat as many shrews as you can to help the Elves cleanse their garden of chaos so that the young plants may have a chance to grow.\n* Defeat shrews in the Festival Garden at Duillond",prev={4454},r={ti={{val="Tamer of the Shrews"}}},t="Event"},
