{id="70002D7F",name="The Tome of Swords",area="Rivendell Valley",cat="Class",class="Champion",d="The first four pages of this book can be found on enemies scattered across Angmar, Eregion, and Moria. The last four pages of this book can be found on enemies scattered across Forochel, Moria, and the Misty Mountains.\nWritten in a neatly defined Sindarin script, The Tome of Swords has long been renowned as one of the finest manuals on the art of swordsmanship and battle. Originally written in the early ages of Middle-earth, many copies exist -- but sometime shortly after the end of the Second Age, most of them either vanished or had important passages edited, meaning that most of the copies that exist today are incomplete.\nThe copy you have found appears to be mostly intact, but time and wear have done the duty of whomever wished to limit the knowledge contained therein. There are a few pages that are either missing or too badly weathered to read. Perhaps the dwarf Gimli, son of Glóin of the Lonely Mountain, could tell you more about this ancient tome.",faction="FrP",level=42,minlevel=39,ndx=4495,o="Obj 1:\n* Collect The Tome of Swords\nObj 2:\nThe copy you have found appears to be mostly intact - but time and wear have done the duty of whomever wished to limit the knowledge contained herein. There are a few pages that are either missing or too badly weathered to read. Perhaps the dwarf-champion Gimli, son of Glóin of the Lonely Mountain, could tell you more about this ancient tome.\n* Talk to Gimli in Rivendell\nObj 3:\nSince the Elves collected so many copies of The Tome of Swords, it may be that some loose pages may be found in the Misty Mountains. Others may have been taken by the Enemy into the Witch-king's realm of Angmar.\n* The Tome of Swords, page 1\n* The Tome of Swords, page 4\n* The Tome of Swords, page 7\n* The Tome of Swords, page 12\n* The Tome of Swords, page 13\n* The Tome of Swords, page 17\n* The Tome of Swords, page 21\n* The Tome of Swords, page 25",pois={{name="Gimli",area="Rivendell Valley",dungeon="Guest Rooms",loc={"66.8N, 51.6E"},zone="The Trollshaws"}},r={lp={{val=10}}},t="Class",zone="The Trollshaws"},
