{id="700012D5",name="The Treatise of Valour",area="Rivendell Valley",cat="Class",class="Captain",d="The first four pages of this book can be found on enemies scattered across Angmar, Eregion, and Moria. The last four pages of this book can be found on enemies scattered across Forochel, Moria, and the Misty Mountains.\nThe Treatise of Valour was written by a council of captains who once commanded the great fortresses of the ancient kingdom of Arnor during the height of its power. It was said to have been the foundation stone of the principles of leadership and warfare for the warriors of Arnor and offered knowledge and teaching that proved key to staving off the assaults of Angmar for so long as the North Kingdom stood. All the remaining copies of the Treatise were believed lost or burned in the Sack of Fornost.\nMany pages of this book, The Treatise of Valour, have been torn or burned, rendering the volume nearly unreadable. Perhaps Boromir of Gondor, recently come north, will know something about it.",faction="FrP",level=44,minlevel=39,ndx=4507,o="Obj 1:\n* Collect Treatise of Valour\nObj 2:\nMany pages of this book, Treatise of Valour, have been torn or burned, rendering the volume nearly unreadable. Perhaps Boromir of Gondor, recently come north, will know something about it.\n* Talk to Boromir in Rivendell\nObj 3:\nIt is believed that the Angmarim and their allies carried off at least one or two copies of the Treatise of Valour at the Battle of Fornost. Perhaps you can find some of the missing pages in Angmar or on the Enemy's minions in the Misty Mountains.\n* Treatise of Valour, page 2\n* Treatise of Valour, page 3\n* Treatise of Valour, page 5\n* Treatise of Valour, page 10\n* Treatise of Valour, page 12\n* Treatise of Valour, page 15\n* Treatise of Valour, page 18\n* Treatise of Valour, page 22",pois={{name="Boromir",area="Rivendell Valley",dungeon="Guest Rooms",loc={"66.9N, 51.6E"},zone="The Trollshaws"}},r={lp={{val=10}}},t="Class",zone="The Trollshaws"},
