{id="7002C602",name="The Vanished Rider",cat="Epic",d="The Nazgûl that rode upon the fell-beast, which lies now dead in the Brown Lands, is missing somewhere along the Great River. Perhaps the residents of those lands have seen some sign of its passage.",faction="FrP",level=75,minlevel=70,ndx=4522,o="Obj 1:\nSome of the Rohirrim beheld a mysterious shadow falling from the sky not long ago. Is this event of some significance for your strange dream in Dunland?\n* Complete 'Book 6, Chapter 10: The Falling Shadow'\nObj 2:\nSearch the lands alongside the Great River for sign of the Nazgûl's passage.\n* Complete 'An Inspiring Presence' in the Brown Lands\n* Complete 'A Bubbling in the Blood' in the Rushgore\n* Complete 'An Uneasy Feeling' in Parth Celebrant\n* Complete 'The Black Breath' in Eorlsmead\n* Complete 'A Shape on the Shore' in Thinglad\n* Complete 'The Sniffling Snuffler' in the Wailing Hills",r={ti={{val="Anduin Wanderer"}}},t="Lore"},
{id="7001647E",name="The Verses of the North",cat="Class",class="Minstrel",d="You have heard it whispered that the libraries of Moria yet contain many tomes, while many other volumes were brought by the dwarves seeking to reclaim their ancient realm. One such tome in the libraries of the Iron Garrison is said to be the legendary \\qThe Verses of the North.\\q If you can gain enough favour with the Iron Garrison Guards, they may let you have their copy of this book.",faction="FrP",level=60,minlevel=58,ndx=4523,o="Obj 1:\n* Achieve level 58\nObj 2:\n* Read the book, \"The Verses of the North\"",r={lp={{val=20}}},t="Class"},
