{id="7005ACA6",name="The War-camp of Thráin",area="Azanulbizar, T.A. 2799",cat="Blood of Azog",d="As the Sixth War of the Dwarves and Orcs neared its end, each of the Seven Houses gathered beneath the banner of Thráin at Amdân.",faction="FrP",level=130,minlevel=125,ndx=4527,["next"]={1718},o="Obj 1:\nAs the Sixth War of the Dwarves and Orcs neared its end, each of the Seven Houses gathered beneath the banner of Thráin at Amdân.\n* Learn of the House of Thráin's encampment at Amdân\n* Learn of the Exiles' encampment at Amdân\n* Learn of the Iron-folk encampment at Amdân\n* Learn of the Landorrim encampment at Amdân\n* Learn of the Zhélruka encampment at Amdân\n* Learn of the Abnúzhu encampment at Amdân\n* Learn of the Narfanghoth encampment at Amdân\n* Learn of the Temámir encampment at Amdân\n* Learn of the Kámbrada encampment at Amdân",r={rc={{id="70059346",q=5,val="Zakaf-beshek"}},ri={{val="+700 with The Haban'akkâ of Thráin"}},ti={{val="Dweller on the Threshold"}},vx={{val=1000}}},t="Explorer",zone="Tales of Yore: Azanulbizar"},
