{id="7001791D",name="The Watch Against the Night",area="Rivendell Valley",cat="Class",class="Warden",d="The first four pages of this book can be found on enemies scattered across Angmar, Eregion, and Moria. The last four pages of this book can be found on enemies scattered across Forochel, Moria, and the Misty Mountains.\nGondolin of old was home to the most legendary Marchwardens of the Elder Days. This tome is an account told by a scribe of those brave Elf-warriors during the long wars against Morgoth. Much of it is a heroic epic, told in linnod-verse, describing multiple forays from the great city into the realms of the Enemy. As with all tales of those times, however, it soon becomes a tragedy; one by one the Wardens were lost, many slain, and some were taken and broken in the dungeons of Morgoth. Many of the tactics passed down to the Wardens of today began with this book, which ends suddenly with the tragic fall of the great city.",faction="FrP",level=42,minlevel=39,ndx=4531,o="Obj 1:\n* Collect The Watch Against the Night\nObj 2:\nAragorn, at the House of Elrond in Rivendell, is known for his great store of tales of Elves and of Men, and he has oft sung in sorrowful Elvish tales of the Marchwardens of the Elder Days. This book should be shown to him if any meaning is to be gleaned from it.\n* Talk to Aragorn in Rivendell\nObj 3:\n* The Watch Against the Night, page 5\n* The Watch Against the Night, page 7\n* The Watch Against the Night, page 13\n* The Watch Against the Night, page 17\n* The Watch Against the Night, page 21\n* The Watch Against the Night, page 25\n* The Watch Against the Night, page 41\n* The Watch Against the Night, page 44",pois={{name="Aragorn",area="Rivendell Valley",dungeon="Guest Rooms",loc={"66.9N, 51.6E"},zone="The Trollshaws"}},r={lp={{val=10}}},t="Class",zone="The Trollshaws"},
