{id="7004ABCE",name="The Way Into Mordor",area="Gorgoroth",cat="Gorgoroth",d="Scout the major routes and vantage points of Mordor's antechamber, Udûn.",faction="FrP",level=115,minlevel=105,ndx=4534,["next"]={1757},o="Obj 1:\nScout the major routes and vantage points of Mordor's antechamber, Udûn.\n* Discover the Iron Road\n* Discover the west road to Anglach\n* Discover the parade grounds\n* Discover the road to Mornaur\n* Discover the west road to Durthang\n* Discover the Durthang tower-top\n* Discover the Durthang look-out\n* Discover Durthang's eastern stairs\n* Discover the path to Rhûd Vorn\n* Discover the Rhûd Vorn watch point\n* Discover the Rogkalúr overlook\n* Discover the Anglach vantage point\n* Discover the overseer's perch\n* Discover the gates of the Isenmouthe\n* Discover the foundry deck",pois={{name="Isenmouthe",area="Dor Amarth",loc={"46.8S, 8E"},zone="Mordor"},{name="Rogkalúr",area="Udûn",loc={"40.9S, 7.6E"},zone="Mordor"}},r={rc={{id="7002B017",q=30,val="Mark"}},ri={{val="+700 with Conquest of Gorgoroth"}},ti={{val="Footman / Footwoman of Mordor"}}},t="Explorer",zone="Mordor"},
