{id="700010C6",name="The Way of the Hunter",area="Rivendell Valley",cat="Class",class="Hunter",d="The first four pages of this book can be found on enemies scattered across Angmar, Eregion, and Moria. The last four pages of this book can be found on enemies scattered across Forochel, Moria, and the Misty Mountains.\nYou have heard of this book before -- The Way of the Hunter is believed to have been a work produced by Elven hunters who were set to the task of guarding the approaches of the hidden city of Gondolin, which fell to the forces of darkness in the First Age. While this work outlived its authors and has been copied innumerable times since, many of those copies were produced by Men from far older works and are imperfect in their translation, leaving several important points untold.\nThis copy of The Way of the Hunter appears to have been a much more accurate work, probably transcribed by Elven scribes in Rivendell or Lórien -- but unfortunately someone seems to have intentionally defaced the book, ripping several pages from it. Legolas of the Elves might be able to shed some light on the text.",faction="FrP",level=44,minlevel=39,ndx=4536,o="Obj 1:\n* Collect The Way of the Hunter\nObj 2:\nThis copy of The Way of the Hunter appears to have been a much more accurate work, probably transcribed by Elven scribes in Rivendell or Lórien -- but unfortunately someone seems to have intentionally defaced the book, ripping several pages from it. Legolas of the Elves might be able to shed some light on the text.\n* Talk to Legolas in Rivendell\nObj 3:\nThe missing pages may be found among the snowy peaks of the Misty Mountains or the former realm of the Witch-king, Angmar.\n* The Way of the Hunter, page 1\n* The Way of the Hunter, page 3\n* The Way of the Hunter, page 4\n* The Way of the Hunter, page 8\n* The Way of the Hunter, page 17\n* The Way of the Hunter, page 20\n* The Way of the Hunter, page 21\n* The Way of the Hunter, page 28",pois={{name="Legolas",area="Rivendell Valley",dungeon="Guest Rooms",loc={"66.9N, 51.6E"},zone="The Trollshaws"}},r={lp={{val=10}}},t="Class",zone="The Trollshaws"},
