{id="7004EA88",name="Thikil-gundu -- Tier 3 -- Leading the Charge",cat="The Grey Mountains",d="The fate of Thikil-gundu remains uncertain, but your timely intervention has banished the evils that sought shelter in the halls of the Steel Keep.",faction="FrP",level=115,minlevel=115,ndx=4553,o="Obj 1:\nThe fate of Thikil-gundu remains uncertain, but your timely intervention has banished the evils that sought shelter in the halls of the Steel Keep.\n* Lead the charge in defeating the evils lingering in Thikil-gundu",r={ti={{val="Led the Charge at Thikil-gundu"}}},t="Slayer"},
{id="7004E9F2",name="Thikil-gundu, the Steel Keep -- Tier 1",cat="The Grey Mountains",d="In the wake of Vethúg Wintermind's defeat at Erebor, Nori set forth with a small company to reclaim the lost hoards of Thikil-gundu. However, great wealth is not all that remains hidden in its frozen halls, and the Dwarves of the North shall soon have to contend with the true master of Thikil-gundu.",faction="FrP",level=115,minlevel=115,ndx=4554,["next"]={3427},o="Obj 2:\n* Complete 'Thikil-gundu, the Steel Keep (Tier 1)'",r={rc={{id="7004E31F",q=3,val="Mark of the Longbeards"}}},t="Slayer"},
