{id="7002BE44",name="Thoroughbred",cat="Rise of Isengard",d="The paths to the Fangorn are dangerous and filled with large creatures, but you are brave...you can handle these creatures. Go, tempt one of the large trolls and see if you can withstand the brutal hits of the beast.",faction="FrP",level=75,minlevel=75,ndx=4558,o="Obj 1:\nTo earn this deed, you must take a hit from the trolls in the instance Fangorn's Edge. Be prepared, for this may hurt a little.\nObj 2:\nTo earn this deed, you must take a hit from the trolls in the instance Fangorn's Edge. Be prepared, for this may hurt a little.\n* Get hit by a deadly troll tree-attack",r={lp={{val=5}},rc={{id="7002B018",q=20,val="Medallion"}}},t="Lore"},
