{id="70045CC5",name="Throne of the Dread Terror -- Challenger of the Morgul-host",area="Pelennor",cat="The Battle of Pelennor",d="In the wake of the Witch-king of Angmar's defeat, Gothmog has taken control of the Enemy's forces. Now, the greatest champions of Mordor and Minas Morgul rush forth onto the Pelennor Fields and threaten the lives of all that defend the Free Peoples.\n<rgb=#FF0000>This deed can only be completed on Tier 2 of the Throne of the Dread Terror raid.</rgb>",faction="FrP",level=105,minlevel=105,ndx=4561,["next"]={4564},o="Obj 2:\nIn the wake of the Witch-king of Angmar's defeat, Gothmog has taken control of the Enemy's forces. Now, the greatest champions of Mordor and Minas Morgul rush forth onto the Pelennor Fields and threaten the lives of all that defend the Free Peoples.\n<rgb=#FF0000>This deed can only be completed on Tier 2 of the Throne of the Dread Terror raid.</rgb>\n* Complete Throne of the Dread Terror: Short Fuse\n* Complete Throne of the Dread Terror: Trampling the Mûmakil\n* Complete Throne of the Dread Terror: Fear and Flame\n* Complete Throne of the Dread Terror: Unbound Corruption\n* Complete Throne of the Dread Terror: Calm of Death\n* Complete Throne of the Dread Terror: The Returned King",prev={4569,4570,4575,4580,4583,4584},r={lp={{val=10}},rc={{id="7002B018",q=200,val="Medallion"}},ti={{val="Defier of the Deathless"}}},t="Lore",zone="Old Anórien"},
