{id="70045CC6",name="Throne of the Dread Terror -- Thwarter of Gothmog",area="Pelennor",cat="The Battle of Pelennor",d="In the wake of the Witch-king of Angmar's defeat, Gothmog has taken control of the Enemy's forces. Now, the greatest champions of Mordor and Minas Morgul rush forth onto the Pelennor Fields and threaten the lives of all that defend the Free Peoples. Only those that can defeat the mightiest of them all can seize the greatest glory in battle.",faction="FrP",level=105,minlevel=105,ndx=4564,o="Obj 2:\nIn the wake of the Witch-king of Angmar's defeat, Gothmog has taken control of the Enemy's forces. Now, the greatest champions of Mordor and Minas Morgul rush forth onto the Pelennor Fields and threaten the lives of all that defend the Free Peoples. Only those that can defeat the mightiest of them all can seize the greatest glory in battle.\n* Complete Throne of the Dread Terror -- Tier 1\n* Complete Throne of the Dread Terror -- Tier 2\n* Complete Throne of the Dread Terror -- Challenger of the Morgul-host",prev={4561,4565,4566},r={lp={{val=10}}},t="Lore",zone="Old Anórien"},
