{id="70045CBE",name="Throne of the Dread Terror -- Tier 2",area="Pelennor",cat="The Battle of Pelennor",d="In the wake of the Witch-king of Angmar's defeat, Gothmog has taken control of the Enemy's forces. Now, the greatest champions of Mordor and Minas Morgul rush forth onto the Pelennor Fields and threaten the lives of all that defend the Free Peoples.\n<rgb=#FF0000>This deed can only be completed on Tier 2 of the Throne of the Dread Terror raid.</rgb>",faction="FrP",level=105,minlevel=105,ndx=4566,["next"]={4564},o="Obj 2:\nIn the wake of the Witch-king of Angmar's defeat, Gothmog has taken control of the Enemy's forces. Now, the greatest champions of Mordor and Minas Morgul rush forth onto the Pelennor Fields and threaten the lives of all that defend the Free Peoples.\n<rgb=#FF0000>This deed can only be completed on Tier 2 of the Throne of the Dread Terror raid.</rgb>\n* Complete Rakothas, Brother of Thrúgrath -- Tier 2\n* Complete Banes of Blackroot -- Tier 2\n* Complete The Summoned -- Tier 2\n* Complete The Enslaved of Minas Morgul -- Tier 2\n* Complete The Deathless Sentinels -- Tier 2\n* Complete Gothmog the Dread Terror -- Tier 2",prev={4568,4572,4574,4577,4579,4582},r={lp={{val=10}},rc={{id="7002B018",q=100,val="Medallion"}},ti={{val="Dethroner of the Dread Terror"}}},t="Lore",zone="Old Anórien"},
{id="70045CB3",name="Throne of the Dread Terror: Banes of Blackroot -- Tier 1",area="Pelennor",cat="The Battle of Pelennor",d="The Mûmakil that slew Duilin and Derufin still roam the Pelennor Fields. Set-Akâji, Arpong-Dôkh, and Kû-Nerpag pose a grave threat to those fighting beneath their heavy strides.",faction="FrP",level=105,minlevel=105,ndx=4567,["next"]={4565},o="Obj 2:\nThe Mûmakil that slew Duilin and Derufin still roam the Pelennor Fields. Set-Akâji, Arpong-Dôkh, and Kû-Nerpag pose a grave threat to those fighting beneath their heavy strides.\n* Defeat Set-Akâji, Arpong-Dôkh, and Kû-Nerpag",r={lp={{val=5}},rc={{id="7002B018",q=30,val="Medallion"}}},t="Lore",zone="Old Anórien"},
