{id="70045CC4",name="Throne of the Dread Terror: Calm of Death",area="Pelennor",cat="The Battle of Pelennor",d="On the Pelennor Fields, two of the Nazgûl stand guard outside the Causeway Forts. If their vile assault is to be ended completely, they must be banished together at once.\n<rgb=#FF0000>This deed can only be completed on Tier 2 of the Throne of the Dread Terror raid.</rgb>",faction="FrP",level=105,minlevel=105,ndx=4569,["next"]={4561},o="Obj 2:\nOn the Pelennor Fields, creatures both Living and Dead serve the Nazgûl. They must all be defeated swiftly before their Masters can use them to even worse ends.\n<rgb=#FF0000>This deed can only be completed on Tier 2 of the Throne of the Dread Terror raid.</rgb>\n* Complete Challenge: Calm of Death",r={lp={{val=5}},rc={{id="7002B018",q=100,val="Medallion"}}},t="Lore",zone="Old Anórien"},
{id="70045CC2",name="Throne of the Dread Terror: Fear or Flame",area="Pelennor",cat="The Battle of Pelennor",d="Vadokhar feeds on flame and shadow, drawing vile strength from both. You must defeat him without allowing him to gather the power of more than one type.\n<rgb=#FF0000>This deed can only be completed on Tier 2 of the Throne of the Dread Terror raid.</rgb>",faction="FrP",level=105,minlevel=105,ndx=4570,["next"]={4561},o="Obj 2:\nVadokhar feeds on flame and shadow, drawing vile strength from both. You must defeat him without allowing him to gather the power of more than one type.\n<rgb=#FF0000>This deed can only be completed on Tier 2 of the Throne of the Dread Terror raid.</rgb>\n* Complete Challenge: Fear or Flame",r={lp={{val=5}},rc={{id="7002B018",q=100,val="Medallion"}}},t="Lore",zone="Old Anórien"},
{id="70045CBB",name="Throne of the Dread Terror: Gothmog the Dread Terror -- Tier 1",area="Pelennor",cat="The Battle of Pelennor",d="After the fall of the Witch-king of Angmar, Gothmog has taken control of the hosts of Mordor and Minas Morgul. Arrogant in his connexion to Golodir, he comes to reclaim the throne of Gondor.",faction="FrP",level=105,minlevel=105,ndx=4571,["next"]={4565},o="Obj 2:\nAfter the fall of the Witch-king of Angmar, Gothmog has taken control of the hosts of Mordor and Minas Morgul. Arrogant in his connexion to Golodir, he comes to reclaim the throne of Gondor.\n* Defeat Gothmog the Dread Terror",r={lp={{val=5}},rc={{id="7002B018",q=30,val="Medallion"}}},t="Lore",zone="Old Anórien"},
