{id="70045CB1",name="Throne of the Dread Terror: Rakothas, Brother of Thrúgrath -- Tier 1",area="Pelennor",cat="The Battle of Pelennor",d="Rakothas, a brutal Olog-hai, gloats over the fallen just beyond the walls of Minas Tirith. He must be defeated before he attempts to enter the City.",faction="FrP",level=105,minlevel=105,ndx=4573,["next"]={4565},o="Obj 2:\nRakothas, a brutal Olog-hai, gloats over the fallen just beyond the walls of Minas Tirith. He must be defeated before he attempts to enter the City.\n* Defeat Rakothas",r={lp={{val=5}},rc={{id="7002B018",q=30,val="Medallion"}}},t="Lore",zone="Old Anórien"},
