{id="70045CBF",name="Throne of the Dread Terror: Short Fuse",area="Pelennor",cat="The Battle of Pelennor",d="Like his brother, Thrúgrath, Rakothas's rage cannot be contained. If he is defeated without many attempts to temper his wrath, he shall be shamed in defeat.\n<rgb=#FF0000>This deed can only be completed on Tier 2 of the Throne of the Dread Terror raid.</rgb>",faction="FrP",level=105,minlevel=105,ndx=4575,["next"]={4561},o="Obj 2:\nLike his brother, Thrúgrath, Rakothas's rage cannot be contained. If he is defeated without many attempts to temper his wrath, he shall be shamed in defeat.\n<rgb=#FF0000>This deed can only be completed on Tier 2 of the Throne of the Dread Terror raid.</rgb>\n* Complete Challenge: Short Fuse",r={lp={{val=5}},rc={{id="7002B018",q=100,val="Medallion"}}},t="Lore",zone="Old Anórien"},
{id="70045CBA",name="Throne of the Dread Terror: The Deathless Sentinels -- Tier 1",area="Pelennor",cat="The Battle of Pelennor",d="As the forces of the Enemy are renewed from within Osgiliath, two guards stand silent at the Causeway Forts. They are two of the Nine, the Deathless, and none shall threaten their Master's new commander.",faction="FrP",level=105,minlevel=105,ndx=4576,["next"]={4565},o="Obj 2:\nAs the forces of the Enemy are renewed from within Osgiliath, two guards stand silent at the Causeway Forts. They are two of the Nine, the Deathless, and none shall threaten their Master's new commander.\n* Defeat the High-sorcerer of Harad and the Woe of Khand",r={lp={{val=5}},rc={{id="7002B018",q=30,val="Medallion"}}},t="Lore",zone="Old Anórien"},
