{id="70045CB7",name="Throne of the Dread Terror: The Enslaved of Minas Morgul -- Tier 1",area="Pelennor",cat="The Battle of Pelennor",d="Under the watch of the Witch-king of Angmar and Gothmog, the cruel Black Numenóreans of Minas Morgul have unearthed terrible things beneath that vile city and have bound them into the service of the Dark Lord.",faction="FrP",level=105,minlevel=105,ndx=4578,["next"]={4565},o="Obj 2:\nUnder the watch of the Witch-king of Angmar and Gothmog, the cruel Black Numenóreans of Minas Morgul have unearthed terrible things beneath that vile city and have bound them into the service of the Dark Lord.\n* Defeat the Enslaved of Minas Morgul",r={lp={{val=5}},rc={{id="7002B018",q=30,val="Medallion"}}},t="Lore",zone="Old Anórien"},
