{id="70045CC1",name="Throne of the Dread Terror: The Returned King",area="Pelennor",cat="The Battle of Pelennor",d="In truth, Gothmog the Dread Terror is none other than Eärnur returned once more from the Void. You must survive the encounter by exploiting Gothmog's arrogance and all without succumbing to your fears.\n<rgb=#FF0000>This deed can only be completed on Tier 2 of the Throne of the Dread Terror raid.</rgb>",faction="FrP",level=105,minlevel=105,ndx=4580,["next"]={4561},o="Obj 2:\nIn truth, Gothmog the Dread Terror is none other than Eärnur returned once more from the Void. You must survive the encounter by exploiting Gothmog's arrogance and all without succumbing to your fears.\n<rgb=#FF0000>This deed can only be completed on Tier 2 of the Throne of the Dread Terror raid.</rgb>\n* Complete Challenge: The Returned King",r={lp={{val=5}},rc={{id="7002B018",q=100,val="Medallion"}}},t="Lore",zone="Old Anórien"},
{id="70045CB5",name="Throne of the Dread Terror: The Summoned -- Tier 1",area="Pelennor",cat="The Battle of Pelennor",d="The twisted rogmul, Vadokhar, has been called forth from the Void. This terrible creature is beyond the skill of many fighting on the field and must be banished before it can wreak havoc on the defenders of Gondor.",faction="FrP",level=105,minlevel=105,ndx=4581,["next"]={4565},o="Obj 2:\nThe twisted rogmul, Vadokhar, has been called forth from the Void. This terrible creature is beyond the skill of many fighting on the field and must be banished before it can wreak havoc on the defenders of Gondor.\n* Defeat Vadokhar",r={lp={{val=5}},rc={{id="7002B018",q=30,val="Medallion"}}},t="Lore",zone="Old Anórien"},
