{id="70045CC0",name="Throne of the Dread Terror: Trampling the Mûmakil",area="Pelennor",cat="The Battle of Pelennor",d="Unless one wishes to share the fates of Duilin and Derufin, it would be wise to avoid the foot-falls of the three Mûmakil.\n<rgb=#FF0000>This deed can only be completed on Tier 2 of the Throne of the Dread Terror raid.</rgb>",faction="FrP",level=105,minlevel=105,ndx=4583,["next"]={4561},o="Obj 2:\nUnless one wishes to share the fates of Duilin and Derufin, it would be wise to avoid the foot-falls of the three Mûmakil.\n<rgb=#FF0000>This deed can only be completed on Tier 2 of the Throne of the Dread Terror raid.</rgb>\n* Complete Challenge: Trampling the Mûmakil",r={lp={{val=5}},rc={{id="7002B018",q=100,val="Medallion"}}},t="Lore",zone="Old Anórien"},
{id="70045CC3",name="Throne of the Dread Terror: Unbound Corruption",area="Pelennor",cat="The Battle of Pelennor",d="The Unbroken One stands alone in defiance of the sorcerers of Minas Morgul. Only when his corruption is fully drained can you defeat those still under the thrall of the Black Numenóreans.\n<rgb=#FF0000>This deed can only be completed on Tier 2 of the Throne of the Dread Terror raid.</rgb>",faction="FrP",level=105,minlevel=105,ndx=4584,["next"]={4561},o="Obj 2:\nThe Unbroken One stands alone in defiance of the sorcerers of Minas Morgul. Only when his corruption is fully drained can you defeat those still under the thrall of the Black Numenóreans.\n<rgb=#FF0000>This deed can only be completed on Tier 2 of the Throne of the Dread Terror raid.</rgb>\n* Complete Challenge: Unbound Corruption",r={lp={{val=5}},rc={{id="7002B018",q=100,val="Medallion"}}},t="Lore",zone="Old Anórien"},
