{id="7001C11F",name="Throwing Down Sammath Gûl",area="Dol Guldur",cat="Tower of Dol Guldur",d="Sammath Gûl was once the private chambers of Sauron in his guise as the Necromancer...now they are held by his regent and his minions.",faction="FrP",level=65,minlevel=60,ndx=4586,["next"]={4015},o="Obj 2:\n* Complete Enter the Chambers\n* Complete The Spirits are the Key\n* Complete Bringing Down the Enemy",prev={1578,4464,651},r={lp={{val=10}},rc={{id="7002B018",q=30,val="Medallion"}},ti={{val="Foe of the Dark Tower"}}},t="Lore",zone="Mirkwood"},
{id="7001791A",name="Thunder and Flame",area="Rivendell Valley",cat="Class",class="Rune-keeper",d="The first four pages of this book can be found on enemies scattered across Angmar, Eregion, and Moria. The last four pages of this book can be found on enemies scattered across Forochel, Moria, and the Misty Mountains.\nThunder and Flame was scribed by a Rune-keeper of ancient Khazad-dûm, known to have been an advisor to King Durin himself. It is said that this ancient tome held many secrets of the Angerthas, passed down from the earliest days in the First Age. It speaks at length of the subtleties of the Cirth script, and how to draw forth the powers of the elements: of fire and storm and winter's chill, for use against one's enemies.\nIn the end, however, even this vastly complex might was not enough to sate the greed of the dwarves, nor prevent the destruction wrought upon Moria by the awakening of the ancient evil that slumbered in the deep.",faction="FrP",level=42,minlevel=39,ndx=4587,o="Obj 1:\n* Collect Thunder and Flame\nObj 2:\n* Talk to Elrond Half-elven at the Last Homely House in Rivendell.\nObj 3:\nAt least two copies of this book are believed to have been lost - one somewhere within Angmar and the other in the Misty-mountains.\n* Thunder and Flame, page 3\n* Thunder and Flame, page 8\n* Thunder and Flame, page 12\n* Thunder and Flame, page 19\n* Thunder and Flame, page 23\n* Thunder and Flame, page 26\n* Thunder and Flame, page 34\n* Thunder and Flame, page 42",pois={{name="Elrond",area="Rivendell Valley",dungeon="The Last Homely House",loc={"62.8N, 54.1E"},zone="The Trollshaws"}},r={lp={{val=10}}},t="Class",zone="The Trollshaws"},
