{id="7000970D",name="Tomb-defender",cat="Evendim",d="Tomb-robbers have long sifted through the ruined paths of Annúminas and the tombs of the fallen Kings of old. The Rangers of the North ally with any who would take up arms to keep these thieves and scoundrels at bay.",faction="FrP",level=30,minlevel=20,ndx=4618,["next"]={4619},o="Obj 1:\n* Defeat tomb-robbers in Evendim",r={lp={{val=5}},ri={{val="+500 with The Wardens of Annúminas"}},ti={{val="Tomb-warden"}}},t="Slayer",zone="Evendim"},
{id="7000970E",name="Tomb-defender (Advanced)",cat="Evendim",d="Those who would defile the tombs of the ancient Dúnedain grow ever bolder as chaos and the fear of war grip the lands of the North. To take up arms against such unprincipled villains is as noble a cause as any.",faction="FrP",level=30,minlevel=20,ndx=4619,["next"]={3741},o="Obj 1:\n* Complete 'Tomb-defender'\nObj 2:\n* Defeat tomb-robbers in Evendim",prev={4618},r={lp={{val=10}},rc={{id="7002B017",q=30,val="Mark"}},ri={{val="+700 with The Wardens of Annúminas"}},vx={{val=2000}}},t="Slayer",zone="Evendim"},
{id="70009FF8",name="Tombs of Evendim",cat="Evendim",d="The kings of Annúminas were intered within tombs along the road to the gate of the city.\nNine were the kings that ruled over Arnor from this ancient seat of power, but not all of them were buried in the Way of Kings...",faction="FrP",level=30,minlevel=30,ndx=4620,["next"]={1735},o="Obj 1:\nNOT USED\n* Discover Haudh Eärendur\n* Discover Haudh Elendur\n* Discover Haudh Valandur\n* Discover Haudh Elendil\n* Discover Haudh Tarondor\n* Discover Haudh Eldacar\n* Discover Haudh Tarcil\n* Discover Haudh Arantar",pois={{name="Haudh Tarondor",area="Men Erain",loc={"16.8S, 66.1W"},zone="Evendim"},{name="Haudh Eldacar",area="Men Erain",dungeon="Haudh Eldacar",loc={"17.4S, 67.5W"},zone="Evendim"},{name="Haudh Valandur",area="Men Erain",loc={"16.4S, 66.5W"},zone="Evendim"},{name="Haudh Elendil",area="Men Erain",loc={"16.6S, 66.9W"},zone="Evendim"},{name="Haudh Arantar",area="Men Erain",loc={"17.2S, 66.2W"},zone="Evendim"},{name="Haudh Eärendur",area="Men Erain",dungeon="Haudh Eärendur",loc={"17.4S, 66.7W"},zone="Evendim"},{name="Haudh Tarcil",area="Men Erain",loc={"17.1S, 66W"},zone="Evendim"},{name="Haudh Elendur",area="Men Erain",loc={"16.3S, 66W"},zone="Evendim"}},r={lp={{val=5}},rc={{id="7002B017",q=30,val="Mark"}},ri={{val="+500 with The Wardens of Annúminas"}},vx={{val=2000}}},t="Explorer",zone="Evendim"},
{id="70026BB8",name="Too Much of Everything",cat="Race & Social",d="So many races to win!",faction="FrP",level=1,minlevel=1,ndx=4621,o="Obj 1:\nSo many races to win!\n* Complete 'A Lucky Day at the Races'\nObj 2:\n* Complete deed: Much Eating, Much Running\n* Complete deed: Much Drinking, Much Running",prev={2925,2926,40},r={rc={{id="7002ADA3",q=15,val="Farmers Faire Token"},{id="70027325",val="Grant Heave Emote"}},ti={{val="Picky Picker"}}},t="Event"},
