{id="7005BF74",name="Toppler of Tûr Fúar, the Drearspire",cat="The Mountain-hold",d="After escaping the second downfall of Angmar during the War of the Ring, the Dourhands, led by Brathar Crack-helm, have laid claim to a powerful relic seized long ago by the Witch-king and secreted away to the depths of Tûr Fúar, the Drearspire.",faction="FrP",level=140,minlevel=135,ndx=4623,o="Obj 2:\nAfter escaping the second downfall of Angmar during the War of the Ring, the Dourhands, led by Brathar Crack-helm, have laid claim to a powerful relic seized long ago by the Witch-king and secreted away to the depths of Tûr Fúar, the Drearspire.\n* Complete Tûr Fúar, the Drearspire -- Tier 1\n* Complete Tûr Fúar, the Drearspire -- Tier 2\n* Complete Tûr Fúar, the Drearspire -- Tier 3\n* Complete Tûr Fúar, the Drearspire -- Doom of the Dourhands\n* Complete Tûr Fúar, the Drearspire -- Dark Reflections",prev={4758,4759,4761,4762,4763},r={rc={{id="70059FCB",q=3,val="Silver Coin of Gundabad"}},ti={{val="Saviour of the Oath-thralls"}},vx={{val=3000}},xp={{val=211000}}},t="Slayer"},
{id="7001E9CF",name="Toppling of Barad Gúlaran",cat="Shadows of Angmar",d="You have been called upon to do all that needs to be done to close the gates of Barad Gúlaran forever.",faction="FrP",level=50,minlevel=50,ndx=4624,["next"]={3576},o="Obj 1:\n* Complete The Minions of Wisdán\n* Complete Lore of the Enemy\n* Complete Champions of Barad Gúlaran\n* Complete The Dead That Live\n* Complete Allies of the Enemy",prev={126,2788,4179,4366,753},r={lp={{val=10}},ti={{val="Rogmul's Bane"}}},t="Lore"},
