{id="70037EF0",name="Total Attention",cat="Class",class="Hunter",d="Sometimes taking that extra second to concentrate and focus on your target makes all the difference.",faction="FrP",level=30,minlevel=30,ndx=4627,["next"]={833},o="Obj 1:\nThis is your objective description.\n* Use Intent Concentration",r={lp={{val=5}}},t="Class"},
{id="7002BD6B",name="Tower of Orthanc: Acid Wash",cat="Rise of Isengard",d="True warriors should be able to face their challenges without error. In the depths of the Undergard, it is no different.\n<rgb=#FF0000>This deed may only be completed on Tier 2 in the acid wing of the Tower of Orthanc Raid.</rgb>",faction="FrP",level=75,minlevel=75,ndx=4628,o="Obj 2:\nTrue warriors should be able to face their challenges without error. In the depths of the Undergard, it is no different.\n<rgb=#FF0000>This deed may only be completed on Tier 2 of the Tower of Orthanc Raid.</rgb>\n* Complete Challenge: Acid Wash",r={lp={{val=5}},rc={{id="7002B018",q=20,val="Medallion"}}},t="Lore"},
{id="7002BDFB",name="Tower of Orthanc: Challenger of Saruman",area="Nan Curunír",cat="Rise of Isengard",d="You have risen to the challenge and destroyed all of Saruman's rings in one fell swoop.",faction="FrP",level=75,minlevel=75,ndx=4629,o="Obj 1:\nYou have risen to the challenge and destroyed all of Saruman's rings in one fell swoop.\n* Defeat all challenges within the Tower of Orthanc in a single raid",r={ti={{val="Challenger of Saruman"}}},t="Lore",zone="Dunland"},
{id="7002BD6A",name="Tower of Orthanc: Conductivity",cat="Rise of Isengard",d="Bearing a ring with the power of the storm, Saruman's troll-lieutenant can electrify the very air around him. Perhaps if you wait until the room is fully charged, you may be able to turn the tables upon him.\n<rgb=#FF0000>This deed can only be completed on Tier 2 in the lightning wing of the Tower of Isengard Raid.</rgb>",faction="FrP",level=75,minlevel=75,ndx=4630,o="Obj 2:\nBearing a ring with the power of the storm, Saruman's troll-lieutenant can electrify the very air around him. Perhaps if you wait until the room is fully charged, you may be able to turn the tables upon him.\n<rgb=#FF0000>This deed can only be completed on Tier 2 in the lightning wing of the Tower of Isengard Raid.</rgb>\n* Complete Challenge: Conductivity",r={lp={{val=5}},rc={{id="7002B018",q=20,val="Medallion"}}},t="Lore"},
{id="7002BD69",name="Tower of Orthanc: Dancing in the Dark",cat="Rise of Isengard",d="The power of Shadow is one of the greatest strengths the Enemy possesses. Saruman has harnessed this power and given it to his apprentice in the form of a ring. The sooner you defeat the apprentice, the faster that threat is removed.\n<rgb=#FF0000>This deed can only be completed on Tier 2 in the Shadow wing of the Tower of Orthanc Raid.</rgb>",faction="FrP",level=75,minlevel=75,ndx=4631,o="Obj 2:\nThe power of Shadow is one of the greatest strengths the Enemy possesses. Saruman has harnessed this power and given it to his apprentice in the form of a ring. The sooner you defeat the apprentice, the faster that threat is removed.\n<rgb=#FF0000>This deed can only be completed on Tier 2 in the Shadow wing of the Tower of Orthanc Raid.</rgb>\n* Complete Challenge: Dancing in the Dark",r={lp={{val=5}},rc={{id="7002B018",q=20,val="Medallion"}}},t="Lore"},
{id="7002BD5D",name="Tower of Orthanc: Destroyer of Rings",cat="Rise of Isengard",d="Saruman learned the art of Ring-smithy and made for himself many lesser rings of power. Their existence cannot be allowed to continue.\n<rgb=#FF0000>This deed can only be completed on Tier 2 of the Tower of Orthanc Raid.</rgb>",faction="FrP",level=75,minlevel=75,ndx=4632,["next"]={4073},o="Obj 2:\nSaruman learned the art of Ring-smithy and made for himself many lesser rings of power. Their existence cannot be allowed to continue.\n<rgb=#FF0000>This deed can only be completed on Tier 2 of the Tower of Orthanc Raid.</rgb>\n* Complete the Mind of Saruman -- Tier 1\n* Complete the Mind of Saruman -- Tier 2\n* Complete Challenge: Fire and Ice\n* Complete Challenge: Conductivity\n* Complete Challenge: Acid Wash\n* Complete Challenge: Dancing in the Dark\n* Complete Challenge: Pinnacle of Orthanc",prev={4646,4647},r={rc={{id="7002BE05",val="Model of Orthanc"}}},t="Lore"},
{id="7002BD68",name="Tower of Orthanc: Fire and Ice",cat="Rise of Isengard",d="These lieutenants of Saruman become more powerful as the battle rages. Defeat the brothers while their power is at its lowest and seize the day.\n<rgb=#FF0000>This deed may only be completed on Tier 2 in the fire and ice wing of the Tower of Orthanc Raid.</rgb>",faction="FrP",level=75,minlevel=75,ndx=4633,o="Obj 2:\nThese lieutenants of Saruman become more powerful as the battle rages. Defeat the brothers while their power is at its lowes and seize the day.\n<rgb=#FF0000>This deed may only be completed on Tier 2 in the fire and ice wing of the Tower of Orthanc Raid.</rgb>\n* Complete Challenge: Fire and Ice",r={lp={{val=5}},rc={{id="7002B018",q=20,val="Medallion"}}},t="Lore"},
{id="7002BE01",name="Tower of Orthanc: Original Challenger of Saruman",area="Nan Curunír",cat="Rise of Isengard",d="You were the first to rise to the challenge and destroy all of Saruman's rings in one fell swoop.",faction="FrP",level=75,minlevel=75,ndx=4634,o="Obj 1:\nYou were the first to rise to the challenge and destroy all of Saruman's rings in one fell swoop.\n* Be the first to defeat all challenges within the Tower of Orthanc in a single raid",r={ti={{val="Original Challenger of Saruman"}}},t="Lore",zone="Dunland"},
{id="7002BD6C",name="Tower of Orthanc: Pinnacle of Orthanc",cat="Rise of Isengard",d="From the Pinnacle of Orthanc, Saruman of Many Colours -- once Saruman the White, greatest of the Wizards -- reads the stars and looks out over his domain. To face a Wizard is madness, but to face him and survive is a sign of true heroism.",faction="FrP",level=75,minlevel=75,ndx=4635,o="Obj 2:\nFrom the Pinnacle of Orthanc, Saruman of Many Colours -- once Saruman the White, greatest of the Wizards -- reads the stars and looks out over his domain. To face a Wizard is madness, but to face him and survive is a sign of true heroism.\n* Complete Challenge: Pinnacle of Orthanc",r={lp={{val=5}},rc={{id="7002B018",q=20,val="Medallion"}}},t="Lore"},
{id="7002BD1E",name="Tower of Orthanc: Ring of Acid -- Tier 1",area="Isengard",cat="Rise of Isengard",d="Saruman's evil has broken all boundaries of the Order of Wizards. Seeking to create more twisted creatures, he sealed many Orcs, Wargs, and Dunlendings in a chamber filled with acids and many vile poisons. Add a lesser ring of power, and the result was terrifying.",faction="FrP",level=75,minlevel=75,ndx=4636,["next"]={4646},o="Obj 2:\nSaruman's evil has broken all boundaries of the Order of Wizards. Seeking to create more twisted creatures, he sealed many Orcs, Wargs, and Dunlendings in a chamber filled with acids and many vile poisons. Add a lesser ring of power, and the result was terrifying.\n* Claim the Ring of Acid",r={lp={{val=5}},rc={{id="7002B018",q=20,val="Medallion"}}},t="Lore",zone="Dunland"},
{id="7002BD1F",name="Tower of Orthanc: Ring of Acid -- Tier 2",area="Isengard",cat="Rise of Isengard",d="Saruman's evil has broken all boundaries of the Order of Wizards. Seeking to create more twisted creatures, he sealed many Orcs, Wargs, and Dunlendings in a chamber filled with acids and many vile poisons. Add a lesser ring of power, and the result was terrifying.\n<rgb=#FF0000>This deed can only be completed on Tier 2 in the acid wing of the Tower of Isengard Raid.</rgb>",faction="FrP",level=75,minlevel=75,ndx=4637,["next"]={4647},o="Obj 2:\nSaruman's evil has broken all boundaries of the Order of Wizards. Seeking to create more twisted creatures, he sealed many Orcs, Wargs, and Dunlendings in a chamber filled with acids and many vile poisons. Add a lesser ring of power, and the result was terrifying.\n<rgb=#FF0000>This deed can only be completed on Tier 2 in the acid wing of the Tower of Isengard Raid.</rgb>\n* Claim the Ring of Acid",r={lp={{val=5}},rc={{id="7002B018",q=20,val="Medallion"}}},t="Lore",zone="Dunland"},
{id="7002BD20",name="Tower of Orthanc: Ring of Lightning -- Tier 1",area="Isengard",cat="Rise of Isengard",d="The Free Peoples often believe trolls to be drooling, unthinking monsters -- and often they are correct -- but it is not the rule. Some of the Enemy's greatest and most intelligent leaders are trolls, and Saruman has acquired one of these for himself. To this beast, he has given a ring which imbues upon him the power of the storm....",faction="FrP",level=75,minlevel=75,ndx=4638,["next"]={4646},o="Obj 2:\nThe Free Peoples often believe trolls to be drooling, unthinking monster -- and often they are correct -- but it is not the rule. Some of the Enemy's greatest and most intelligent leaders are trolls, and Saruman has acquired one of these for himself. To this beast, he has given a ring which imbues upon him the power of the storm....\n* Claim the Ring of Lightning",r={lp={{val=5}},rc={{id="7002B018",q=20,val="Medallion"}}},t="Lore",zone="Dunland"},
{id="7002BD21",name="Tower of Orthanc: Ring of Lightning -- Tier 2",area="Isengard",cat="Rise of Isengard",d="The Free Peoples often believe trolls to be drooling, unthinking monsters -- and often they are correct -- but it is not the rule. Some of the Enemy's greatest and most intelligent leaders are trolls, and Saruman has acquired one of these for himself. To this beast, he has given a ring which imbues upon him the power of the storm....\n<rgb=#FF0000>This deed can only be completed on Tier 2 in the lightning wing of the Tower of Isengard Raid.</rgb>",faction="FrP",level=75,minlevel=75,ndx=4639,["next"]={4647},o="Obj 2:\nThe Free Peoples often believe trolls to be drooling, unthinking monster -- and often they are correct -- but it is not the rule. Some of the Enemy's greatest and most intelligent leaders are trolls, and Saruman has acquired one of these for himself. To this beast, he has given a ring which imbues upon him the power of the storm....\n<rgb=#FF0000>This deed can only be completed on Tier 2 in the lightning wing of the Tower of Isengard Raid.</rgb>\n* Claim the Ring of Lightning",r={lp={{val=5}},rc={{id="7002B018",q=20,val="Medallion"}}},t="Lore",zone="Dunland"},
{id="7002BD23",name="Tower of Orthanc: Ring of Shadow -- Tier 1",area="Isengard",cat="Rise of Isengard",d="Saruman's apprentice, an Orc-defiler of great power, awaits you in the Throne-room of Orthanc. Wielding the Ring of Shadow, he will be a perilous foe to defeat.",faction="FrP",level=75,minlevel=75,ndx=4640,["next"]={4646},o="Obj 2:\nSaruman's apprentice, an Orc-defiler of great power, awaits you in the Throne-room of Orthanc. Wielding the Ring of Shadow, he will be a perilous foe to defeat.\n* Claim the Ring of Shadow",r={lp={{val=5}},rc={{id="7002B018",q=20,val="Medallion"}}},t="Lore",zone="Dunland"},
{id="7002BD22",name="Tower of Orthanc: Ring of Shadow -- Tier 2",area="Isengard",cat="Rise of Isengard",d="Saruman's apprentice, an Orc-defiler of great power, awaits you in the Throne-room of Orthanc. Wielding the Ring of Shadow, he will be a perilous foe to defeat.\n<rgb=#FF0000>This deed can only be completed on Tier 2 in the shadow wing of the Tower of Orthanc Raid.</rgb>",faction="FrP",level=75,minlevel=75,ndx=4641,["next"]={4647},o="Obj 2:\nSaruman's apprentice, an Orc-defiler of great power, awaits you in the Throne-room of Orthanc. Wielding the Ring of Shadow, he will be a perilous foe to defeat.\n<rgb=#FF0000>This deed can only be completed on Tier 2 in the shadow wing of the Tower of Orthanc Raid.</rgb>\n* Claim the Ring of Shadow",r={lp={{val=5}},rc={{id="7002B018",q=20,val="Medallion"}}},t="Lore",zone="Dunland"},
{id="7002BD25",name="Tower of Orthanc: Rings of Fire and Frost -- Tier 1",area="Isengard",cat="Rise of Isengard",d="Two Dunlending brothers, trusted by Saruman of Many Colours, received lesser rings of power from their master as a reward for their unswerving service. Now, imbued with the powers of fire and ice, they have grown into terrible monsters.",faction="FrP",level=75,minlevel=75,ndx=4642,["next"]={4646},o="Obj 2:\nTwo Dunlending brothers, trusted by Saruman of Many Colours, received lesser rings of power from their master as a reward for their unswerving service. Now, imbued with the powers of fire and ice, they have grown into terrible monsters.\n* Claim the Rings of Fire and Frost",r={lp={{val=5}},rc={{id="7002B018",q=20,val="Medallion"}}},t="Lore",zone="Dunland"},
{id="7002BD24",name="Tower of Orthanc: Rings of Fire and Frost -- Tier 2",area="Isengard",cat="Rise of Isengard",d="Two Dunlending brothers, trusted by Saruman of Many Colours, received lesser rings of power from their master as a reward for their unswerving service. Now, imbued with the powers of fire and ice, they have grown into terrible monsters.\n<rgb=#FF0000>This deed can only be completed on Tier 2 in the fire and ice wing of the Tower of Orthanc Raid.</rgb>",faction="FrP",level=75,minlevel=75,ndx=4643,["next"]={4647},o="Obj 2:\nTwo Dunlending brothers, trusted by Saruman of Many Colours, received lesser rings of power from their master as a reward for their unswerving service. Now, imbued with the powers of fire and ice, they have grown into terrible monsters.\n<rgb=#FF0000>This deed can only be completed on Tier 2 in the fire and ice wing of the Tower of Orthanc Raid.</rgb>\n* Claim the Rings of Fire and Frost",r={lp={{val=5}},rc={{id="7002B018",q=20,val="Medallion"}}},t="Lore",zone="Dunland"},
{id="7002BD28",name="Tower of Orthanc: Saruman's Ring -- Tier 1",area="Nan Curunír",cat="Rise of Isengard",d="You now know that Saruman himself wields the master of the five you took from his lieutenants. The only hope you have to destroy his ring, is to turn the others against it.",faction="FrP",level=75,minlevel=75,ndx=4644,["next"]={4646},o="Obj 2:\nYou now know that Saruman himself wields the master of the five you took from his lieutenants. The only hope you have to destroy his ring, is to turn the others against it.\n* Destroy Saruman's Ring",r={lp={{val=5}},rc={{id="7002B018",q=20,val="Medallion"}}},t="Lore",zone="Dunland"},
