{id="7002BD35",name="Tower of Orthanc: The Mind of Saruman -- Tier 1",cat="Rise of Isengard",d="Saruman's will is carried out by his most trusted lieutenants to whom he granted five lesser rings of power, crafted by his hand. The master of these rings he retains, though through it, he is further influenced by the will of Sauron.",faction="FrP",level=75,minlevel=75,ndx=4646,["next"]={4632},o="Obj 2:\nSaruman's will is carried out by his most trusted lieutenants to whom he granted five lesser rings of power, crafted by his hand. The master of these rings he retains, though through it, he is further influenced by the will of Sauron.\n* Complete the Ring of Acid -- Tier 1\n* Complete the Ring of Lightning -- Tier 1\n* Complete the Rings of Fire and Frost -- Tier 1\n* Complete the Ring of Shadow -- Tier 1\n* Complete Saruman's Ring -- Tier 1",prev={4636,4638,4640,4642,4644},r={lp={{val=10}},rc={{id="7002B018",q=30,val="Medallion"}}},t="Lore"},
