{id="7006D320",name="Tûl Zakana, the Well of Forgetting -- Tier 1",area="Sugâkh Mire",cat="The Legacy of Morgoth",d="Deep in the war-torn lands of Imhûlar, locals warn you of an Ordâkhai encampment, a trading post of sorts. It is known as Tûl Zakana, the Well of Forgetting, whose waters will make you forget your troubles, and, if you drink enough, even who you are. But unless you are trading for this water, it's best to stay well clear of the Well, for many have vanished near it, never to be seen again. You are now tasked by the families of the vanished with investigating the Well and its secrets.",faction="FrP",level=150,minlevel=150,ndx=4754,["next"]={4824},o="Obj 2:\n* Complete 'Tûl Zakana, the Well of Forgetting -- Tier 1'",r={rc={{id="7006B23F",q=3,val="Shagâni Ghín"}},vx={{val=500}},xp={{val=344000}}},t="Slayer",zone="Imhûlar"},
