{id="70037F5B",name="Valour",cat="Class",class="Captain",d="Sometimes courage and motivation just aren't enough, you need to dig deep for that little bit extra.",faction="FrP",level=10,minlevel=10,ndx=4814,["next"]={794},o="Obj 1:\n* Crit or Devastate with Words of Courage or Rallying Cry",r={lp={{val=5}}},t="Class"},
{id="700001F4",name="Valour's Marches",area="Rivendell Valley",c={"* 4.70S, 36.80W - Iron-Crown Commander (page 26)\n* 0.10N, 34.30W - Iron-Crown Fighter (page 26)\n* 0.40S, 34.90W - Tarkrip Basher (page 1)"},cat="Class",class="Minstrel",d="The first four pages of this book can be found on enemies scattered across Angmar, Eregion, and Moria. The last four pages of this book can be found on enemies scattered across Forochel, Moria, and the Misty Mountains.\nValour's Marches -- the very title of the book you hold stirs something within your breast as you look upon it. Though its cover crumbles with age, the binding remains strong, as if infused with the same martial fervour that the melodies within it strive to invoke. This book is one of the rare few that survived the fall of the kingdom of Númenor, coming across the waves by some unlikely circumstance to Middle-earth, where it has lain hidden for ages. Though written in the Sindarin tongue, the songs are those of the noble kingdoms of Men. Nevertheless, they speak to the heart of any who would face battle, calling forth visions of endless, shining hosts on the march, thundering with the clash of steel in a thousand voices.\nIn the hands of a minstrel, these songs of martial eminence provide crucial insight into the working of the warrior's heart and how it might be aroused from its slumber in times of need. If only so many of the songs were not frustratingly missing from the volume you now hold. Perhaps Lindir of Rivendell may be able to help fill the voids.",faction="FrP",level=46,minlevel=39,ndx=4815,o="Obj 1:\n* Collect Valour's Marches\nObj 2:\n* Talk to Lindir at the Last Homely House in Rivendell\nObj 3:\n* Valour's Marches, page 1\n* Valour's Marches, page 5\n* Valour's Marches, page 7\n* Valour's Marches, page 8\n* Valour's Marches, page 12\n* Valour's Marches, page 16\n* Valour's Marches, page 23\n* Valour's Marches, page 26",pois={{name="Lindir",area="Rivendell Valley",dungeon="The Last Homely House",loc={"63.5N, 53.9E"},zone="The Trollshaws"}},r={lp={{val=10}},rc={{id="70000F31",val="Distilled Athelas Essence"}}},t="Class",zone="The Trollshaws"},
