{id="7005CC44",name="Vanquisher of Dhúrstrok",area="Deepscrave",cat="The Mountain-hold",d="High among the catwalks of Deepscrave lies Dhúrstrok, the stronghold of Gorgar the Ruthless. Somewhere within these aging halls filled with dwarf-relics, Gorgar's loyal generals have imprisoned Lord Náin. It is up to you to free him.",faction="FrP",level=140,minlevel=130,ndx=4819,["next"]={893},o="Obj 2:\n* Complete Assault on Dhúrstrok -- Tier 1\n* Complete Assault on Dhúrstrok -- Tier 2\n* Complete Assault on Dhúrstrok -- Tier 3",prev={372,373,374},r={rc={{id="70059FCB",q=3,val="Silver Coin of Gundabad"}},ti={{val="Vanquisher of Dhúrstrok"}},vx={{val=3000}},xp={{val=211000}}},t="Slayer",zone="Gundabad"},
