{id="7006D080",name="Vanquisher of Nirgambâr, the Restless Tomb",area="Sang Dûshu",cat="The Legacy of Morgoth",d="In a sheltered valley in the north of Khûd Zagin stand ancient, crumbling ziggurat-tombs of pale stone collectively known as Nirgambâr. Scouts have reported that one of the Zidemel's men, Andur, is said to have entered Nirgambâr drawn their by dark whispers. Locate and stop Andur before he can unleash what lurks in this cursed place.",faction="FrP",level=150,minlevel=150,ndx=4821,o="Obj 2:\n* Complete 'Nirgambâr, the Restless Tomb -- Tier 1'\n* Complete 'Nirgambâr, the Restless Tomb -- Tier 2'\n* Complete 'Nirgambâr, the Restless Tomb -- Tier 3'\n* Complete 'Nirgambâr, the Restless Tomb -- Restless Dead'",prev={2962,2963,2964,2966},r={rc={{id="7006B23F",q=5,val="Shagâni Ghín"}},ti={{val="the Tomb-tamer"}},vx={{val=1000}},xp={{val=344000}}},t="Slayer",zone="Khûd Zagin"},
