{id="700589F7",name="Vanquisher of Shakalush, the Stair Battle",area="The War of Three Peaks",cat="The War of Three Peaks",d="A hidden entrance called Bagûd-mekhem, the Gate of Wind, lies just east of Gundabad. Zhurmat, with his fearsome mount the horrible two-headed troll Groz-and-Ulk, leads a force that threatens the Gabil'akkâ below.",faction="FrP",level=130,minlevel=125,ndx=4823,o="Obj 2:\n* Complete 'Shakalush, the Stair Battle -- Tier 1'\n* Complete 'Shakalush, the Stair Battle -- Tier 2'\n* Complete 'Shakalush, the Stair Battle -- Tier 3'\n* Complete 'Shakalush, the Stair Battle: Orc-slayer'\n* Complete 'Shakalush, the Stair Battle: Hobgoblin-slayer'\n* Complete 'Shakalush, the Stair Battle -- Tier 4'\n* Complete 'Shakalush, the Stair Battle -- Tier 5'",prev={3636,3637,3638,3639,3640,3641,3643},r={rc={{id="70057CBA",q=3,val="Copper Coin of Gundabad"}},ti={{val="Crusher Smasher"}},vx={{val=2000}},xp={{val=130000}}},t="Slayer",zone="Elderslade"},
{id="7006D31F",name="Vanquisher of Tûl Zakana, the Well of Forgetting",area="Sugâkh Mire",cat="The Legacy of Morgoth",d="Deep in the war-torn lands of Imhûlar, locals warn you of an Ordâkhai encampment, a trading post of sorts. It is known as Tûl Zakana, the Well of Forgetting, whose waters will make you forget your troubles, and, if you drink enough, even who you are. But unless you are trading for this water, it's best to stay well clear of the Well, for many have vanished near it, never to be seen again. You are now tasked by the families of the vanished with investigating the Well and its secrets.",faction="FrP",level=150,minlevel=150,ndx=4824,o="Obj 2:\n* Complete 'Tûl Zakana, the Well of Forgetting -- Tier 1'\n* Complete 'Tûl Zakana, the Well of Forgetting -- Tier 2'\n* Complete 'Tûl Zakana, the Well of Forgetting -- Tier 3'\n* Complete 'Tûl Zakana, the Well of Forgetting -- Ordâkhai'",prev={4753,4754,4755,4756},r={rc={{id="7006B23F",q=5,val="Shagâni Ghín"}},ti={{val="the Absent-minded"}},vx={{val=1000}},xp={{val=344000}}},t="Slayer",zone="Imhûlar"},
