{id="700095E1",name="Wanderer of Evendim",cat="Evendim",d="The lands of Evendim -- once the capital of the North Kingdom of Arnor -- have long lay uninhabited by Men, besides small bands of scavengers and robbers who pick through the ancient ruins and tombs that lie along the edge of the great lake.\nAs the forces of the North are aroused for war, those who gain control over this ancient seat of power may gain a critical advantage in the conflict to come.",faction="FrP",level=30,minlevel=1,ndx=4858,["next"]={3178},o="Obj 1:\nComplete Quests in Evendim.\n* Complete quests in Evendim",r={lp={{val=10}},ri={{val="+300 with The Wardens of Annúminas"}},vx={{val=2000}}},t="Reputation",zone="Evendim"},
{id="70018A4C",name="Wanderer of the Central Levels",cat="Moria",d="The dwarves of the Central Halls expeditions will need a great deal of help in overcoming the obstacles that await them in the Mines of Moria. Your assistance will be welcome, for there is much work to be done if Khazad-dûm is to be hospitable once more.",faction="FrP",level=55,minlevel=47,ndx=4859,["next"]={3882},o="Obj 2:\nComplete Quests in the Central Halls of Moria.\n* Complete quests in the Central Halls",r={lp={{val=10}},ri={{val="+700 with Iron Garrison Miners"}},vx={{val=2000}}},t="Reputation",zone="Moria"},
