{id="700095E3",name="Warden of Evendim",cat="Evendim",d="Though there is no industry, agriculture, or indeed any great strategic bastion to be found in Evendim, it could nonetheless become a great symbol among the Men of the North were the great capital of Annúminas ever to rise again under the banner of the ancient kings.",faction="FrP",level=30,minlevel=1,ndx=4870,["next"]={1094},o="Obj 1:\nComplete Pilgrim of Evendim.\n* Complete 'Pilgrim of Evendim'\nObj 2:\nComplete Evendim Quests\n* Complete quests in Evendim",prev={3178},r={lp={{val=15}},rc={{id="7002B017",q=30,val="Mark"}},ri={{val="+700 with The Wardens of Annúminas"}},vx={{val=2000}}},t="Reputation",zone="Evendim"},
