{id="70005BA5",name="Where Giants Dwell",cat="Misty Mountains",d="Travellers have long told tales of the mighty and capricious giants that inhabit the cold peaks of the Misty Mountains. You must seek out their places for yourself however, for there are few who have seen them left to tell you the way.",faction="FrP",level=40,minlevel=30,ndx=4957,["next"]={1772},o="Obj 1:\nExplore stuff.\n* Discover The Lornstone\n* Discover Greybough End\n* Discover The Giant's Needle\n* Discover Iorbar\n* Discover Gabilazan",pois={{name="Greybough End",area="Giant Halls",loc={"31.3S, 3.3E"},zone="The Misty Mountains"},{name="The Lornstone",area="Giant Halls",loc={"30.3S, 2.6E"},zone="The Misty Mountains"},{name="The Giant's Needle",area="Giant Halls",loc={"30.4S, 3.5E"},zone="The Misty Mountains"},{name="Gabilazan",area="Giant Halls",loc={"28.4S, 0E","28.7S, 0E"},zone="The Misty Mountains"},{name="Iorbar",area="Giant Halls",loc={"28.4S, 3.9E","28.5S, 3.6E","28.8S, 3.5E","28.8S, 4.3E","28.9S, 3.8E","29.1S, 4.2E","29.3S, 3.8E","29.5S, 4.3E","29.9S, 4.7E","29S, 3.4E","30.6S, 5.1E","30.6S, 5.7E","30.7S, 4.4E","30.9S, 4E","31.1S, 4E","31.5S, 4.4E"},zone="The Misty Mountains"}},r={lp={{val=10}},rc={{id="7002B017",q=30,val="Mark"}},ri={{val="+500 with Elves of Rivendell"}},vx={{val=2000}}},t="Explorer",zone="The Misty Mountains"},
{id="7001791C",name="Whispers in the Dark",area="Rivendell Valley",cat="Class",class="Rune-keeper",d="The first four pages of this book can be found on enemies scattered across Angmar, Eregion, and Moria. The last four pages of this book can be found on enemies scattered across Forochel, Moria, and the Misty Mountains.\n\\qWhispers in the Dark,\\q one of the strangest books ever written, was actually penned by a Rune-keeper of the race of Man, not an Elf or dwarf. He hailed from Rhudaur not long before its fall in the war between Arnor and the forces of the Witch-king. Its pages discuss the powers of the class no Man has ever been able to follow, much less master. The writing is mad, scribbled in wild, uneven runes in a disorganized manner upon stained pages, many of which are loose leaves simply stuffed into the book. The writer was driven to madness by seeking the secrets of Rune-craft, but rumour has it that great and terrible discoveries were recorded in this text. The book's spine is cracked and weak, and only the first half of its pages cling, yellowed and fragile, to this withered binding. Elrond would yearn to know what the lost pages contain.",faction="FrP",level=46,minlevel=39,ndx=4958,o="Obj 1:\n* Collect Whispers in the Dark\nObj 2:\nElrond can usually be found dwelling in his library in the Last Homely House in Rivendell, where rare and excellent volumes line the walls in plenty. He is sure to be delighted to look upon such a treasure as \"Whispers in the Dark.\"\n* Talk to Elrond Half-elven at the Last Homely House in Rivendell\nObj 3:\n* \"Whispers in the Dark,\" page 3\n* \"Whispers in the Dark,\" page 8\n* \"Whispers in the Dark,\" page 13\n* \"Whispers in the Dark,\" page 15\n* \"Whispers in the Dark,\" page 18\n* \"Whispers in the Dark,\" page 25\n* \"Whispers in the Dark,\" page 32\n* \"Whispers in the Dark,\" page 39",pois={{name="Elrond",area="Rivendell Valley",dungeon="The Last Homely House",loc={"62.8N, 54.1E"},zone="The Trollshaws"}},r={lp={{val=10}}},t="Class",zone="The Trollshaws"},
{id="7001BCBA",name="Why Your Head Hurts",cat="Race & Social",d="You have been roundly knocked about by your opponents.",faction="FrP",level=1,minlevel=1,ndx=4959,o="Obj 1:\nIs this the Spring Festival? Where is the maze?\n* Successfully complete the Mightiest Blow -- Expert quest",r={ti={{val="Battered, Bruised, and Contused"}}},t="Event"},
{id="70005BE0",name="Wight-slayer",c={"Wights are found all over the Barrow Downs, southwest of Bree."},cat="Bree-land",d="Long ago, the Barrow-downs fell under a shadow of evil, and the Witch-king sent fell spirits out of Angmar and Rhudaur to stir the bones of the dead which lay beneath the green mounds. Something has disturbed the Dead that Walk, and you must lay their bones to rest.",faction="FrP",level=15,minlevel=10,ndx=4960,["next"]={4964},o="Obj 1:\n* Defeat wights in Bree-land",r={lp={{val=5}},ri={{val="+500 with Men of Bree"}},ti={{val="Bane of the Barrows"}}},t="Slayer",zone="Bree-land"},
